('1d4cb92f-c524-475c-b9fe-77158c986a8c','2019-10-01 18:01:25.448','2019-10-01 18:01:25.448',NULL,'c9fed0a1-4b66-467f-8970-d485274dbb11','',NULL,NULL,NULL,NULL,1,false,true,false,'','3DS is one of the file formats used by the Autodesk 3ds Max 3D modeling, animation and rendering software.',NULL,NULL)
,('9c6bbd08-4ec7-4945-8165-eb2e3d9656cc','2019-10-01 18:01:26.070','2019-10-01 18:01:26.070',NULL,'5d242384-8c2b-4776-ae56-f4e487656a65','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('9b50ed42-dbdc-4394-b0c0-23e5e3dabc3e','2019-10-01 18:01:26.555','2019-10-01 18:01:26.555',NULL,'71f36e68-e83b-4a52-bec0-e9780c8ece98','',NULL,NULL,NULL,NULL,1,false,true,false,'1','The 3DM (openNURBS) format is a 3D model representation based on non-uniform rational B-Splines (NURBS). The file format is defined by an open source C++ toolkit that reads and writes openNURBS models.',NULL,NULL)
,('19d85183-2110-4bd9-989c-54bfbb5fba58','2019-10-01 18:01:27.002','2019-10-01 18:01:27.002',NULL,'d93a5dde-7be8-4bbc-af65-f7a7f9eb9e40','',NULL,NULL,NULL,NULL,1,false,true,false,'2','The 3DM (openNURBS) format is a 3D model representation based on non-uniform rational B-Splines (NURBS). The file format is defined by an open source C++ toolkit that reads and writes openNURBS models.',NULL,NULL)
,('a67a16e7-5d68-4dc7-8681-2017cc31978a','2019-10-01 18:01:27.615','2019-10-01 18:01:27.615',NULL,'5d3a6092-1dda-44cb-a861-6389d3ea36cd','',NULL,NULL,NULL,NULL,1,false,true,false,'3','The 3DM (openNURBS) format is a 3D model representation based on non-uniform rational B-Splines (NURBS). The file format is defined by an open source C++ toolkit that reads and writes openNURBS models.',NULL,NULL)
,('407c9665-1576-44ed-940c-94a02ed10dc4','2019-10-01 18:01:28.151','2019-10-01 18:01:28.151',NULL,'9a5c5612-ccbb-4c85-a471-eecaa7f1b1bd','',NULL,NULL,NULL,NULL,1,false,true,false,'4','The 3DM (openNURBS) format is a 3D model representation based on non-uniform rational B-Splines (NURBS). The file format is defined by an open source C++ toolkit that reads and writes openNURBS models.','2006-09-01 00:00:00.000',NULL)
,('95afb21b-1767-4201-8310-4baaa52027d8','2019-10-01 18:01:28.643','2019-10-01 18:01:28.643',NULL,'c286f43a-9d92-4d39-be3c-febc096dea0d','',NULL,NULL,NULL,NULL,1,false,true,false,'5','The 3DM (openNURBS) format is a 3D model representation based on non-uniform rational B-Splines (NURBS). The file format is defined by an open source C++ toolkit that reads and writes openNURBS models.',NULL,NULL)
,('3929191f-3b1d-4287-8ccc-a2223f436d19','2019-10-01 18:01:29.172','2019-10-01 18:01:29.172',NULL,'7cad2850-1a13-4deb-af25-09013cbe1278','',NULL,NULL,NULL,NULL,1,false,true,false,'','A MAX file is a three-dimensional scene file. They are created by 3DS Max, a 3D modeling, animation, and rendering application. It may contain multiple models that include wireframes, textures, lighting effects, shading, animation, and other 3D design elements.',NULL,NULL)
