,('71cd0bbc-5bff-4171-adbd-5e9729fa6c41','2019-10-01 18:01:36.258','2019-10-01 18:01:36.258',NULL,'9fd547d0-7742-4816-ad58-6932ee8d65cd','',NULL,NULL,NULL,NULL,1,false,true,false,'','The AccessData Custom Content Image (AD1) file format is a file-level disk image format created by AccessData''s proprietary forensic software, such as FTK Imager.

