,('4124dfde-c4fb-4a8d-805d-b403a7e6c140','2019-10-01 18:01:37.815','2019-10-01 18:01:37.815',NULL,'0ce87e71-548f-4d66-adcd-2dccc701c313','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Portable Document Format is a platform-independent format for representing formatted documents, developed by Adobe Systems Incorporated. It is the native format of Adobe’s Acrobat family of software products, version 1.0 corresponding to the release of Acrobat 1.0. PDF is based on, and shares the same imaging model as, the PostScript page description language. A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section. PDF files can contain a wide variety of content, including text, images, video and audio.',NULL,NULL)
