,('31f0596f-631a-4bd5-94b8-1a488c6a7f32','2019-10-01 18:01:41.131','2019-10-01 18:01:41.131',NULL,'1bec3927-b341-4f48-8d5a-b2570dc791fd','',NULL,NULL,NULL,NULL,1,false,true,false,'1.6','Portable Document Format is a platform-independent format for representing formatted documents, developed by Adobe Systems Incorporated. It is the native format of Adobe’s Acrobat family of software products, version 1.6 corresponding to the release of Acrobat 7.0. PDF is based on, and shares the same imaging model as, the PostScript page description language. A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section. PDF files can contain a wide variety of content, including text, images, video and audio.','2004-01-01 00:00:00.000',NULL)
,('3c1b00b3-0817-4a01-84fe-1c9ada711ae9','2019-10-01 18:02:22.946','2019-10-01 18:02:22.946',NULL,'8f00857c-1574-45ee-aff8-3f04e7308d81','',NULL,NULL,NULL,NULL,1,false,true,false,'CS3','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('61fcbd5a-55f2-4419-ac10-61a2ff8af27a','2019-10-01 18:01:41.739','2019-10-01 18:01:41.739',NULL,'6ade9ab6-a642-4b99-ab6d-255c999f245f','',NULL,NULL,NULL,NULL,1,false,true,false,'1.7','Portable Document Format is a platform-independent format for representing formatted documents, developed by Adobe Systems Incorporated. It is the native format of Adobe’s Acrobat family of software products, version 1.7 corresponding to the release of Acrobat 8.0 and 9.0.  PDF is based on, and shares the same imaging model as, the PostScript page description language.  A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section.  PDF files can contain a wide variety of content, including text, images, video and audio.',NULL,NULL)
,('114c1c8a-03c1-4320-a3cf-271f73222f01','2019-10-01 18:01:42.270','2019-10-01 18:01:42.270',NULL,'6ae9f692-f4ff-4821-bb45-b87a6fe6f721','',NULL,NULL,NULL,NULL,1,false,true,false,'1a','The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
PDF/A supports two levels of compliance PDF/A1-a (Accessible) and PDF/A1-b (Basic). PDF/A1-a is fully ISO 19005-1:2005 (PDF/A-1) compliant whereas PDF/A1-b is less stringent and not compliant. PDF/A1-a requires tagged PDF and Unicode whereas PDF/A1-b does not.','2005-10-01 00:00:00.000',NULL)
,('ff5fbeb9-db5b-4d8a-8003-bb8162a2b5c1','2019-10-01 18:01:42.773','2019-10-01 18:01:42.773',NULL,'2ab51b89-8164-439b-949c-e9cf5f0c66cb','',NULL,NULL,NULL,NULL,1,false,true,false,'1b','The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
PDF/A supports two levels of compliance PDF/A1-a (Accessible) and PDF/A1-b (Basic). PDF/A1-a is fully ISO 19005-1:2005 (PDF/A-1) compliant whereas PDF/A1-b is less stringent and not compliant. PDF/A1-a requires tagged PDF and Unicode whereas PDF/A1-b does not.
The signature identification proposed for PDF/A 1b has been tested against a number of PDF/A and PDF files for verification. However, PDF itself is a complex format, and while the PDF/A 1b signature contained in PRONOM will identify many PDF/A 1b files, DROID can only identify what a file asserts itself to be. As there are a number of ways in which PDF/A 1b files can violate the PDF/A 1b conformance, which can not be spotted until the file is parsed, it is recommended that PDF files are tested against validation software when attempting to confirm identification. Further information concerning PDF/A violations, and a test suite of PDF items which fail to conform to PDF/A standards, can be found at http://www.pdfa.org/2011/08/isartor-test-suite/','2005-10-01 00:00:00.000',NULL)
,('60ce6e2e-3d9b-408e-b794-ba618da9286a','2019-10-01 18:01:43.206','2019-10-01 18:01:43.206',NULL,'75a75a52-101d-4d56-af99-6da4cef5b726','',NULL,NULL,NULL,NULL,1,false,true,false,'2a','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A2 supports three levels of compliance: PDF/A-2a (Accessible), PDF/A-2b (Basic). and PDF/A-2u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-2:2011, which has the formal name ''Document management – Electronic document file format for long-term preservation – Part 2: Use of ISO 32000-1 (PDF/A-2)''.',NULL,NULL)
,('149cc0e1-8dd8-41a9-9877-d5a0bae0d405','2019-10-01 18:01:43.754','2019-10-01 18:01:43.754',NULL,'c842e38d-fe23-48a9-bf33-7cf4dda439f0','',NULL,NULL,NULL,NULL,1,false,true,false,'2b','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A2 supports three levels of compliance: PDF/A-2a (Accessible), PDF/A-2b (Basic). and PDF/A-2u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-2:2011, which has the formal name ''Document management – Electronic document file format for long-term preservation – Part 2: Use of ISO 32000-1 (PDF/A-2)''.',NULL,NULL)
,('abfae914-b263-4235-b5c9-be6b880da24a','2019-10-01 18:01:44.171','2019-10-01 18:01:44.171',NULL,'018d5666-9080-46ce-bf61-08d4dfc5f694','',NULL,NULL,NULL,NULL,1,false,true,false,'2u','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A2 supports three levels of compliance: PDF/A-2a (Accessible), PDF/A-2b (Basic). and PDF/A-2u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-2:2011, which has the formal name ''Document management – Electronic document file format for long-term preservation – Part 2: Use of ISO 32000-1 (PDF/A-2)''.',NULL,NULL)
,('941e49ca-7f60-4917-978c-01d28dbc3072','2019-10-01 18:01:44.572','2019-10-01 18:01:44.572',NULL,'2a7ecbc7-c544-4161-9f79-56683a33866e','',NULL,NULL,NULL,NULL,1,false,true,false,'3a','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A3 supports three levels of compliance: PDF/A-3a (Accessible), PDF/A-3b (Basic). and PDF/A-3u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-3:2012, which has the formal name ''Document management - Electronic document file format for long-term preservation - Part 3: Use of ISO 32000-1 with support for embedded files (PDF/A-3)''. The primary new feature in PDF/A-3 is the ability to embed any source format within a PDF/A file.',NULL,NULL)
;
