,('6c53191b-f743-413e-9656-0198ed2db7ee','2019-10-01 18:01:45.544','2019-10-01 18:01:45.544',NULL,'12dd5335-5c46-4994-8fe2-36d213a0ea2f','',NULL,NULL,NULL,NULL,1,false,true,false,'3u','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A3 supports three levels of compliance: PDF/A-3a (Accessible), PDF/A-3b (Basic). and PDF/A-3u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-3:2012, which has the formal name ''Document management - Electronic document file format for long-term preservation - Part 3: Use of ISO 32000-1 with support for embedded files (PDF/A-3)''. The primary new feature in PDF/A-3 is the ability to embed any source format within a PDF/A file.',NULL,NULL)
