,('ea958e5d-4cbe-4e22-8beb-2b3a5134b393','2019-10-01 18:01:46.693','2019-10-01 18:01:46.693',NULL,'e7c759c4-6a7c-4331-93b1-7bbfce0743ef','',NULL,NULL,NULL,NULL,1,false,true,false,'','PDF/X was developed by the Committee for Graphics Arts Technologies Standards (CGATS) and Adobe. This  ''exchange standard'' format is based on Adobe''s PDF specification and includes additional notes specifically for delivery of high quality colour advertisements. A subset of the PDF specification, and an application standard as well as a file format standard; it was considered a ''more reliable'' PDF file. There are several versions of the standard, which address specific issues, PDF/X-1: 1999 was based on PDF 1.2, however there is no known implementation of this version. PDF/X-1 is the only PDF/X standard permitting encryption.',NULL,NULL)
,('e15455ad-4e49-4e92-ac39-57a6d423f801','2019-10-01 18:01:47.197','2019-10-01 18:01:47.197',NULL,'07f91e72-06ed-4661-b946-9524ab0874e9','',NULL,NULL,NULL,NULL,1,false,true,false,'','This ''exchange standard'' format is based on Adobe''s PDF specification and a subset of the PDF specification. This version  was an updated version of PDF/X-1:1999, and was based on PDF 1.3. It was superseded in 2003 by PDF/X-1a and PDF/X-3, at which point it was recommended that PDF/X-1 no longer be used. PDF/X-1 is the only PDF/X standard permitting encryption.',NULL,NULL)
