Documentation for FrameMaker 5.0 was integrated into the user manual that was bundled with the software. FrameMaker 5.0 introduced online help, long filename support in Windows 95, OLE support, save to HTML and import text by reference. This information has been derived from third party sources and should be considered speculative.','1995-01-01 00:00:00.000',NULL)
