,('b1cd21ea-2c07-450c-afc6-74803b30291b','2019-10-01 18:02:29.944','2019-10-01 18:02:29.944',NULL,'0440fb57-6393-4fd1-9624-af9a17033f07','',NULL,NULL,NULL,NULL,1,false,true,false,'','Part of the PostScript Type 1 font format family. On Windows, Type 1 fonts consist of a PostScript Font Binary (.PFB) file, plus a corresponding PostScript Font Metrics (.PFM) file. (Some very old Type 1 fonts may ship with a .PFB, .AFM, and .INF file. Installing such fonts will create a .PFM file from the .AFM and .INF files.)',NULL,NULL)
,('79a8a69a-be29-4bd3-8206-6166a26ebab9','2019-10-01 18:02:30.438','2019-10-01 18:02:30.438',NULL,'7d2cc0d8-8bbe-4d07-9c2b-8c0e80d0b0cd','',NULL,NULL,NULL,NULL,1,false,true,false,'','Printer Font Binary (.pfb) is a type 1 font made by Adobe and other companies.They are encrypted and compressed and also allow for hints, which improve the appearance of text at 300 dpi and lower resolutions. With Adobe Type Manager, Type 1 fonts can also be used on non-PostScript printers. However, Mac OS X and Windows, starting with Windows 2000, natively support Type 1 fonts, and Adobe Type Manager is not required.
Research done by The National Archives.',NULL,NULL)
