,('978e2ed3-49f6-49a9-9452-7ec2c7acfb4d','2019-10-01 18:02:32.193','2019-10-01 18:02:32.193',NULL,'0fdd283a-0f48-4db1-92bb-77009a942d5e','',NULL,NULL,NULL,NULL,1,false,true,false,'','Advanced Function Presentation (AFP) is a presentation architecture and family of associated printer software and hardware that provides for document and information presentation independent of specific applications and devices.',NULL,NULL)
,('51b27bf3-8082-4c44-ab65-5a4399734c1b','2019-10-01 18:02:49.618','2019-10-01 18:02:49.618',NULL,'8cdd0a91-94d7-47f8-9858-a059f2ec33b1','',NULL,NULL,NULL,NULL,1,false,true,false,'6','AppleWorks was a productivity suite developed by the Apple subsidiary, Claris, that was originally called ClarisWorks and was renamed AppleWorks as of version 5.',NULL,NULL)
,('549e27fc-03fe-4aa7-83a3-e9b8bfa635f1','2019-10-01 18:02:32.681','2019-10-01 18:02:32.681',NULL,'a2fbdf9b-7026-42f8-89b2-7c389b2cf0c1','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Advanced Systems Format is an extensible file format developed by Microsoft for storing multimedia data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. ASF files can contain audio, video and still image data streams, and the format supports streaming across networks. ASF supports a variety of audio, video and still image compression types, although it is most widely used for storing Windows Media Audio and Video encoded data.','2004-11-01 00:00:00.000',NULL)
,('4e777858-16a8-44f6-a76b-6a03b96476fb','2019-10-01 18:02:33.146','2019-10-01 18:02:33.146',NULL,'81c5dbbe-bcea-49d3-85ce-09dc060c439f','',NULL,NULL,NULL,NULL,1,false,true,false,'','ADX is a proprietary audio storage and compression format developed by CRI Middleware. PRONOM currently holds one PUID for all known version numbers, with separate identification signatures for each.',NULL,NULL)
