INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('7e15b45b-4f27-4343-bfa4-f141ea727209','2019-10-01 18:02:40.359','2019-10-01 18:02:40.359',NULL,'c3036759-f1ab-430a-8de5-863af9639a56','',NULL,NULL,NULL,NULL,1,false,true,false,'','APNG is an extension of the PNG format, adding support for animated images. It is intended to be a replacement for simple animated images that have traditionally used the GIF format, while adding support for 24-bit images and 8-bit transparency. APNG is intended as a simpler alternative to MNG.

APNG is backwards-compatible with PNG; any PNG decoder should be able to ignore the APNG-specific chunks and display a single image.',NULL,NULL)
,('fc9701a6-311d-4e45-8817-05c20cef4fc4','2019-10-01 18:02:40.830','2019-10-01 18:02:40.830',NULL,'9a6ac774-ef34-4de3-af07-b069d6979cc6','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Apple’s Core Audio Format is a file format for storing and manipulating digital audio data. It is fully supported by Core Audio APIs on Mac OS X v10.4 and later and on Mac OS X v10.3 with QuickTime 7 or later. CAF provides high performance and flexibility, and is scalable to future ultra-high resolution audio recording, editing, and playback. CAF files have several advantages over other standard audio file formats:
•	  Unrestricted File Size
•	  Safe and Efficient Recording
•	 Support For Many Data Formats
•	 Support For Many Types of Auxiliary Data
•	 Support of Data Dependencies','2005-06-04 00:00:00.000',NULL)
,('7a2a0beb-140e-460d-b16d-c81eb4c56b4a','2019-10-01 18:02:41.332','2019-10-01 18:02:41.332',NULL,'a64144b8-430b-435d-bedc-f09c08e09667','',NULL,NULL,NULL,NULL,1,false,true,false,'4.2','Disk Copy 4.2 (DC42) is the common name used to refer to disk images of floppy disks created by the 4.2 version of Disk Copy provided by the Mac Operating System.',NULL,NULL)
,('d2142763-9984-4c2e-97ee-89e739c74abf','2019-10-01 18:02:41.754','2019-10-01 18:02:41.754',NULL,'2525c692-3ffa-4ac6-a898-c50f1b5a7f06','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Apple Disk Image is a disk image format commonly used by the macOS operating system, and is distinct from the earlier 	Apple Disk Copy Image 4.2. Please contact the PRONOM team if you are able to provide a more thorough description of this format.',NULL,NULL)
