The format lacks an extension, and is instead represented by a file name consisting of ._<filename resource fork belongs to>',NULL,NULL)
,('14c0fe01-8906-4e3d-b7be-ff1205999990','2019-10-01 18:02:47.815','2019-10-01 18:02:47.815',NULL,'196c8158-154f-4a9b-a986-870888b86823','',NULL,NULL,NULL,NULL,1,false,true,false,'1','Apple Computers created the AppleSingle format (as well as the AppleDouble format) to represent and preserve the attributes of files across files systems that do not support the same attributes of the file’s home systems. AppleSingle is primarily a storage format and contains both a file’s contents and attributes. It consists of a header and one or more optional data entries followed by the byte stream of the file it is storing. It maintains the original Macintosh filename and file type (e.g. Mydoc.pdf). The AppleSingle format can store a number of different kinds of formats.',NULL,NULL)
