('468abad6-514b-4a13-9e7f-d2d4ed12a83f','2019-10-01 18:02:56.397','2019-10-01 18:02:56.397',NULL,'d7758285-56cb-497c-af85-89f60d31b183','',NULL,NULL,NULL,NULL,1,false,true,false,'','The E57 file format is a format for storing point clouds, images, and metadata produced by 3D imaging systems.',NULL,NULL)
,('b1fba5bf-5d7c-4542-9931-0006cea13ad4','2019-10-01 18:02:56.831','2019-10-01 18:02:56.831',NULL,'f62355bb-10dd-4cd5-8a0a-9ce6aa5c883f','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('562bf52f-19a2-4e3d-9f2b-9ce28a2971c1','2019-10-01 18:02:57.343','2019-10-01 18:02:57.343',NULL,'6f73b0b6-e113-442b-86dc-ad0431a9b58f','',NULL,NULL,NULL,NULL,1,false,true,false,'','ATCO-CIF is a file format for interchange of bus timetable information, primarily between the Department for Transport and service providers.',NULL,NULL)
,('5f02ba81-3fe0-4583-b5e4-6890788da501','2019-10-01 18:02:57.776','2019-10-01 18:02:57.776',NULL,'7671df22-0b57-4ace-b68b-99c8494fc486','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2','The Audio Interchange File Format (Audio IFF) provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths. Audio IFF conforms to the " EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. Audio IFF is primarily an interchange format, although application designers should find it flexible enough to use as a data storage format as well. If an application does choose to use a different storage format, it should be able to convert to and from the format defined in this document. This will facilitate the sharing of sound data between applications. Audio IFF is the result of several meetings held with music developers over a period of ten months in 1987-88.',NULL,NULL)
,('8c6e6ee0-79ff-4bff-a4f3-d4ef6477d836','2019-10-01 18:02:58.268','2019-10-01 18:02:58.268',NULL,'5982d0d5-44e3-414d-8933-b5f7657d0cbb','',NULL,NULL,NULL,NULL,1,false,true,false,'1.3','The Audio Interchange File Format (Audio IFF) was developed by Apple Computer, Inc., and provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths.  Audio IFF was designed to serve primarily as an interchange format. Audio IFF conforms to the "EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. The audio data in a standard AIFF file is uncompressed pulse-code modulation (PCM). There is also a compressed variant of AIFF known as AIFF-C or AIFC, with various defined compression codecs. File specifications available at http://www-mmsp.ece.mcgill.ca/documents/audioformats/aiff/Docs/AIFF-1.3.pdf

This format is currently deprecated in favour of fmt/414 in order to remove a multiple identification conflict. Differences between version 1.2 and 1.3 relate to Apple II-specific application implementation. See the full specification for details.','1989-01-04 00:00:00.000',NULL)
,('7ea1fc63-dcb1-466b-ba61-4b7ca9efa14a','2019-10-01 18:02:58.769','2019-10-01 18:02:58.769',NULL,'7f3de471-b653-4e2c-970c-ce1515b36f47','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Audio Interchange File Format, Compressed (AIFF-C) provides a standard for storing uncompressed or compressed sampled sounds.  The format can store monaural or multichannel sampled sounds in a range of sample rates and sample widths.  The format is extensible to handle new compression types and application-specific data.','1991-08-26 00:00:00.000',NULL)
,('e23f4c70-7a27-4474-84b8-7171b8c78537','2019-10-01 18:03:48.556','2019-10-01 18:03:48.556',NULL,'dc47237a-fae6-47b8-abca-0f445c797523','',NULL,NULL,NULL,NULL,1,false,true,false,'ASCII','TrueSpace was a commercial 3D computer graphics and animation software originally developed by Caligari Corporation before being acquired by Microsoft. The .scn extension indicates a scene, the .cob extension indicates an object.',NULL,NULL)
,('8a529c39-46cb-4b6a-8ebd-53654478aa13','2019-10-01 18:02:59.211','2019-10-01 18:02:59.211',NULL,'0b950c23-0428-4234-8996-ae35483e56a1','',NULL,NULL,NULL,NULL,1,false,true,false,'','Audio/Video Interleaved Format (AVI) is a chunk-based video format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, an AVI file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with an AVI data type identifier, followed by a series of chunks. Every file must include two List chunks. The first List chunk is the main AVI header chunk, which contain one or more Stream Header chunks, one for each data stream, describing the format of the data streams. The second LIST chunk is the ‘movi’ chunk, which contains the actual data for the audio and video data streams. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed video encodings, but all audio streams are stored in Microsoft’s Waveform Audio format.',NULL,NULL)
,('40b0827f-db7b-48d7-a3e7-5032c48007e3','2019-10-01 18:02:59.661','2019-10-01 18:02:59.661',NULL,'2948a5cd-6312-49d6-b5e1-5daa2e76417e','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('15c3591d-d2c7-47de-aa37-490e1ecb263d','2019-10-01 18:03:00.129','2019-10-01 18:03:00.129',NULL,'e0bf8211-68d1-4915-9aef-925d84bba8e9','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0-R14','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
