('9944d7c5-8ba6-4efa-9791-59cfec2b372a','2019-10-01 18:07:01.998','2019-10-01 18:07:01.998',NULL,'b9fa96b9-b9a8-44b8-8ff5-036862522863','',NULL,NULL,NULL,NULL,1,false,true,false,'5','Lightwright is software created by John McKernon for the management of theatrical lighting data and paperwork.',NULL,NULL)
,('4e550bb2-1f7a-4742-9eb4-4dc46e18a013','2019-10-01 18:03:04.598','2019-10-01 18:03:04.598',NULL,'91b4b65e-12ff-4ec9-b8f2-ff1f9fbc0de3','',NULL,NULL,NULL,NULL,1,false,true,false,'6.0','AutoCAD Design Web Format (DWF) version 6 is the publishing format of Autodesk software, especially design data, such as 2D vector data, 3D vector data, animations, and metadata.  It uses the ZIP file format as the backing store mechanism.  The content can be roughly divided into:
•        DWF metadata files – XML files that contain information pertaining to metadata and structure (author, title, creation time, section dependencies, section ordering, resource file descriptions, roles, MIME types, etc.) and pertaining to the section (page information, design metadata, etc.).  The structural metadata is used to create logical objects (collections of files to represent a part or page, etc.).
•        Resource files – media or other content files that are referenced from the package/section metadata and are usually presentations of design data in various formats (ZGL, W2D, JPG, PNG, AVI, XML, TXT, DOC, etc.)
A DWF package must meet the following requirements:
•        The first 12 bytes of the physical package file must contain the DWF version header.
•        A manifest.xml file at the root of the zip archive that complies to the manifest.xsd schema
•        File contents logically organized into sections, one for each component of the composite design.
•        At least one resource file.
•        The manifest must contain an <Interfaces> element containing at least one <Interface> sub element that indicates a document interface supported by the DWF package.  An example would be the ‘ePlot’ document interface, which implies that the DWF contains at least one valid ePlot page.',NULL,NULL)
,('db5cc5ff-c48e-4a22-be62-11aeca057fc5','2019-10-01 18:03:05.049','2019-10-01 18:03:05.049',NULL,'c6f48c45-840d-42e7-bd64-969c2ae2ae24','',NULL,NULL,NULL,NULL,1,false,true,false,'','DWFx is the newest version of the AutoCAD Design Web Format (DWF). DWFx is based on the XML Paper Specification (XPS). DWF and DWFx are  compressed file formats which can be suitable for distributing over the Internet for review. You can export a single drawing or publish multiple drawings and sheet sets into a DWF or DWFx file.',NULL,NULL)
