,('0e7cf40b-4366-423f-ba16-44078af04929','2019-10-01 18:03:20.847','2019-10-01 18:03:20.847',NULL,'08d5a32e-790f-40ae-bee7-1b66884497ae','',NULL,NULL,NULL,NULL,1,false,true,false,'R14','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('2e266fc7-4bbb-4071-beab-554b428b1f6d','2019-10-01 18:03:21.386','2019-10-01 18:03:21.386',NULL,'2311d396-6c89-44f9-a4d9-8f2bc1907001','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('a7321017-cce1-4d8f-82d7-6fae32e2068d','2019-10-01 18:03:21.861','2019-10-01 18:03:21.861',NULL,'028b5cbd-9753-4531-87c8-0c067a4cfe18','',NULL,NULL,NULL,NULL,1,false,true,false,'','AutoCAD slide files are screen images. A slide file consists of a header portion and one or more data records of variable length. Data records follow the header. Each data record begins with a field whose high-order byte is the record type. If a slide contains any vectors at all, a New colour record will be the first data record. The order of the vectors in a slide, and the order of the endpoints of those vectors, may vary.
The slide format described in the previous paragraph is produced by AutoCAD Release 9 and later, and is portable among all computers running AutoCAD Release 9 or later. Previous versions of AutoCAD (as well as AutoShade 1.0 and AutoSketch 1.02) produce slides with a somewhat different header. Note that the old-format header does not contain a Test number field. The floating-point aspect ratio value and all 2-byte integers are written in the native format of the CPU that was used to create the file (for 8086-family CPUs, IEEE double-precision, and low-order byte first). Old-format slide files are not portable across machine types, but they can be read by any version of AutoCAD running on the same CPU type as the CPU with which the slide was created.
File specifications are available at http://www.autodesk.com/techpubs/autocad/acadr14/dxf/slide_file_format_al_u05_b.htm',NULL,NULL)
;
