('0ceb7dea-59cc-424d-9a43-58df3b4f157c','2019-10-01 18:03:26.834','2019-10-01 18:03:26.834',NULL,'ecf4e40f-9af4-476b-a674-9161e6f30171','',NULL,NULL,NULL,NULL,1,false,true,false,'','Autorun.inf is the primary instruction file associated with the Autorun function. Autorun.inf itself is a simple text-based configuration file that tells the operating system which executable to start, which icon to use, and which additional menu commands to make available.',NULL,NULL)
,('d6e6926e-bcd8-4897-8a0f-d23ee5945b44','2019-10-01 18:03:27.313','2019-10-01 18:03:27.313',NULL,'df7196ba-a162-4f6d-a9dc-1a7ed2b344bb','',NULL,NULL,NULL,NULL,1,false,true,false,'','AutoShade was an early 3D rendering package for use with AutoCAD. AutoShade wrote the rendering to an .RND file as a 2D vector image.',NULL,NULL)
,('4ff67ebe-fef1-45e5-a658-a533d5973f3c','2019-10-01 18:03:27.973','2019-10-01 18:03:27.973',NULL,'225890f6-7a7c-41c9-b2a6-2def5d612311','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('c2d41e63-d300-48f3-9dd6-ba2b419431a9','2019-10-01 18:03:28.431','2019-10-01 18:03:28.431',NULL,'fa9411e0-dbfd-4373-8746-a04aafc91a48','',NULL,NULL,NULL,NULL,1,false,true,false,'','AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Clip Information File may be created by some AVCHD video recorders and contains metadata describing the AVCHD stream.',NULL,NULL)
,('123148e2-1821-45a9-8286-58c349442643','2019-10-01 18:03:28.883','2019-10-01 18:03:28.883',NULL,'c6899d11-2d3b-4b65-ade2-2cca56784675','',NULL,NULL,NULL,NULL,1,false,true,false,'','AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Index file manages the relationships between other AVCHD files.',NULL,NULL)
,('29911a49-5fd6-47be-a229-e136479f2a78','2019-10-01 18:03:29.337','2019-10-01 18:03:29.337',NULL,'057c9945-d2c2-446d-a12f-f3d32f4fd053','',NULL,NULL,NULL,NULL,1,false,true,false,'','AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Movie Object file manages the play order of playlists.',NULL,NULL)
,('260201e7-4b4a-4bb3-99f6-f2df6671646f','2019-10-01 18:03:29.797','2019-10-01 18:03:29.797',NULL,'ca18c042-cc1a-4d3e-ba66-44c7fcb2f712','',NULL,NULL,NULL,NULL,1,false,true,false,'','AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Playlist File may be created by some AVCHD video recorders and contains an ordered list of references to associated AVCHD streams.',NULL,NULL)
,('996815fe-57b3-4f83-acbd-c9e0974583c2','2019-10-01 18:03:30.153','2019-10-01 18:03:30.153',NULL,'89c74565-6480-4ef8-a73a-9195071b29cd','',NULL,NULL,NULL,NULL,1,false,true,false,'','AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Thumbnail Index file stores an index to AVCHD thumbails, which are JPEG files with a .tdt extension.',NULL,NULL)
,('4bf2f0d7-1f32-447d-a048-b4b9c739c1c5','2019-10-01 18:03:30.577','2019-10-01 18:03:30.577',NULL,'3a9cfd64-126c-4200-8735-57342978c112','',NULL,NULL,NULL,NULL,1,false,true,false,'2.x','AWD is a binary file format for 3D scenes, objects and related data, and is intended for exchange between any conforming AWD exporter and a conforming parser. Its main use is with the Away3D engine, a 3D engine designed for ActionScript 3 and the Adobe Flash Platform.',NULL,NULL)
,('6b3b7101-d11b-4561-8786-ebff8f87d533','2019-10-01 18:03:31.022','2019-10-01 18:03:31.022',NULL,'636ce73f-b5de-45cf-972e-3a65c9688a62','',NULL,NULL,NULL,NULL,1,false,true,false,'','AXD Handler Files are used by ASP.NET applications for handling embedded resource requests.',NULL,NULL)
;
