,('97fd9335-69ea-4051-8589-3ff573e9bf0d','2019-10-01 18:03:32.298','2019-10-01 18:03:32.298',NULL,'975bbecb-a15d-4bd2-a83a-85a9e3e98d08','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
