,('d21f4c27-0f6b-4464-a3c3-3d126c49c8f8','2019-10-01 18:03:33.170','2019-10-01 18:03:33.170',NULL,'f4fa64e9-a2c8-414b-8c72-5783290e378c','',NULL,NULL,NULL,NULL,1,false,true,false,'','Better Portable Graphics (BPG) is a raster image format created by Fabrice Bellard. It is intended as a compression-efficient alternative to the JPEG image format. It is based on the intra-frame encoding of the High Efficiency Video Coding (HEVC) video compression standard, and various metadata profiles (such as EXIF, ICC profile, XMP) are supported.',NULL,NULL)
