,('8b7dd9b3-f30f-4cdb-a67d-b140eae156b2','2019-10-01 18:03:33.970','2019-10-01 18:03:33.970',NULL,'df6391a1-e6d2-457c-aaa7-bf98bbdb6e29','',NULL,NULL,NULL,NULL,1,false,true,false,'','In the OS X, iOS, NeXTSTEP, and GNUstep programming frameworks, property list files store serialized objects. It is the standard way to save and load data between the internal representation within the objects defined in an Objective-C program and disk files, in order to store program settings and other data. This is the binary version but there is also an XML version of the format.',NULL,NULL)
