,('3718f029-20f2-4757-9353-65a75cb83cba','2019-10-01 18:03:37.455','2019-10-01 18:03:37.455',NULL,'3bda9dad-ca36-4c77-9758-4a2778f859a6','',NULL,NULL,NULL,NULL,1,false,true,false,'','Android 4.4 introduced the ability to capture all Bluetooth HCI packets and save them to a file, typically called btsnoop_hci.log. The BtSnoop file format closely resembles the snoop format, https://www.nationalarchives.gov.uk/PRONOM/fmt/781',NULL,NULL)
