,('5e285bcc-14cf-40ff-8d7c-22fe91953727','2019-10-01 18:03:38.392','2019-10-01 18:03:38.392',NULL,'84600124-e01e-4ec1-a27b-80d4822a0c06','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('caae2c7d-3a0a-489a-9922-69a68e06011f','2019-10-01 18:03:38.819','2019-10-01 18:03:38.819',NULL,'c91d3f9e-b813-4b96-88b0-123a34dc472e','',NULL,NULL,NULL,NULL,1,false,true,false,'LRF','Broad Band eBook (BBeB) is a proprietary e-book format created by Sony and Canon for Sony e-book readers. The LRF variant is a compiled, unencrypted version of an LRS file. Sony discontinued development of BBeB in 2010, in favour of the EPUB format.',NULL,NULL)
,('665064aa-7cbe-490b-9431-c1cbb84fd5a3','2019-10-01 18:03:39.308','2019-10-01 18:03:39.308',NULL,'5d789d71-3bdf-49d0-bfc8-a8182dcbc9cc','',NULL,NULL,NULL,NULL,1,false,true,false,'0 Generic','Broadcast WAVE is a chunk-based audio format developed by the European Broadcasting Union, and based on the Microsoft WAVE format, which is in turn based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a BWAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Broadcast Audio Extension chunk, containing metadata required for exchange of information between broadcasters, a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. BWAVE files which contain MPEG-encoded audio data must also include a Fact chunk, containing file-dependent information about the audio data, and an MPEG Audio Extension chunk, containing extra information required to describe the MPEG encoding.  A BWAVE identified as generic by DROID likely uses an encoding format unknown to PRONOM, or perhaps a structural difference, and users are encouraged to let the PRONOM team know should this occur.','1997-01-01 00:00:00.000','2001-07-01 00:00:00.000')
;
