,('fd247802-8630-4b18-890c-abfe3d70fb59','2019-10-01 18:03:55.056','2019-10-01 18:03:55.056',NULL,'6eea1cac-481b-4ad8-9067-da601f64a556','',NULL,NULL,NULL,NULL,1,false,true,false,'','CD-ROM XA (Compact Disc - read-only-memory, extended architecture) is a modification of CD-ROM that defines sectors that enable it to read and display data, graphics, video, and audio. Photo CD, Video CD, CD-EXTRA and Super Video CD have all been based on CDXA and it may be possible to further distinguish between these different CDXA variant formats with further PRONOM research.',NULL,NULL)
,('d1e5abe1-0f97-4eef-81f9-0d60db7d27cb','2019-10-01 18:03:55.458','2019-10-01 18:03:55.458',NULL,'9a35955b-4f3a-4cbe-9ecf-583df2696028','',NULL,NULL,NULL,NULL,1,false,true,false,'','A CDX file consists of individual lines of text, each of which summarizes a single web document.
The first line in the file is a legend for interpreting the data, and the following lines contain the data for referencing the corresponding pages within the host. The first character of the file is the field delimiter used in the rest of the file. This is followed by the literal "CDX". For signature strength we currently assume the field delimiter will be a space character, however please contact the PRONOM team should you encounter CDX index files where the delimiter is different.',NULL,NULL)
;
