,('c1888ae9-05e0-45d7-97bd-b4d536d388c6','2019-10-01 18:04:15.316','2019-10-01 18:04:15.316',NULL,'bb72e056-6a8a-4b45-aff9-ce96ec69d353','',NULL,NULL,NULL,NULL,1,false,true,false,'6 and Later','The Corel Presentation Exchange file format is the presentation format of the CorelSuite applications. It is a recording of the display primitives of an application to a display interface. The CMX format supports Intel and Motorola binary formats.',NULL,NULL)
,('c57e9713-846f-45b6-b46f-bf5bc54d8cc5','2019-10-01 18:03:57.578','2019-10-01 18:03:57.578',NULL,'6946b7a5-f594-4ae0-9194-bcdfdbab924e','',NULL,NULL,NULL,NULL,1,false,true,false,'4','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main Pronom page and select ‘Add an Entry’.',NULL,NULL)
,('6557cab4-b729-48e1-b1f5-0aa9ceb6a0c4','2019-10-01 18:03:58.015','2019-10-01 18:03:58.015',NULL,'30e7ca10-21f7-4ca6-8dae-3b8cbd9353b1','',NULL,NULL,NULL,NULL,1,false,true,false,'4.x','CINEMA 4D is a 3D modeling, animation and rendering application developed by MAXON Computer GmbH.  CINEMA 4D as a file format can contain elements of animation, modeling, texturing and rendering.',NULL,NULL)
,('bb0b2956-70e4-46da-87a1-c7d4d6bdf7d4','2019-10-01 18:03:58.572','2019-10-01 18:03:58.572',NULL,'997ab07f-cace-480d-b530-a63577eabdd7','',NULL,NULL,NULL,NULL,1,false,true,false,'5.x','CINEMA 4D is a 3D modeling, animation and rendering application developed by MAXON Computer GmbH.  CINEMA 4D as a file format can contain elements of animation, modeling, texturing and rendering.',NULL,NULL)
,('e267da84-0444-4312-b22b-12062fb5a244','2019-10-01 18:03:59.018','2019-10-01 18:03:59.018',NULL,'bac0ed81-0d2d-48ab-ad7e-8ec05cec6765','',NULL,NULL,NULL,NULL,1,false,true,false,'6+','Cinema 4D is a 3D modeling, animation and rendering application developed by Maxon Computer GmbH.  Cinema 4D as a file format can contain elements of animation, modeling, texturing and rendering. This version of the Cinema 4D format appears to have been in use from the release of version R12 of the Cinema 4D application onwards and is distinct from the earlier versions 4.x and 5.x. Please contact the PRONOM team if you can assist with establishing a precise version number.',NULL,NULL)
,('badfb78d-5078-4e94-b6f0-3d7c860d0b0e','2019-10-01 18:03:59.489','2019-10-01 18:03:59.489',NULL,'5ab7aad3-bae4-493b-9958-978f5e82c5b6','',NULL,NULL,NULL,NULL,1,false,true,false,'1 (generic)','ClarisWorks was a productivity suite developed by the Apple subsidiary, Claris, which was later renamed AppleWorks as of version 5. ClarisWorks included a drawing program, a word processor, a spreadsheet program, a database program, and a painting program. With further research it may be possible to distinguish between files produced by each program. Please contact PRONOM if you are able to provide samples of ClarisWorks files, version 1.',NULL,NULL)
;
