,('38ff516a-c2d8-464f-b545-aa709dd13bca','2019-10-01 18:04:07.805','2019-10-01 18:04:07.805',NULL,'985dc4bb-ee0c-450e-a648-6961abf07932','',NULL,NULL,NULL,NULL,1,false,true,false,'','A comma-separated values (CSV) file file stores tabular data (numbers and text) in plain text. Plain text means that the file is interpreted a sequence of characters, so that it is human-readable with a standard text editor. Each line of the file is a data record.',NULL,NULL)
