,('e538a55b-f615-4010-a608-fd51635e3623','2019-10-01 18:04:08.213','2019-10-01 18:04:08.213',NULL,'e6923c49-0fd8-47e6-b11b-00b2793b4a95','',NULL,NULL,NULL,NULL,1,false,true,false,'6 onwards','This is a compound version of Wordperfect for Windows. Also known as Corel WordPerfect. Major and minor version fields are the main variants between 6.x and 12 formats (The last two bytes in this signature). The major version is the same for 6.x through to 12 documents - 2. The minor version byte for a non-compound file created in WPWin 8.0 is 1. The minor version for a compound file created in WPWin 8.0. Is 2.',NULL,NULL)
;
