,('213b2cf1-8590-4b38-9371-d6deb1f1d105','2019-10-01 18:04:11.310','2019-10-01 18:04:11.310',NULL,'9fe3dd0c-9fb6-48ed-ad98-8377c73395db','',NULL,NULL,NULL,NULL,1,false,true,false,'1','Computer Graphics Metafile (CGM) is a standardized platform-independent format used for the interchange of raster and vector data. CGM was developed under the auspices of the International Standards Organization (ISO) and the American Standards National Institute (ANSI). It is also used in conjunction with a variety of input and output devices. Although CGM incorporates extensions designed to support raster data storage, files in CGM format are used primarily to store vector information. CGM files typically contain either bitmap or vector data, but rarely both. It uses Clear Text Encoding.
File format specifications available at http://standards.iso.org/ittf/PubliclyAvailableStandards/c044114_ISO_IEC_8632-1_1999_Cor_1_2006%28E%29.pdf',NULL,NULL)
