,('5d426ad4-2414-4679-bd77-a0e25e28e25a','2019-10-01 18:04:29.363','2019-10-01 18:04:29.363',NULL,'4556287e-bdb3-49ee-8bd4-f63a2d1f035c','',NULL,NULL,NULL,NULL,1,false,true,false,'','Cypher is a declarative graph query language for the open source graph database, Neo4j. Although it has regular and well defined syntax, there are no magic numbers or header sequences. As such, there is no current means to identify a file as CQL by binary sequence alone, so identification of this format is by extension only.',NULL,NULL)
,('56a8db11-0787-4e48-bb6b-4b770c415ed0','2019-10-01 18:04:29.773','2019-10-01 18:04:29.773',NULL,'f4c6d34c-c000-476e-bdcd-1bce90cdfd75','',NULL,NULL,NULL,NULL,1,false,true,false,'','Dalvik is the process virtual machine in Google''s Android operating system, which executes applications written for Android. Programs are commonly written in Java and compiled to bytecode for the Java virtual machine, which is then translated to Dalvik bytecode and stored in .dex (Dalvik EXecutable) and .odex (Optimized Dalvik EXecutable) files.',NULL,NULL)
,('8d42d9ae-7e87-47a8-b27d-673809c553eb','2019-10-01 18:04:30.165','2019-10-01 18:04:30.165',NULL,'27d49a04-204e-444a-9b96-0a10e5d13768','',NULL,NULL,NULL,NULL,1,false,true,false,'','Data Interchange Format (.dif) is a text file format used to import/export single spreadsheets between spreadsheet programs (OpenOffice.org Calc, Excel, Gnumeric, StarCalc, Lotus 1-2-3, FileMaker, dBase, Framework, Multiplan, etc.). It is also known as Navy DIF. One limitation is that DIF format cannot handle multiple spreadsheets in a single workbook.',NULL,NULL)
,('fc355626-8531-45ea-86ac-a9e392d9caec','2019-10-01 18:04:30.598','2019-10-01 18:04:30.598',NULL,'fafb36db-4cda-4928-9245-b2cafd06718f','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
