,('12f0101d-e61f-42e3-bf14-4ba3bb393898','2019-10-01 18:04:38.162','2019-10-01 18:04:38.162',NULL,'93a821ff-12f9-4814-9a2e-51ff34b52a60','',NULL,NULL,NULL,NULL,1,false,true,false,'1.1','DigiDoc is a digital signature format specific to Estonia. The format is based on the ETSI TS 101 903 Standard ‘XML Advanced Electronic Signatures (XAdES)’. DigiDoc corresponds to the XAdES profile ‘XAdES-X-L’. A DigiDoc container includes source files (the files that were signed) as well as signatures that are related to the signed file(s). Also every signature contains the certificate, validity confirmation and the validity confirmation service certificate. https://www.id.ee/?id=35780',NULL,NULL)
,('47578ce9-9d02-4623-bf91-4511b1acecc4','2019-10-01 18:04:38.638','2019-10-01 18:04:38.638',NULL,'2913a82e-f724-48c0-a580-4b0f7f509311','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2','DigiDoc is a digital signature format specific to Estonia. The format is based on the ETSI TS 101 903 Standard ‘XML Advanced Electronic Signatures (XAdES)’. DigiDoc corresponds to the XAdES profile ‘XAdES-X-L’. A DigiDoc container includes source files (the files that were signed) as well as signatures that are related to the signed file(s). Also every signature contains the certificate, validity confirmation and the validity confirmation service certificate. https://www.id.ee/?id=35780',NULL,NULL)
,('c8d68ef8-7fec-432f-8f02-a67ded5968c3','2019-10-01 18:07:08.790','2019-10-01 18:07:08.790',NULL,'0f65e8a0-575b-405c-9f44-f94fcff4409b','',NULL,NULL,NULL,NULL,1,false,true,false,'97','Lotus Approach is a relational database management system included in IBM''s Lotus SmartSuite for Microsoft Windows.',NULL,NULL)
,('247245dc-aea6-49c3-9c3e-a4918e47fe26','2019-10-01 18:04:39.072','2019-10-01 18:04:39.072',NULL,'1bd53164-71bc-45ca-ab95-21bde7534996','',NULL,NULL,NULL,NULL,1,false,true,false,'1.3','DigiDoc is a digital signature format specific to Estonia. The format is based on the ETSI TS 101 903 Standard ‘XML Advanced Electronic Signatures (XAdES)’. DigiDoc corresponds to the XAdES profile ‘XAdES-X-L’. A DigiDoc container includes source files (the files that were signed) as well as signatures that are related to the signed file(s). Also every signature contains the certificate, validity confirmation and the validity confirmation service certificate. https://www.id.ee/?id=35780',NULL,NULL)
,('98156fae-ebe6-47b0-beb7-9d75763bc15b','2019-10-01 18:04:39.533','2019-10-01 18:04:39.534',NULL,'80a3e480-1baa-49fd-9125-5456d26615bb','',NULL,NULL,NULL,NULL,1,false,true,false,'','DICOM (Digital Imaging and Communications in Medicine) is a standard for handling, storing, printing, and transmitting information in medical imaging. It includes a file format definition and a network communications protocol. The communication protocol is an application protocol that uses TCP/IP to communicate between systems. DICOM files can be exchanged between two entities that are capable of receiving image and patient data in DICOM format. The National Electrical Manufacturers Association (NEMA) holds the copyright to this standard. It was developed by the DICOM Standards Committee, whose members are also partly members of NEMA.',NULL,NULL)
;
