('2b26ef0f-dee4-4f37-94e9-ec15bd5a2666','2019-10-01 18:04:39.869','2019-10-01 18:04:39.869',NULL,'acdef2a4-61dd-4d71-b506-2f4b8e93c1aa','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('09d4153a-7299-4286-af40-e2e8791e148c','2019-10-01 18:04:40.230','2019-10-01 18:04:40.230',NULL,'f1f06396-9d92-4f87-9952-46239e2dc587','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('a1fe4a09-4aed-45a9-a7b8-8ba204e1227b','2019-10-01 18:04:40.860','2019-10-01 18:04:40.860',NULL,'70d6a77b-d416-4e4b-9ec8-99c6aaeb848d','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This initial version accompanied the launch of DNG and related products. It was a rare, possibly unique, example of a raw image format specification published by its owner. It was adequate for representing typical images, but it had a few errors and deficiencies (specifically the lack of support for "masked pixels" and an inadvertent deviation from the JPEG specification) that required it soon to be replaced by the next version.','2004-09-27 00:00:00.000',NULL)
,('fa4d387c-96ca-4f4c-840f-415aeb25a78f','2019-10-01 18:04:41.293','2019-10-01 18:04:41.293',NULL,'537b9090-a077-40f2-87c1-316f8f1f5e65','',NULL,NULL,NULL,NULL,1,false,true,false,'1.1','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF format, and is compatible with the TIFF-EP standard.
This version was published in February 2005 and corrected the flaws in the first version. It has proved capable of representing raw images for a large variety of cameras (both when written in-camera or via conversion from other raw image formats) for a few years, and it is the version still typically written in-camera.',NULL,NULL)
,('14c5a256-5a7f-428b-ab8d-9a3a0d34a0c8','2019-10-01 18:04:41.752','2019-10-01 18:04:41.752',NULL,'5eb6e5cf-84ea-4d56-8db7-f3f3d1a938a0','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This version, published May 2008, was based on experience and feedback from other companies about DNG since its launch. It introduced many new features, especially several new options for colour specification under the general heading of "Camera Profiles". These are mainly of value to software products wanting their own flavour of colour handling. This version permits administrative control of Camera Profiles, including calibration signatures and copyright information.',NULL,NULL)
,('bbcc8192-e9f8-465e-9b5e-50d73d002662','2019-10-01 18:04:42.171','2019-10-01 18:04:42.171',NULL,'1742219b-a26c-4c8c-8e63-ece8d9dc682c','',NULL,NULL,NULL,NULL,1,false,true,false,'1.3','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This version, published June 2009, added various improvements, but the major change was to introduce "Opcodes". An Opcode and any associated parameters identifies a specific process to be applied to some or all of the raw image data during the conversion process.',NULL,NULL)
,('1329df04-2449-45fa-961f-ce03fe9774a5','2019-10-01 18:04:42.656','2019-10-01 18:04:42.656',NULL,'b5f6a588-b1a1-4ccd-895e-0a432ae3d5e6','',NULL,NULL,NULL,NULL,1,false,true,false,'1.4','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors. DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard. This version was published June 2012.',NULL,NULL)
,('6a9b844d-4fc7-43b8-9362-0cc03c84dc4c','2019-10-01 18:04:43.089','2019-10-01 18:04:43.089',NULL,'5690d362-cae3-42b6-8c0d-082eb7cc0d3d','',NULL,NULL,NULL,NULL,1,false,true,false,'','Digital Speech Standard is a proprietary audio file format for the storage of digital speech recordings, which was jointly developed and introduced by Olympus, Grundig and Philips.',NULL,NULL)
