,('42c5f99a-f518-4ed9-99fc-2f5a48aa82ac','2019-10-01 18:12:02.335','2019-10-01 18:12:02.335',NULL,'a977ac0f-7733-4086-84d7-cd983acc9452','',NULL,NULL,NULL,NULL,1,false,true,false,'2','SVF is a vector image format originally developed in 1994. The format supports hyperlinks and layer information.',NULL,NULL)
,('7f36f1a5-3a8e-40fd-9aa9-694a2899b0d8','2019-10-01 18:04:45.311','2019-10-01 18:04:45.311',NULL,'6bea666b-f300-47a1-b1c2-954a3ef09abc','',NULL,NULL,NULL,NULL,1,false,true,false,'','The DirectMusic Segment is a file format created by Microsoft. The files can be played with DirectMusic API using a Microsoft Software Synthesizer or any installed MIDI output device. DirectMusic provides DLS support, and SGT files often accompany sound banks. SGT files contain playing order and track information. Segment files always come with DirectMusic Style files, which contain all required melody pattern information.',NULL,NULL)
,('f0d32c6c-2f4a-48f4-921c-f46283b71d00','2019-10-01 18:04:45.724','2019-10-01 18:04:45.724',NULL,'2df2ec46-d33b-4df6-af1c-b869cacd8837','',NULL,NULL,NULL,NULL,1,false,true,false,'','The DirectMusic Style is a file format created by Microsoft. STY files contain melody pattern information. STY files are used by the DirectMusic Segment format and they cannot be played directly.',NULL,NULL)
