,('2457bb41-31d7-45d7-bbd4-e4d715512265','2019-10-01 18:04:47.444','2019-10-01 18:04:47.444',NULL,'792900dc-17b8-462e-b0d5-5bcd53f394bf','',NULL,NULL,NULL,NULL,1,false,true,false,'','MLP "Meridian Lossless Packing" is the standard lossless compression format for DVD-Audio content. It was originally developed by Meridian Audio, Ltd.',NULL,NULL)
