('a668d1fa-12a9-4eac-bfce-f2cd89d12f1c','2019-10-01 18:04:48.642','2019-10-01 18:04:48.642',NULL,'b59d1e7b-4344-413c-82a2-63f93cdedcef','',NULL,NULL,NULL,NULL,1,false,true,false,'','The AMF format is an audio sequencing format containing both an audio sample bank, and sequencing data.',NULL,NULL)
,('f0722b28-72ab-4b17-9f86-4d0b29d6fc49','2019-10-01 18:04:49.096','2019-10-01 18:04:49.096',NULL,'7057f05e-46c2-471e-b297-7df967d3b030','',NULL,NULL,NULL,NULL,1,false,true,false,'','DLS is a file format that holds digital musical instrument sound banks. The DLS standards include specifications for how MIDI protocol-controlled music synthesizers should render the instruments in a DLS file.',NULL,NULL)
,('1a402e8d-e302-4e5f-80c1-6192f38000e4','2019-10-01 18:04:49.529','2019-10-01 18:04:49.529',NULL,'ac7376f6-0a4a-408e-82e9-37a76dd7e98a','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('fded1627-eb67-4d03-847f-33e13b16f4b4','2019-10-01 18:04:49.936','2019-10-01 18:04:49.936',NULL,'cdde222a-8120-4e88-b13a-4b09dd6f50dd','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Dr. Halo Image Palette stores colour palette information for the Dr. Halo Image Data format. Having a separate colour palette file aloows the ability to change the stored colours of an image without re-encoding the image data.',NULL,NULL)
,('8d8fc475-1db4-4742-8dfd-322635a5f407','2019-10-01 18:04:50.405','2019-10-01 18:04:50.405',NULL,'57e46caa-c8a5-46ee-98ac-fe7cb4655d0f','',NULL,NULL,NULL,NULL,1,false,true,false,'','Draco is a library for compressing and decompressing 3D geometric meshes and point clouds. It is intended to provide efficient storage and transmission of 3D graphics.',NULL,NULL)
,('068dabfb-a707-46af-bd59-50fa880d6616','2019-10-01 18:04:50.821','2019-10-01 18:04:50.821',NULL,'eff2db9b-b33f-4b29-8fe1-59c5c98104f7','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The Drawing Interchange Binary Format (DXB) is a vector graphics format developed by AutoDesk for its AutoCAD family of products. A DXB file comprises a file header followed by zero or more data records. Each data record begins with a single byte identifying the record type, followed by one or more data items. The DXB format should not be confused with the binary encoded version of the Drawing Interchange File Format (DXF) - DXB is an entirely separate format, being much simpler and more compact.','1990-10-01 00:00:00.000',NULL)
,('7f95f294-b0b8-4e19-aa47-aae2a6ccdb65','2019-10-01 18:04:51.241','2019-10-01 18:04:51.241',NULL,'577a027e-dc7a-479a-a187-86cc7724ed65','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','ASCII DXF format is the ASCII encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. ASCII DXF version 1.0 is the version of the format associated with Version 1.0 of the AutoCAD family of software products.','1982-12-01 00:00:00.000',NULL)
,('09097ce8-7690-4116-9e5c-9f4a1cddff1c','2019-10-01 18:05:07.862','2019-10-01 18:05:07.862',NULL,'1648f4e5-147b-4bc0-9d58-d47aed30e884','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
