,('bf3f6eca-1c8c-448f-8bef-131310449520','2019-10-01 18:04:57.170','2019-10-01 18:04:57.170',NULL,'ea091714-a5c5-4b2b-a0a1-f3277b14b74e','',NULL,NULL,NULL,NULL,1,false,true,false,'Generic','ASCII DXF format is the ASCII encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. It is not mandatory for ASCII DXF files to include a version identifier - some DXF files may therefore be identifiable only as generic DXF.',NULL,NULL)
