provide a URL link to the Google document held in Google Drive.',NULL,NULL)
,('7c9b3748-58cb-445e-9203-7a4b86eddd25','2019-10-01 18:05:02.256','2019-10-01 18:05:02.256',NULL,'a486373e-c751-44b2-b523-a66f9510ddb4','',NULL,NULL,NULL,NULL,1,false,true,false,'R14','Binary DXF format is the binary encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. Binary DXF was first developed in AutoCAD Release 10. It should not be confused with the DXB format - this is an entirely separate AutoDesk format for binary encoding vector graphics. Binary DXF Release 14 is the version of the format associated with Release 14 of the AutoCAD family of','1997-02-01 00:00:00.000',NULL)
