,('40f71f12-6069-4f68-b318-95f641214525','2019-10-01 18:05:03.534','2019-10-01 18:05:03.534',NULL,'f60f51de-dfd5-4a00-bcb0-45dde0a01860','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The DROID File Collection File format is a format for storing the results of file format identifications generated by the DROID software tool. It was developed by The National Archives of the UK. A DROID File Collection File is an XML document, comprising a ''FileCollection'' element, which describes the version of DROID and Signature File version number used to perform the identifications number, and date on which the identifications were generated. This element contains a ''File'' element for each file being identified. A File Collection File may either be generated prior to identification, in which case each ''File'' element simply contains the fully-qualified pathname of the file, or it can be generated after identification, in which case each ''File'' element additionally contains the identification result.','2005-09-17 00:00:00.000',NULL)
,('78552f18-059d-449a-a9c3-b31451bc9030','2019-10-01 18:05:03.955','2019-10-01 18:05:03.955',NULL,'5180967a-1aac-4c30-aa27-b26ea98a7001','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The DROID Signature File format is a format for storing internal and external signatures used by the DROID software tool to perform automatic file format identification. It was developed by The National Archives of the UK. DROID Signature Files are generated by TNA from the PRONOM technical registry, and are issued periodically as new formats are added to the registry. A DROID Signature File is an XML document, comprising an ''FFSignatureFile'' element, which describes the version number and date of the signature file, an ''InternalSignatureCollection'' element, which contains the set of internal signature values, and a ''FileFormatCollection'' element, which contains information on the set of formats described, together with their associated external signatures. The version number of a Signature File is incremented each time a new signature file is issued from the PRONOM registry, and does not indicate a different version of the format itself.','2005-09-17 00:00:00.000',NULL)
;
