,('225c4971-5692-43d4-8d6f-e29a6d595dc6','2019-10-01 18:05:04.943','2019-10-01 18:05:04.943',NULL,'4ecf586c-02f9-4ef8-b3b2-841599b465c1','',NULL,NULL,NULL,NULL,1,false,true,false,'','Digital Speech Standard is a proprietary audio file format for the storage of digital speech recordings, which was jointly developed and introduced by Olympus, Grundig and Philips.

The DSS Pro (.ds2) format supports improved sound quality over the original Digital Speech Standard format, and also supports file encryption.',NULL,NULL)
,('0af63ec4-7440-4fe9-be09-9cf7e9af0513','2019-10-01 18:05:05.437','2019-10-01 18:05:05.437',NULL,'1cc38769-bb02-446d-8acc-cb4dce0db5a0','',NULL,NULL,NULL,NULL,1,false,true,false,'','DTS Coherent Acoustics is a consumer-level audio codec employed as part of the DVD, Laserdisc and Blu-ray specifications.',NULL,NULL)
,('5352a190-2d72-468b-a8cb-ab696a5361c4','2019-10-01 18:05:05.949','2019-10-01 18:05:05.949',NULL,'b24fdcb4-1234-47bc-a1bd-1e8c62e79e94','',NULL,NULL,NULL,NULL,1,false,true,false,'','IFO files contain DVD-Video Disc Information including headers that tell the DVD player what screen to show at startup, where each chapter starts, where audio tracks are located on the disc, etc. IFO files are accompanied by BUP files which are backups of the IFO files and therefore completely identical.',NULL,NULL)
