,('984d4321-56a3-4a28-82fd-592c0f526c29','2019-10-01 18:05:06.969','2019-10-01 18:05:06.969',NULL,'3ce1c232-84ec-4b37-8db0-b48b07f5caea','',NULL,NULL,NULL,NULL,1,false,true,false,'','The ezdraw file format is mainly associated with ''EazyDraw'' by Dekorra Optics LLC enterprise. EazyDraw is a vector based drawing application. It is used for desk top publishing (DTP) with Apple''s Macintosh OS X (Mac OS-X) operating system. The format is an XML Property List dictionary based format. There is also a binary version of this format.',NULL,NULL)
