,('af5b2d0e-2885-476f-bddd-7c69ae35b3bd','2019-10-01 18:05:51.193','2019-10-01 18:05:51.193',NULL,'10a2bbb4-c229-4174-81a0-291e47e793a8','',NULL,NULL,NULL,NULL,1,false,true,false,'','FLIF is a lossless image format, developed by Jon Sneyers. FLIF is based on MANIAC compression. MANIAC (Meta-Adaptive Near-zero Integer Arithmetic Coding) is a variant of CABAC (context-adaptive binary arithmetic coding), where the contexts are nodes of decision trees which are dynamically learned at encode time.',NULL,NULL)
,('4df2ba91-33c3-4935-a775-fc0b32459fd4','2019-10-01 18:05:08.299','2019-10-01 18:05:08.299',NULL,'074938f1-af95-4fa3-9f2f-f914dc1109a3','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 1.2, the first version of the format, was developed in 1987. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1987-03-12 00:00:00.000',NULL)
,('efa9af2d-ab95-4be8-ad0b-89874270e381','2019-10-01 18:05:08.681','2019-10-01 18:05:08.681',NULL,'bf9c96fa-1eae-45ab-b417-2c63235e729c','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 2.0, the second version of the format, was developed in 1989. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1989-01-16 00:00:00.000',NULL)
;
