('3b6cd2a7-4ddf-4d8c-9b99-9085d01df955','2019-10-01 18:05:09.163','2019-10-01 18:05:09.163',NULL,'90162b54-8c0a-491a-9758-967863491a55','',NULL,NULL,NULL,NULL,1,false,true,false,'3','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 3, the third version of the format, was developed in 1992, and subsequently revised in 1999 to include a number of extensions and features of the PostScript language not previously documented. An EPS file comprises a header section followed by a PostScript document. The header can refer to version 3.0 or version 3.1. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1992-05-01 00:00:00.000',NULL)
,('3679d058-6f85-43d8-85bc-d6e72704ec78','2019-10-01 18:05:09.585','2019-10-01 18:05:09.585',NULL,'01df523a-b8e4-423d-b984-f33bce99e897','',NULL,NULL,NULL,NULL,1,false,true,false,'','Expert Witness was the original name for EnCase, as such this format can be referred to as either Expert Witness Compression Format or Encase Image File Format.
The format is used to store media images for forensic purposes. They are a type of disk image containing the contents and structure of an entire data storage device, disk volume or even a computer''s physical memory. This format creates segments which have different file extensions, the first will have the extension ''.e01''. this increases first numerically upto ''.e99'' the next extension will be ''.eaa'' increasing to an estimated limit of ''.zzz''.',NULL,NULL)
