,('a48069fa-5896-4f49-87d6-fca10ba2cda7','2019-10-01 18:05:11.978','2019-10-01 18:05:11.978',NULL,'2d1e2d0d-61bd-4dd7-baf1-58117b7144d8','',NULL,NULL,NULL,NULL,1,false,true,false,'','ECW (Enhanced Compression Wavelet) is a proprietary wavelet compression image format optimized for geospatial imagery, which can quickly compress and decompress huge images, especially aerial and satellite imagery. It was developed by Earth Resource Mapping, and is now owned by ERDAS, which is owned by Leica Geosystems. The requirement of using the ECWP format for any application is that it requires the user to download and install enabling software in the form of a plug-in or in the case of the Java applet, a Java runtime environment (JRE).',NULL,NULL)
