('55b840f4-3168-42b0-b782-f16ab5c5db8c','2019-10-01 18:05:13.351','2019-10-01 18:05:13.351',NULL,'00293686-b438-40ae-9e8d-530843abc108','',NULL,NULL,NULL,NULL,1,false,true,false,'','This format is the RAW image format used in Epsom cameras. RAW format images contain all the data that is taken directly from the camera''s image sensor before the software in the camera applies things like white balance, sharpening etc. Storing photographs in a camera''s RAW format allows you to alter those settings after the photograph has been taken.',NULL,NULL)
,('d6cb4cb5-2c2e-47af-912d-c5aae36af801','2019-10-01 18:05:13.775','2019-10-01 18:05:13.775',NULL,'c8546515-c5fc-4f49-ac0f-3b11874bd4d3','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('555167ef-15a1-417f-a97d-47cde511dc90','2019-10-01 18:05:14.177','2019-10-01 18:05:14.177',NULL,'cdd33826-2d41-4ad2-afac-865d3e76b3b4','',NULL,NULL,NULL,NULL,1,false,true,false,'','The ERDAS HFA format defines a heirachichal data structure used by many formats primarily associated with with the ERDAS Imagine software package for processing geospatial imagery. Other formats use this structure also, notably ArcGIS ''Reduced resolution datasets'' and their auxilliary files. It may be possible to distinguish between distinct subsets of HFA with further research. Please contact the PRONOM team if you can assist with this.',NULL,NULL)
,('fa4ab1b3-febc-4641-bb34-1d2ebd99c17c','2019-10-01 18:05:14.629','2019-10-01 18:05:14.629',NULL,'e55cea95-07b2-4309-8774-720a32200e39','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('51506fd9-5df0-4a43-b072-5723ad17bc66','2019-10-01 18:05:15.041','2019-10-01 18:05:15.041',NULL,'fb1ed906-6ed0-41d6-9d95-929cbbaba6dc','',NULL,NULL,NULL,NULL,1,false,true,false,'','eRuby (Embedded Ruby) is a templating system that embeds Ruby into a text document. It is often used to embed Ruby code in an HTML document, similar to ASP, JSP and PHP.',NULL,NULL)
,('f58050cf-26b3-4d02-a7bf-b1dbc7794f19','2019-10-01 18:05:15.468','2019-10-01 18:05:15.468',NULL,'f7a14b20-84ec-4bdd-9c2f-a4494b1f7fc1','',NULL,NULL,NULL,NULL,1,false,true,false,'','An Arc/Info binary grid is a proprietary raster GIS file format developed by ESRI. The grid defines geographic space as an array of equally sized square grid points arranged in rows and columns. Each grid point stores a numeric value that represents a geographic attribute such as elevation or surface slope. Each grid cell is referenced by its x,y coordinate.',NULL,NULL)
,('0eb1da55-8f66-43a8-8637-b397c5f246e2','2019-10-01 18:05:15.960','2019-10-01 18:05:15.960',NULL,'e6f173ff-618f-46d7-a399-b55a27b6bb2a','',NULL,NULL,NULL,NULL,1,false,true,false,'','ESRI ArcInfo Export File Format (also known as ArcInfo Interchange File Format) is a vector file format which is produced by ESRI and pre-dates the shapefile. It is as an export file used to enable coverage, grid or TIN and an associated INFO table to be transferred between different machines, which are not connected by any type of file sharing network. A volume has the extension .E00 through .E99.
A non-authoritative version of the specification can be found at: http://avce00.maptools.org/docs/v7_e00_cover.html',NULL,NULL)
,('6adf444e-9100-43d0-86f8-3bb58b285425','2019-10-01 18:05:16.349','2019-10-01 18:05:16.349',NULL,'ebf73acd-c54c-411e-88a1-543f36eb4f24','',NULL,NULL,NULL,NULL,1,false,true,false,'2.x','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('b59bc951-9eb6-4e0c-b166-7ff2972198cc','2019-10-01 18:05:16.790','2019-10-01 18:05:16.790',NULL,'b58dbda6-1a59-4584-ac7d-297edc4f235e','',NULL,NULL,NULL,NULL,1,false,true,false,'3.x','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('48467397-485e-4652-a423-52339c0bf1bd','2019-10-01 18:05:17.197','2019-10-01 18:05:17.197',NULL,'eab98dd1-c2fd-4fa3-8498-33b5369c95c2','',NULL,NULL,NULL,NULL,1,false,true,false,'','A shapefile stores none topological geometry and attribute information for the spatial features in a data set. The geometry for a feature is stored as a shape comprising a set of vector coordinates. Shapefiles can support point, line, and area features. Area features are represented as closed loop, double-digitized polygons. Attributes are held in a dBASE format file. An ESRI shapefile consists of a main file, an index file, and a dBASE table. The main file is a direct access, variable-record-length file in which each record describes a shape with a list of its vertices. In the index file, each record contains the offset of the corresponding main file record from the beginning of the main file. The dBASE table contains feature attributes with one record per feature. The one-to-one relationship between geometry and attributes is based on record number. Attribute records in the dBASE file must be in the same order as records in the main file.',NULL,NULL)
