INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('a891ae65-68d5-4ad5-aea9-96bed7b13887','2019-10-01 18:05:31.254','2019-10-01 18:05:31.254',NULL,'bbd58238-c9cf-41ab-9f81-aaa5c4d7d5d9','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.0 represents the reformulation of HTML 4.01 in XML. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.','2000-01-26 00:00:00.000',NULL)
,('bb4ee386-5155-4a92-9857-509109580af1','2019-10-01 18:05:31.707','2019-10-01 18:05:31.707',NULL,'c361a61e-ee94-4dc8-92e5-5b5abc08ba31','',NULL,NULL,NULL,NULL,1,false,true,false,'1.1','The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.1 is now recommended by the W3C over HTML for the creation of web pages. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.','2001-05-31 00:00:00.000',NULL)
,('db96ee74-5e11-48c2-8569-f65cc949bce2','2019-10-01 18:05:32.233','2019-10-01 18:05:32.233',NULL,'4f9671c3-d086-497e-a0d1-18758b3c332d','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The Extensible Markup Language (XML) is a general purpose markup language for creating other, special purpose, markup languages, and is a simplified subset of SGML. The structure and grammar of an XML document can be defined using a markup declaration, such as a Document Type Definition (DTD) or XML schema. A XML document consists of nested elements, each of which may have attributes and content. It typically begins with an XML declaration, defining the XML version and character set used. This may be followed by a Document Type declaration, containing or pointing to a markup declaration for the class of document. An XML document is said to be well-formed if it conforms to the XML specification; it is said to be valid if it additionally complies with a defined markup declaration. The formatting and transformation of XML documents can be controlled using the Extensible Stylesheet Language (XSL).','2004-02-04 00:00:00.000',NULL)
,('0b9e0f03-8432-458e-8a18-6710b6f04897','2019-10-01 18:05:32.663','2019-10-01 18:05:32.663',NULL,'67beea7b-1fbc-4d41-81e6-38b7032c966d','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Extensible Metadata Platform (XMP) is an ISO standard, originally created by Adobe Systems Inc., for the creation, processing and interchange of standardised and custom metadata for all kinds of resources.',NULL,NULL)
,('5b2a41f7-d95e-4a52-916a-e6992b6b50d3','2019-10-01 18:05:33.073','2019-10-01 18:05:33.073',NULL,'1d123c88-6f36-42ee-aec3-ef0bbe9de232','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Extensible Metadata Platform (XMP) is an ISO standard, originally created by Adobe Systems Inc., for the creation, processing and interchange of standardized and custom metadata for all kinds of resources.',NULL,NULL)
,('ab8bb7ac-d9ac-4716-b308-7faad56c6da7','2019-10-01 18:05:33.561','2019-10-01 18:05:33.561',NULL,'9c062db4-bf4e-4385-9ef7-b676a813f4ad','',NULL,NULL,NULL,NULL,1,false,true,false,'','Extensible Music Format (XMF) is a tree-based digital container format used to bundle music-oriented content, such as a MIDI file and optionally the sounds it uses, liner notes or other content grouped by language-codes.',NULL,NULL)
