('cdad0bd5-2bfe-4199-a369-b8b16b2f0497','2019-10-01 18:05:39.979','2019-10-01 18:05:39.979',NULL,'60327b38-4f46-4509-883c-ab18062251a8','',NULL,NULL,NULL,NULL,1,false,true,false,'','FLP is the native project format for the FL Studio Digital Audio Workstation, developed by Image Line. It contains all data related to a project, but does not contain any wave samples.',NULL,NULL)
,('ff91fc9b-6669-4af8-87e7-685ae9ad61c4','2019-10-01 18:05:40.438','2019-10-01 18:05:40.438',NULL,'bf453bae-41fc-48b0-8f14-b612a665c585','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2.1','FLAC stands for Free Lossless Audio Codec, an audio format similar to MP3, but lossless, meaning that audio is compressed in FLAC without any loss in quality.
The basic structure of a FLAC stream is: •The four byte string "fLaC"
•The STREAMINFO metadata block
•Zero or more other metadata blocks
•One or more audio frames
 The first four bytes are to identify the FLAC stream. The metadata that follows contains all the information about the stream except for the audio data itself. After the metadata comes the encoded audio data.','2007-09-17 00:00:00.000',NULL)
