('3c8be31d-9f80-4c76-9ca1-ae59427543ad','2019-10-01 18:06:04.353','2019-10-01 18:06:04.353',NULL,'bbedb187-3f9f-4675-bb67-4f061f735392','',NULL,NULL,NULL,NULL,1,false,true,false,'87a','The Graphics Interchange Format (GIF) is a raster image format developed by Compuserve, primarily for use on the internet. A GIF file begins with a Header section and a Logical Screen Descriptor section. This is followed by one or more Image sections, and the file is terminated by a Trailer. GIF supports bit depths between 1 and 8 bits (i.e. up to 256 colours) and supports features such as interlacing and transparency. Images are always stored using lossless LZW compression.','1987-06-15 00:00:00.000',NULL)
