('4626de47-53a9-4193-9034-43bd89eec999','2019-10-01 18:06:17.556','2019-10-01 18:06:17.556',NULL,'06d648bb-0036-4a68-b5ee-134a77642f67','',NULL,NULL,NULL,NULL,1,false,true,false,'','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. The notion of a generic HTML format is used here to define HTML documents which pre-date the first formal specification (HTML 2.0), or which otherwise to do not fully conform to any formal specifications.',NULL,NULL)
,('0688f7af-fb60-4960-ab49-740760573a08','2019-10-01 18:06:18.185','2019-10-01 18:06:18.185',NULL,'091ef9ae-6c0e-48d2-b000-7a924b73ad05','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 2.0 represents the first formal specification of the language.','1995-11-01 00:00:00.000',NULL)
,('39e90f98-a9d8-4cfc-b664-5343d86c881f','2019-10-01 18:06:18.615','2019-10-01 18:06:18.615',NULL,'1d7696cc-561e-4b30-89bc-3b2a358d0079','',NULL,NULL,NULL,NULL,1,false,true,false,'3.2','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 3.2 was the first major revision to the original HTML 2.0 specification.','1997-01-14 00:00:00.000',NULL)
,('0d64a1e1-1bcc-417e-8492-a4c390558ea1','2019-10-01 18:06:19.022','2019-10-01 18:06:19.022',NULL,'0d8e65be-02e4-40c0-86ab-ba6d5e85e871','',NULL,NULL,NULL,NULL,1,false,true,false,'4.0','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 4.0 represents a major revision of the HTML 3.2 specification.','1998-04-24 00:00:00.000',NULL)
,('d3298d5b-845a-40b0-af20-5095974ca4d2','2019-10-01 18:06:19.470','2019-10-01 18:06:19.470',NULL,'4b3f3f86-576d-4947-949c-025a43d3e810','',NULL,NULL,NULL,NULL,1,false,true,false,'4.01','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 4.01 contains minor editorial revisions to the HTML 4.0 specification.','1999-12-24 00:00:00.000',NULL)
