,('30e3fdd6-d939-4e8a-8c72-8e1328932aeb','2019-10-01 18:06:23.326','2019-10-01 18:06:23.326',NULL,'acaf5c7a-bba2-416d-a07f-d03f0adc9df6','',NULL,NULL,NULL,NULL,1,false,true,false,'1','The Image Cytometry Standard (ICS) is a digital multidimensional image file format used in life sciences microscopy. It stores not only the image data, but also the microscopic parameters describing the optics during the acquisition. Version 1 of the format holds just the metadata and a pointer to a corresponding .ids file which contains the pixel data.',NULL,NULL)
