,('a9652989-7b8a-4c1a-8c49-5503e7319848','2019-10-01 18:06:25.742','2019-10-01 18:06:25.742',NULL,'139d211c-fdcb-4b8a-8c51-cd6450e3a43c','',NULL,NULL,NULL,NULL,1,false,true,false,'','IDML is an XML representation of an Adobe InDesign Document. The package format is conformant with the Universal Container Format and identification is based on the contents of the mimetype file with the zip container.',NULL,NULL)
,('946776f6-cb2c-4d7c-a8cb-120729c70477','2019-10-01 18:06:26.155','2019-10-01 18:06:26.155',NULL,'c9e79213-09c5-4dce-a2ca-15c170e12482','',NULL,NULL,NULL,NULL,1,false,true,false,'2x2','The Industry Foundation Classes (IFC) data model is intended to describe building and construction industry data.
 It is a platform neutral, open file format specification that is not controlled by a single vendor or group of vendors. It is an object-based file format with a data model developed by buildingSMART (formerly the International Alliance for Interoperability, IAI) to facilitate interoperability in the architecture, engineering and construction (AEC) industry, and is a commonly used collaboration format in Building information modeling (BIM) based projects.',NULL,NULL)
;
