('3d915dc0-9a43-455f-945e-fd881b622417','2019-10-01 18:06:38.976','2019-10-01 18:06:38.976',NULL,'ae25aaf0-4c24-43ac-8c54-9d3780b8cf1d','',NULL,NULL,NULL,NULL,1,false,true,false,'','Defined in RFC5322 the Internet Message Format provides a syntax for text messages that  are sent  among computer  users, within the framework of "electronic mail". Consisting of header fields and an optional body, encoded using ASCII characters. The Internet Message Format (*.eml) is a format used by numerous email systems. The format does not prevent the use of alternative formats for storage of electronic mail on those systems.',NULL,NULL)
