('88730073-2fe3-48f9-a0bf-f8c966bc992f','2019-10-01 18:06:43.276','2019-10-01 18:06:43.276',NULL,'9834a6ef-906c-47d8-950e-5798d51e5e3e','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('082cdba6-92fd-4751-8531-000f8e62f98f','2019-10-01 18:06:43.720','2019-10-01 18:06:43.720',NULL,'6b6cbf04-2438-4e3e-8a73-929b2ddac6b6','',NULL,NULL,NULL,NULL,1,false,true,false,'','Jeff''s Image Format (JIF) is a raster image file format that was designed to be a patent-free alternative to GIF. It is nearly identical to GIF, except that it uses zlib compression instead of LZW.',NULL,NULL)
,('c7f4921e-263f-4180-874e-ff9a6326a2be','2019-10-01 18:06:44.058','2019-10-01 18:06:44.058',NULL,'7db8ba10-7929-4fdc-8cdb-409204d9799a','',NULL,NULL,NULL,NULL,1,false,true,false,'','Nuclear magnetic resonance spectroscopy (NMR spectroscopy) data files produced by with JEOL''s NMR Spectrometers.',NULL,NULL)
,('519643f8-b920-4167-b779-7e4e9cc5678b','2019-10-01 18:06:44.486','2019-10-01 18:06:44.486',NULL,'31694bc2-378d-476e-8e68-7deaa2e84d28','',NULL,NULL,NULL,NULL,1,false,true,false,'','The JPEG 2000 file format (JP2 file format) provides a foundation for storing application specific data (metadata) in association with a JPEG 2000 codestream, such as information which is required to display the image.  The JP2 file format encapsulates the JPEG 2000 codestream along with other core pieces of information about that codestream.  The building-block of the JP2 file format is called a box; all information contained within the format is contained in boxes.  There are several different box types; some boxes contain other boxes.  The binary structure of a file is a contiguous sequence of boxes.  The start of the first box is the first byte of the file, and the last byte of the last box is the last byte of the file.','2004-09-15 00:00:00.000',NULL)
,('e7c56cb4-5ca5-444a-9a9c-749ffe0b7ce1','2019-10-01 18:06:44.960','2019-10-01 18:06:44.960',NULL,'28135bca-5339-4c14-ab92-b397bb6e4f30','',NULL,NULL,NULL,NULL,1,false,true,false,'','JPEG XR (abbr. For JPEG extended range) is a still-image compression standard and file format for continuous tone photographic images, based on technology originally developed and patented by Microsoft under the name HD Photo (formerly Windows Media Photo). It supports both lossy and lossless compression.',NULL,NULL)
,('a34b9fbd-c57f-4bd0-b51a-30d1335ad162','2019-10-01 18:06:50.788','2019-10-01 18:06:50.788',NULL,'2a5a6103-3b20-4ab8-8b84-cdefd0c59a3d','',NULL,NULL,NULL,NULL,1,false,true,false,'','KML is an Open Geospatial Consortium (OGC) sponsored xml schema file format used to display geographic data in an earth browser, such as Google Earth, Google Maps, and Google Maps for mobile. A KML file is processed in much the same way that HTML (and XML) files are processed by web browsers. Like HTML, KML has a tag-based structure with names and attributes used for specific display purposes. Thus, Google Earth and Maps act as browsers for KML files.
Full specifications available at: http://www.opengeospatial.org/standards/kml',NULL,NULL)
,('84b05e33-acae-4f99-83d6-835de8ff7f5a','2019-10-01 18:06:45.516','2019-10-01 18:06:45.516',NULL,'49bb858d-ee3f-4556-9898-e5dc72b694cc','',NULL,NULL,NULL,NULL,1,false,true,false,'1.00','The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard; this is what is commonly referred to as the JPEG file format. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0). This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.',NULL,NULL)
,('f512d090-847a-4e68-81a9-8c210ca4a3f9','2019-10-01 18:06:46.109','2019-10-01 18:06:46.109',NULL,'3a0eb83b-66e4-4bbb-9c59-0d5292b34531','',NULL,NULL,NULL,NULL,1,false,true,false,'1.01','The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard; this is what is commonly referred to as the JPEG file format. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0). This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.',NULL,NULL)
,('12b7724a-988e-432e-b1c3-bc1abc61f150','2019-10-01 18:06:46.566','2019-10-01 18:06:46.566',NULL,'4d4885d7-4e1e-492b-9342-46a4194de9cc','',NULL,NULL,NULL,NULL,1,false,true,false,'1.02','The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0) marker and one or more optional application extension markers. This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.','1992-09-01 00:00:00.000',NULL)
,('bce976f0-c984-49bc-a40f-ab45c91cc9fd','2019-10-01 18:06:47.030','2019-10-01 18:06:47.030',NULL,'54b60f5a-8f62-430f-aaf1-f8682d6e3aad','',NULL,NULL,NULL,NULL,1,false,true,false,'','JPEG Network Graphics (JNG) is a JPEG-based graphics file format which is closely related to PNG: it uses the PNG file structure (with a different signature) as a container format to wrap JPEG encoded image data. JNG was created as an adjunct to the MNG animation format, but may be used as a stand-alone format. JNG files embed an 8-bit or 12-bit JPEG datastream in order to store color data, and may embed another datastream (1, 2, 4, 8, 16 bit PNG, or 8 bit JPEG grayscale image) for transparency information. However, a JNG may contain two separate JPEG datastreams for color information (one eight-bit and one twelve-bit) to permit decoders that are unable to (or do not wish to) handle twelve-bit datastreams to display the eight-bit datastream instead, if one is present.',NULL,NULL)
;
