('98246859-8767-4164-93bf-79854912fba2','2019-10-01 18:06:47.426','2019-10-01 18:06:47.426',NULL,'5c035c1b-7d03-4638-8567-458553df3163','',NULL,NULL,NULL,NULL,1,false,true,false,'','A standard for lossless or near-lossless compression of images, also known as ISO/IEC 14495-1 and ITU Recommendation T.87, created by the Joint Photographics Experts Group (JPEG). It was developed as a low complexity lossless image compression standard in 1999, and was based on LOCO-I algorithm. JPEG-LS also provides a lossy mode. It has faster compression than JPEG 2000 and is considered better than the original lossless JPEG standard.',NULL,NULL)
,('ca03afc0-cb15-4438-ac79-dfe72b01585a','2019-10-01 18:06:47.885','2019-10-01 18:06:47.885',NULL,'03488f1f-24b9-4b65-82c1-04bcadf11196','',NULL,NULL,NULL,NULL,1,false,true,false,'','The JPEG 2000 Compound Image File Format is an optional file format for storing compound images using the JPEG 2000 file format family architecture. A compound image is an image that may contain scanned images, synthetic images or both, and that preferably requires a mix of continuous tone and bi-level compression methods.',NULL,NULL)
,('c30c23d2-7884-4c4d-8e0b-4c14f0f2cf28','2019-10-01 18:06:48.278','2019-10-01 18:06:48.278',NULL,'362b0ed3-13d2-431e-9665-7252a553fbfe','',NULL,NULL,NULL,NULL,1,false,true,false,'','JPX is an image file format extended from JP2, providing the potential for extended colour space support, alternative compression methods, and other features. JPX may be used in applications that require additional functionality or data structures beyond those defined in the JP2 file format.',NULL,NULL)
,('512ea706-23fd-40ab-bad6-acf9dea2d4c2','2019-10-01 18:06:48.685','2019-10-01 18:06:48.685',NULL,'e57d6adc-fbd7-49d7-b78c-910ae0b86f29','',NULL,NULL,NULL,NULL,1,false,true,false,'','JavaScript Object Notation (JSON) is an open standard format that uses human-readable text to transmit data objects consisting of attribute–value pairs. It is used for asynchronous browser/server communication (AJAJ). While it is originally derived from JavaScript scripting language, JSON is language independent while using conventions that match with the C-family of languages, including C, C++, C#, Java, JavaScript, Perl, Python, and others.',NULL,NULL)
,('3a8be547-dc03-4501-8121-f57a37726195','2019-10-01 18:06:49.085','2019-10-01 18:06:49.085',NULL,'739c300b-3f83-40cc-ad5a-a570bc291669','',NULL,NULL,NULL,NULL,1,false,true,false,'','JSON-LD is a JSON-based format to serialize Linked Data. It is designed to be easy to convert an existing JSON file to JSON-LD. It''s main objective is to be a way to use Linked Data in Web-based programming environments, to build interoperable Web services, and to store Linked Data in JSON-based storage engines.',NULL,NULL)
,('f10b1747-b275-4310-bf05-57102c524b8c','2019-10-01 18:06:49.498','2019-10-01 18:06:49.498',NULL,'9e1e557e-cd3d-4a66-8e20-3dd58a011317','',NULL,NULL,NULL,NULL,1,false,true,false,'','JTIP is a multi-resolution format, created for image presentation with easy transfer and handling, based on SPIFF. It allows presentation of images in various sizes and resolutions from vignette (1/16 screen size, used for browsing) through imagette (1/4 screen, for image comparison), to full screen and higher resolution images. Each layer is divided into tiles so the user can zoom or pan easily. A file contains an internal ID for tiles, with each tile associated with a single file header and separated by markers. Under header there can be and optional table noting the tile offsets, or an external ID for separate files. JTIP is not widely used and is no longer supported.',NULL,NULL)
,('2731a048-05e2-46c2-b86a-ddcbf0afe174','2019-10-01 18:06:49.881','2019-10-01 18:06:49.881',NULL,'6ddc3952-004a-4be9-aec6-76c1645ae2a9','',NULL,NULL,NULL,NULL,1,false,true,false,'','Notebook documents are files which are produced by the Jupyter Notebook application, they consist of Python computer code as well as rich text elements. They are both human readable documents as well as executable.',NULL,NULL)
,('156b15e7-541c-4d45-a515-fb129079f00b','2019-10-01 18:06:51.151','2019-10-01 18:06:51.151',NULL,'53b53771-ce00-489d-bc8c-7ec6ac6210c8','',NULL,NULL,NULL,NULL,1,false,true,false,'','KML is an Open Geospatial Consortium (OGC) sponsored xml schema file format used to display geographic data in an earth browser, such as Google Earth, Google Maps, and Google Maps for mobile. A KML file is processed in much the same way that HTML (and XML) files are processed by web browsers. Like HTML, KML has a tag-based structure with names and attributes used for specific display purposes. Thus, Google Earth and Maps act as browsers for KML files.
Full specifications available at: http://www.opengeospatial.org/standards/kml',NULL,NULL)
,('4f312c43-599e-43bb-9623-aa31935c3fc3','2019-10-01 18:06:51.568','2019-10-01 18:06:51.568',NULL,'4437853f-ae91-4c87-9789-09ceeff1d5c8','',NULL,NULL,NULL,NULL,1,false,true,false,'','KTX (Khronos Texture) is a file format for storing OpenGL textures.',NULL,NULL)
,('3161eea6-54ee-41eb-aa20-275f04df4ba7','2019-10-01 18:06:51.993','2019-10-01 18:06:51.993',NULL,'902d87cd-4748-40d7-b506-ad1285961b93','',NULL,NULL,NULL,NULL,1,false,true,false,'','Kodak DCR is the raw image generated by some models of Kodak DCS camera. The format is based upon the Tagged Image File Format.',NULL,NULL)
;
