('acd98348-4915-41e3-a59b-2eeb96e3b8e6','2019-10-01 18:06:52.424','2019-10-01 18:06:52.424',NULL,'1b044b35-1ff7-42d7-a294-5f7593edefb9','',NULL,NULL,NULL,NULL,1,false,true,false,'','The FlashPix format is a raster based image format that builds on features of previous formats, including Kodak Image Pac, Live Picture IVUE, Hewlett-Packard JPEG, TIFF, and TIFF/EP. The FlashPix format is a cooperative endeavor that includes the Eastman Kodak Company, Microsoft Corporation, the Hewlett-Packard Company, and Live Picture, Inc.',NULL,NULL)
,('668fed17-b704-4b70-8020-da03fa1bb69a','2019-10-01 18:06:52.874','2019-10-01 18:06:52.874',NULL,'07c6825c-4f96-40bb-8625-26e09a76bfcc','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('1a2411a8-74ba-4f9d-a970-af43a464e100','2019-10-01 18:06:53.289','2019-10-01 18:06:53.289',NULL,'27af0f21-4e5d-4b42-9731-3fbea6a3e6b8','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','PUID deprecated in favour of fmt/211 Kodak Photo CD Image',NULL,NULL)
,('7dcb9197-1f47-4111-81a0-2f4aa0da2720','2019-10-01 18:06:53.711','2019-10-01 18:06:53.711',NULL,'a80f2bdd-0286-4009-a55b-40089101236c','',NULL,NULL,NULL,NULL,1,false,true,false,'','Krita is a free raster graphics editor. Krita''s native document format is Krita Document (.kra), which is loosely based on the Open Document standard. The format is used for handling layered raster based graphics.',NULL,NULL)
,('faa07d01-c93f-431a-8a68-26cbae76415c','2019-10-01 18:06:54.129','2019-10-01 18:06:54.129',NULL,'9fcec670-f6fe-4156-b751-7364c81594be','',NULL,NULL,NULL,NULL,1,false,true,false,'2','KryoFlux is a software-programmable FDC (Floppy Disk Controller) system that runs on small ARM7-based devices and connects to a host PC over a USB connector. It reads and writes flux transitions on floppy disks at a very fine resolution.',NULL,NULL)
