,('076cbde4-b590-4baa-b28a-34baebbaf2c1','2019-10-01 18:07:04.591','2019-10-01 18:07:04.591',NULL,'58a4f94f-f6ff-495e-8acc-08fa81563a98','',NULL,NULL,NULL,NULL,1,false,true,false,'','Logical FIle Evidence Format was introduced in EnCase version 5. They are form of Encase Image files, this format is used to store media images for forensic purposes. They are a type of disk image containing the contents and structure of an entire data storage device, disk volume or even a computer''s physical memory. The logical version of this format is used to create an image of the original files as they existed on the media but also documents other ifnormation. This includes the assigned file name and extension, datetime of creation, modified date, and date last accessed, the logical and physical size, an MD5 hash value, permissions and original path. This format creates segments which have different file extensions, the first will have the extension ''.l01''. this increases first numerically upto ''.l99'' the next extension will be ''.laa'' increasing to an estimated limit of ''.zzz''.',NULL,NULL)
