,('98f1a148-0c4f-44e0-8892-e781f8d5701a','2019-10-01 18:07:25.931','2019-10-01 18:07:25.931',NULL,'3a3a1dbd-416c-48cf-a72a-3ce40bb1cd4a','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Magick Image File Format (MIFF) is ImageMagick''s own format for storing bitmap images. It stores all metadata known to ImageMagick.',NULL,NULL)
