,('d98de8e4-754e-4015-affc-bd2ebfa5d0b9','2019-10-01 18:07:26.813','2019-10-01 18:07:26.813',NULL,'eeb9beed-506e-4293-b122-c6829fc99ab3','',NULL,NULL,NULL,NULL,1,false,true,false,'','The mapsforge project aims to provide free and open software for the rendering of maps based on OpenStreetMap data. The Binary Map File Format is designed for map rendering on devices with limited resources, such as mobile phones.',NULL,NULL)
,('88715532-6be4-4d10-b493-eee0ba121192','2019-10-01 18:07:27.251','2019-10-01 18:07:27.251',NULL,'517c9f3e-1cdb-462e-973f-766a87e04d96','',NULL,NULL,NULL,NULL,1,false,true,false,'','Markdown was created by John Gruber and Aaron Swartz circa 2004. The purpose of Markdown is to let users write clean text-based documents that do not suffer from the legibility issues of other ''markup'' formats.

Markdown uses combinations of characters, for example, hashes (pound-sign), asterisks, and combination of square- and rounded- brackets to prefix or suffix parts of text. The symbols provide instructions to an interpreter. A single hash ''#'' for example, that prefixes a line of text is an instruction to make that line a top-level header in a formatted document. Two hashes ''##'' is an instruction to render, or output, a secondary header. And so on.

Ultimately the result of writing markdown is a document that can be parsed into a well-formed version of other presentation languages such as HTML or XHTML.

There is no single specification for Markdown, nor is there a single canonical output. That is, Markdown syntax could be converted into many other file types.

Further descriptions of the background of Markdown and a list of Markdown ''flavors'' can be found on the Archiveteam Just Solve It File Formats Wiki: http://fileformats.archiveteam.org/wiki/Markdown

Wikipedia also provides a thorough description of Markdown and its syntax: https://en.wikipedia.org/wiki/Markdown#Standardization',NULL,NULL)
,('a7aede7c-a109-4c56-8595-baaff09bbaf6','2019-10-01 18:07:27.650','2019-10-01 18:07:27.650',NULL,'b3ef5ea5-6285-4fb9-8909-805a6de226ee','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 1a','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP1a is intended to meet the requirements of acquisition, storage and interchange applications that are satisfied by a single item of content packaged in a single essence container.',NULL,NULL)
,('961eab3e-4c26-4819-b51e-c00190c301cb','2019-10-01 18:07:28.033','2019-10-01 18:07:28.033',NULL,'0ccdec3a-9863-44b8-a540-cc8ee4fce70d','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 1b','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP1b is intended to meet the requirements of acquisition, storage and interchange applications where more than one essence component is required and it is wished to carry these in two or more essence containers.',NULL,NULL)
,('48c27d11-4711-497e-82e7-d6d034a3038f','2019-10-01 18:08:26.466','2019-10-01 18:08:26.466',NULL,'1d98e955-ebd6-4564-9e8c-2b5ab34de8b5','',NULL,NULL,NULL,NULL,1,false,true,false,'2000','PUID deprecated. Please see fmt/247: Microsoft Project 2000 - 2003.',NULL,NULL)
,('8cac11f0-c940-46ef-969b-fe846e4be809','2019-10-01 18:07:28.459','2019-10-01 18:07:28.459',NULL,'62c016ee-c0e8-4762-8f04-d5c7a457df80','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 1c','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP1c: A choice of 2 or more alternate material packages that play out selected tracks of either a single file package or two or more synchronized file packages.',NULL,NULL)
,('f8a2375a-2e75-498b-9502-0d9194f45de8','2019-10-01 18:07:28.896','2019-10-01 18:07:28.896',NULL,'7772bc0f-7007-4583-9652-924ab3c20558','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 2a','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP2a is intended to meet the requirements of acquisition, storage and interchange applications that are satisfied by a play-list of individual items of content packaged in two or more essence containers each of the same type.',NULL,NULL)
