,('0a7d5983-9348-42d1-86d0-2d4a6f190383','2019-10-01 18:07:30.233','2019-10-01 18:07:30.233',NULL,'e45f677f-fb9b-44cc-88b6-0e6992ce794d','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 3a','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

