,('c002e4b7-b04f-4e52-8d22-e5dfb164756e','2019-10-01 18:07:30.678','2019-10-01 18:07:30.678',NULL,'d2bf59a0-740c-4f52-bdcc-944a34cb625c','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 3b','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

