,('5df0efbc-87b4-43e0-8781-51d076a19015','2019-10-01 18:07:31.166','2019-10-01 18:07:31.166',NULL,'5e81a244-f0d1-41a4-8b7a-278c184ced80','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern 3c','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP3c: A choice of 2 or more alternate material packages that play out selected portions of tracks (edit list) from one or more file packages each of which may be referenced and synchronized at any given position along the timeline.',NULL,NULL)
,('905b8407-978f-4348-8e6a-503406aa1dcd','2019-10-01 18:07:31.616','2019-10-01 18:07:31.616',NULL,'e20183bb-3e82-4def-b4ba-244a6663142f','',NULL,NULL,NULL,NULL,1,false,true,false,'Operational Pattern OP-ATOM','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

Operational Pattern “OP-Atom” is intended to satisfy the demands of applications where there is a requirement for exchange of material and associated metadata together in a single file with an open and standardized format, yet also a demand for a simple, predictable, layout with minimum scope for variation. OP-Atom is specifically intended for applications where each Essence Track is held separately.',NULL,NULL)
,('8a784e43-3fa9-42c9-8c65-fd54ec7ad596','2019-10-01 18:07:32.140','2019-10-01 18:07:32.140',NULL,'746b080f-a2a1-4d4b-b2df-8e12ae495049','',NULL,NULL,NULL,NULL,1,false,true,false,'7.3','A Mat-file stores data in binary form. You can read and write Mat-files using MATLAB. Level 7.3 MAT-file formats were introduced in 2006 and use an HDF5 based format.',NULL,NULL)
,('3f512f7a-8787-40d2-9288-57b2f85cad5d','2019-10-01 18:07:32.554','2019-10-01 18:07:32.554',NULL,'18c7b7b9-0477-40a1-a281-d3bb21a067f7','',NULL,NULL,NULL,NULL,1,false,true,false,'Binary','Mathcad is a proprietary application intended for the verification, validation, documentation and reuse of engineering calculations.',NULL,NULL)
,('4991bd96-4f7d-41fc-8e01-2e9758720286','2019-10-01 18:07:33.458','2019-10-01 18:07:33.458',NULL,'0004d40e-3f9f-4161-ac53-0b1d76c46119','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('8abbad33-505b-4626-adf2-90f3d69d29b3','2019-10-01 18:07:33.935','2019-10-01 18:07:33.935',NULL,'0556832f-3363-481b-bf41-cb7074b1959e','',NULL,NULL,NULL,NULL,1,false,true,false,'1-4','The Matroska Multimedia Container is an open standard free container format, based on the Extensible Binary Meta Language (EBML). Matroska file extensions are .MKV for video (with subtitles and audio), .MK3D for stereoscopic video, .MKA for audio-only files, and .MKS for subtitles only. The Internet Engineering Task Force (IETF) Working Group: Codec Encoding for LossLess Archiving and Realtime transmission (cellar) is tasked with the standardisation of Matroska.

The EBML specifications are work-in-progress, and can be found here: https://github.com/Matroska-Org/ebml-specification/blob/master/specification.markdown','2002-12-06 00:00:00.000',NULL)
;
