('7587c3bb-e266-4b45-b1bf-30081710cf6f','2019-10-01 18:07:34.353','2019-10-01 18:07:34.353',NULL,'a40fa7aa-752b-4fb9-a928-48a253b95495','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Maxwell Image Format is a high dynamic range format containing both image data and rendering calculations.',NULL,NULL)
,('3c8507bb-9144-45ec-b376-8e1042271f2d','2019-10-01 18:07:34.784','2019-10-01 18:07:34.784',NULL,'41f2a214-85de-4c67-b9f3-30fefa5c5d5d','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Material file defines material properties for 3D objects for use within a Maxwell 3D Scene.',NULL,NULL)
,('e1cdb874-6e3f-4725-81c1-be9b525d0a98','2019-10-01 18:07:35.251','2019-10-01 18:07:35.251',NULL,'3a0cfbf6-5d87-4999-9d27-fb7f2219e22f','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Maxwell Scene contains all the geometry in a Maxwell Render scene, as well as cameras and their settings, materials and material assignments.',NULL,NULL)
,('4dbafce4-d899-49d0-8b53-7cfc85e0bb0f','2019-10-01 18:07:35.695','2019-10-01 18:07:35.695',NULL,'4a3d0b1d-48b3-4c38-91f0-16546e60f3fb','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maya is an application used to generate 3D assets for use in film, television, game development and architecture, currently developed and maintained by Autodesk.',NULL,NULL)
,('49381f8e-ab6b-4993-a089-bdcf2514344e','2019-10-01 18:07:36.104','2019-10-01 18:07:36.104',NULL,'224a205d-be68-4b7e-820c-66f9fa22d9a8','',NULL,NULL,NULL,NULL,1,false,true,false,'32 Bit','Maya is an application used to generate 3D assets for use in film, television, game development and architecture, currently developed and maintained by Autodesk.',NULL,NULL)
,('af3346a5-af19-4504-8479-1b6f832ce74e','2019-10-01 18:07:36.546','2019-10-01 18:07:36.546',NULL,'0f5942f2-c95f-49c4-9773-5ffe693aeaee','',NULL,NULL,NULL,NULL,1,false,true,false,'64 Bit','Maya is an application used to generate 3D assets for use in film, television, game development and architecture, currently developed and maintained by Autodesk.',NULL,NULL)
,('0daf3956-b91a-4b1d-a9fe-8a6578c19e34','2019-10-01 18:07:36.977','2019-10-01 18:07:36.977',NULL,'cb59e1e1-1263-403a-9d10-70f6a6a91306','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maya is a 3D graphics application published by Autodesk. Swatch files are created by Maya to provide preview thumbnail images of textures. Maya Icon files appear to use the same format mechanism. An unofficial description of the format layout can be found here: https://www.highend3d.com/t/renderwindoweditor-snm/3411',NULL,NULL)
,('2ecd7be2-017d-4aff-8bba-30e925de0d6f','2019-10-01 18:07:37.449','2019-10-01 18:07:37.449',NULL,'bcc49f46-45b7-4d8e-8ec2-a0ad195daf87','',NULL,NULL,NULL,NULL,1,false,true,false,'','Maya is a 3D graphics application published by Autodesk. Maya IFF files are raster images used for images and textures within Maya.',NULL,NULL)
,('063e49e1-4128-4ad0-a340-0c217b4038a9','2019-10-01 18:07:37.855','2019-10-01 18:07:37.855',NULL,'a5c68c3e-78b5-43cc-8a34-c7b458394cee','',NULL,NULL,NULL,NULL,1,false,true,false,'','MBOX is a commonly used format for storing email messages. MBOX files may be produced by a variety of email clients, however these are often not mutually compatible.

MBOX databases typically contain a linear sequence of electronic mail messages. Each message begins with a separator line that identifies the message sender, and also identifies the date and time at which the message was received by the final recipient (either the last-hop system in the transfer path, or the system which serves as the recipient''s mailstore).  Each message is typically terminated by an empty line.  The end of the database is usually recognized by either the absence of any additional data, or by the presence of an explicit end-of-file marker.

Attachments within MBOX files are typically base 64 encoded, allowing binary data to be transferred over media designed to deal with textual data.

Due to the variety of MBOX structures, it is not currently possible to produce an authoritative signature for the format.',NULL,NULL)
,('0c5e3698-4d06-4b4c-840c-b27006fefb71','2019-10-01 18:07:38.243','2019-10-01 18:07:38.243',NULL,'8a958443-88fd-4988-8954-96224edac658','',NULL,NULL,NULL,NULL,1,false,true,false,'','The MD5 algorithm is a hash function producing a 128-bit hash value, it is described in RFC 1321. Although MD5 was initially designed to be used as a cryptographic hash function, it has been found to suffer from extensive vulnerabilities. It can still be used as a checksum to verify data integrity against unintentional corruption. The MD5 file is a text document which contains single or multiple MD5 values.',NULL,NULL)
;
