,('170ee04f-db40-443d-b17b-6c40c36db588','2019-10-01 18:07:44.678','2019-10-01 18:07:44.678',NULL,'b230ec53-477c-4edc-93a5-f1fce1de27b2','',NULL,NULL,NULL,NULL,1,false,true,false,'97','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('e6020769-91f2-4769-b1cf-dec355ea4acb','2019-10-01 18:07:45.078','2019-10-01 18:07:45.078',NULL,'1660412b-7cfe-4375-a717-6436d6dbaef8','',NULL,NULL,NULL,NULL,1,false,true,false,'','Animated Cursor Format (ANI), also known as Windows NT Animated Cursor, is a chunk-based bitmap format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, an ANI file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with an ANI data type identifier, followed by a series of chunks which contain two or more bitmaps stored in an ANI file. Each bitmap is typically either a Windows cursor or icon data, but may also be raw, uncompressed bitmaps. Additional information stored in the ANI file controls the rate and the sequence in which each frame is displayed.
Furthe information regarding this and other RIFF formats can be found at http://oreilly.com/www/centers/gff/formats/micriff/',NULL,NULL)
,('620b80f1-2505-499d-946e-66e6d7efcc78','2019-10-01 18:07:45.507','2019-10-01 18:07:45.507',NULL,'394c03ca-8d2b-42cb-9cef-72a8e980931c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('e833201d-12aa-4223-adae-1f2180bb34dd','2019-10-01 18:07:46.018','2019-10-01 18:07:46.018',NULL,'9117f24b-5276-448c-988a-0208fceceea1','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is a proprietary file format created by Microsoft Document Imaging, a program which enables the editing and annotation of documents scanned by Microsoft Office Document Scanning. It was introduced in Office XP and was included in Office 2003 and 2007. This format is a variant of TIFF.',NULL,NULL)
,('914ec257-4aa0-42b1-afba-65f17a192d45','2019-10-01 18:07:46.475','2019-10-01 18:07:46.476',NULL,'771045e3-69d5-482b-9d51-0d849284dcfd','',NULL,NULL,NULL,NULL,1,false,true,false,'2','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 2 is the native file format of Microsoft Excel 2.1 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 2 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL)
,('02da70d9-b053-42c2-88e4-9be69f8a1940','2019-10-01 18:07:51.293','2019-10-01 18:07:51.293',NULL,'dc8f4390-6223-4c7f-a6de-7ff0ae9e598d','',NULL,NULL,NULL,NULL,1,false,true,false,'3.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('dafa53eb-7b09-4e67-9057-c939dfd4a6ba','2019-10-01 18:08:33.679','2019-10-01 18:08:33.679',NULL,'e719ce25-e81e-433c-8127-c4a47bc57ddc','',NULL,NULL,NULL,NULL,1,false,true,false,'','This eBook format was developed by Microsoft for use with the now discontinued Microsoft Reader software. The format itself is derived from the Microsoft Compiled HTML Help format.',NULL,NULL)
,('eb974a24-c77a-4832-8c43-783cf1ce1bff','2019-10-01 18:07:46.873','2019-10-01 18:07:46.873',NULL,'a8acbc24-a696-44d7-b5af-d0f65c7697da','',NULL,NULL,NULL,NULL,1,false,true,false,'8X','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8X is a native file format of Microsoft Excel XP. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8X is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2003.',NULL,NULL)
;
INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('8be540ae-5590-4688-913a-d71fa4ce6b81','2019-10-01 18:07:47.259','2019-10-01 18:07:47.259',NULL,'f99ab366-d140-405d-b06a-78e1c7feaf23','',NULL,NULL,NULL,NULL,1,false,true,false,'3','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 3 is the native file format of Microsoft Excel 3.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 3 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL)
,('98fb3898-cb22-45d9-b112-f5cdc30fd51e','2019-10-01 18:07:47.720','2019-10-01 18:07:47.720',NULL,'c109163e-f211-4c49-b613-00dc82194f66','',NULL,NULL,NULL,NULL,1,false,true,false,'4W','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4W is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4W file comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, one or more embedded Worksheet streams (in BIFF 4S format), and terminated by an End of File (EOF) record.',NULL,NULL)
,('ab12faa9-2baa-491d-9653-15d5cabb5991','2019-10-01 18:07:48.129','2019-10-01 18:07:48.129',NULL,'b33dd39d-5669-48ec-b375-87cfd14b453b','',NULL,NULL,NULL,NULL,1,false,true,false,'4S','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4S is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4S file comprises a single Worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL)
,('70601ef8-f6f9-4cbc-9dec-4ac9cdffcb99','2019-10-01 18:07:48.720','2019-10-01 18:07:48.720',NULL,'e99f061f-2136-4ea7-9a35-f5617726e4c7','',NULL,NULL,NULL,NULL,1,false,true,false,'5/95','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 5 is a native file format of Microsoft Excel 5.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. From Excel 5.0 onwards, BIFF is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL)
,('af8e1d8a-b099-40e3-a4a0-15175c8339d5','2019-10-01 18:07:49.427','2019-10-01 18:07:49.427',NULL,'63e38c13-2497-4070-8656-bcac29f5fee9','',NULL,NULL,NULL,NULL,1,false,true,false,'8','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8 is a native file format of Microsoft Excel 97. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8 is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2000.',NULL,NULL)
,('51cb2588-132b-45a0-bd97-dd0db8705c2a','2019-10-01 18:07:49.858','2019-10-01 18:07:49.858',NULL,'c8fe529c-6d53-41aa-ac07-caf9a9d33024','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('91dbf0b1-1a31-4dd8-bc9f-b125aaa40d23','2019-10-01 18:07:50.302','2019-10-01 18:07:50.302',NULL,'323fd1ea-65df-4eae-8ee4-89ded96cef2d','',NULL,NULL,NULL,NULL,1,false,true,false,'','Microsoft Excel has a built-in AutoRecover feature that has replaced the AutoSave add-in that exists in versions of Excel that are earlier than Microsoft Excel 2002. The AutoRecover feature saves copies of all open Excel files at a user-definable fixed interval. The files can be recovered if Excel closes unexpectedly, for example, during a power failure.',NULL,NULL)
