,('3a2fb5ef-7e20-47d4-ace0-5ee7e9d04ce7','2019-10-01 18:08:25.555','2019-10-01 18:08:25.555',NULL,'788e4cb4-111f-43c4-ae32-8b260a0e9107','',NULL,NULL,NULL,NULL,1,false,true,false,'2.00','A Program Database File stores debugging information about a compiled executable, usually created at compile-time. It stores a list of all symbols in a module with their addresses and possibly the name of the file and the line on which the symbol was declared.',NULL,NULL)
