('d4c281a5-72fc-489e-9701-d4653f4d47db','2019-10-01 18:08:09.291','2019-10-01 18:08:09.291',NULL,'ce727d3e-c7fd-466e-89ce-2f8c97b3a243','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('5ff78e25-69e2-4c6c-ad39-cea6831c936a','2019-10-01 18:08:09.774','2019-10-01 18:08:09.774',NULL,'70ee6e11-62f1-4687-9e07-e01bca9c7f0c','',NULL,NULL,NULL,NULL,1,false,true,false,'2007 Onwards','A Microsoft Office - Word, Excel, or PowerPoint document, that has been encrypted.

The encrypted document conforms to the MS-OFFCRYPTO specification, as found here:
http://msdn.microsoft.com/en-us/library/cc313071(v=office.12).aspx

The document is an OLE2 compound that contains a number of files:

EncryptionInfo - This file contains information used by the Office-compatible application to decrypt the encrypted package. There are multiple variants of this file, as described in 2.3.4.5, and 2.3.4.6 of the format specification.

EncryptedPackage - This file contains the whole of the encrypted document.

DataSpaces folder (and sub-files) - This structure associates protected content with data space definitions. The data space definition, in turn, describes the series of transforms that must be applied to that protected content to restore it to its original form.

Since the method of identifying and distinguishing specific types of OOXML documents relies on seeking and analysing specific elements within the document, and in the case of encryption this information is obfuscated, it does not currently seem possible to determine with any specificity whether an encrypted file is either an Excel, Word, or PowerPoint document, apart from the file extension.',NULL,NULL)
,('c229e627-9d44-4fde-8ef6-435699035175','2019-10-01 18:08:10.145','2019-10-01 18:08:10.145',NULL,'47d1f77a-a9e7-4bde-9aa7-96f36d39cdbc','',NULL,NULL,NULL,NULL,1,false,true,false,'2007 onwards','Microsoft developed office Open XML (OOXML) in 2007. It is an XML based format representing a departure from previous Microsoft Office suites, which were binary file based. Starting with Microsoft Office 2007, the Office Open XML file formats have become the default file format of Microsoft Office. The ISO standard for OOXML is ISO/IEC DIS 29500. An OOXML file format consists of a compressed zip archive that is designated according to which file type it is. OOXML uses three custom XML based languages to describe its’ three document types. WordProcessingML, SpreadsheetML and PresentationML are each used to describe Word, Excel and PowerPoint Presentation files respectively. OOXML is not an open format but the specification and development rights have been released under Microsoft’s Covenant not to Sue. OOXML is platform independent.',NULL,NULL)
,('41940864-2cc5-4395-9839-9509a4a959df','2019-10-01 18:08:10.644','2019-10-01 18:08:10.644',NULL,'51882b48-355a-4857-ad72-aa6f375144a9','',NULL,NULL,NULL,NULL,1,false,true,false,'','When a previously saved Word document is opened for editing, for printing, or for review, Word creates a temporary file that has a .doc file name extension. This file name extension begins with a tilde (~) that is followed by a dollar sign ($) that is followed by the remainder of the original file name. This temporary file holds the logon name of person who opens the file. This temporary file is called the "owner file."',NULL,NULL)
,('654d353e-32bf-4608-8ca8-7705ad95a928','2019-10-01 18:08:10.991','2019-10-01 18:08:10.991',NULL,'45b69de6-a8ef-406b-b612-34af472c5d93','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('3849ce13-80bb-4488-b471-531df499fa2c','2019-10-01 18:08:11.452','2019-10-01 18:08:11.452',NULL,'b3fe31e8-7434-4334-bd6c-218ae08ec934','',NULL,NULL,NULL,NULL,1,false,true,false,'','Microsoft OneNote is a computer program for information gathering and multi-user collaboration. The OneNote File Format is a persistence format for storing digital notes as hierarchical sets of sections and pages. Pages can contain text, images, tables, note tags and other types of user-defined content.',NULL,NULL)
,('139a1840-1f5a-49b6-b0db-a8ec15a5dd66','2019-10-01 18:08:11.841','2019-10-01 18:08:11.841',NULL,'d2a8cec7-f733-477a-a2e1-4b73aec0a5f7','',NULL,NULL,NULL,NULL,1,false,true,false,'','Microsoft OneNote is a computer program for information gathering and multi-user collaboration. OneNote package files are compressed container formats which allow users to share OneNote files across computers. The OneNote File Format is a persistence format for storing digital notes as hierarchical sets of sections and pages. Pages can contain text, images, tables, note tags and other types of user-defined content.',NULL,NULL)
