,('d74c425c-b753-41cd-be80-a33b2e3fb8c7','2019-10-01 18:08:22.890','2019-10-01 18:08:22.890',NULL,'2164890b-5428-41b1-ac77-2153b1546505','',NULL,NULL,NULL,NULL,1,false,true,false,'95','Powerpoint format is a presentation format developed by Microsoft. Powerpoint 95 format is the native format of Powerpoint 95. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. Powerpoint 95 is based on Microsoft’s generic OLE2 Compound Document Format. A Powerpoint presentation is stored as a ‘PowerPoint Document’ stream within a Compound Document Format file.',NULL,NULL)
,('91d81cd1-74ce-4c2c-9ee4-251702d0a3b4','2019-10-01 18:08:23.305','2019-10-01 18:08:23.305',NULL,'f0f46c00-62f4-4423-9ded-697eaf299640','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','Powerpoint format is a presentation format developed by Microsoft. Powerpoint 97-2002 format is the native format of Powerpoint 97 onwards. The format is proprietary and Microsoft does not make details of its structure public. Currently PRONOM cannot differentiate Microsoft Powerpoint Presentation 97-2003 and Microsoft Powerpoint Show by signatures. This means Microsoft Powerpoint Show files with extensions of pps will likely identify as the Microsoft Powerpoint Presentation 97-2003 PUID. Further research may be able to address this.',NULL,NULL)
