('bcdac034-3554-408c-b6b2-7797b056ec72','2019-10-01 18:08:45.157','2019-10-01 18:08:45.157',NULL,'63bc7718-fecc-4c06-9b69-23241ec96fee','',NULL,NULL,NULL,NULL,1,false,true,false,'','Windows Movie Maker is video editing software by Microsoft. A .mswmm file won''t typically contain any source audio or video data, rather it will contain references or pointers to the source data. For this reason extracting a .mswmm file from its context may result in the movie being unable to play. A movie exported to a video format from within the application will contain the appropriate data for portable playback.',NULL,NULL)
,('d7695656-b1be-403b-9116-dd7cef1e6752','2019-10-01 18:08:45.575','2019-10-01 18:08:45.575',NULL,'41ef004e-819a-454a-b5b7-77c85ccda466','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('0bd1015e-ed86-4b02-b057-2d5db4cf0025','2019-10-01 18:08:46.025','2019-10-01 18:08:46.025',NULL,'87e7c395-9da4-452a-a408-4479d73f18b8','',NULL,NULL,NULL,NULL,1,false,true,false,'6.0-2003','This format is identifiable via a container signature in DROID 6 and later. Some Word documents from this era lack an internal [CompObj] stream, which is used by fmt/39 and fmt/40 to distinguish between Word files generated in Microsoft Office 6.0/95, and 97-2003. Since compatible files created by certain software lack this stream (potentially including, but not necessarily limited to Apple Pages), this additional identifying record is required to avoid the limiting identification of OLE2.',NULL,NULL)
,('cf365752-2768-42c7-b63b-0089b61c9903','2019-10-01 18:08:46.469','2019-10-01 18:08:46.469',NULL,'f320cfd4-761e-4243-8cc1-bccb1cafd5d2','',NULL,NULL,NULL,NULL,1,false,true,false,'6.0/95','With the release of Word 6.0, Microsoft introduced a new native binary word processing format, based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the release of Word 95.',NULL,NULL)
,('cd72e5f6-887d-4e1f-8d1f-5d8aa85a916c','2019-10-01 18:08:46.865','2019-10-01 18:08:46.865',NULL,'12e9b4f8-04d3-4502-a82d-f98a39f71383','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.',NULL,NULL)
,('673ca4d6-c481-4f34-99d6-1ce083697a57','2019-10-01 18:08:54.000','2019-10-01 18:08:54.000',NULL,'f03715d9-12d9-48ea-82cc-9342079c2a71','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','Word Document format is a word processing format developed by Microsoft. Word 2.0 format is the native file format of Microsoft Word 2.0 for Windows. It is proprietary and Microsoft does not make details of its structure public. A Word document file comprises a header section followed by a text section, which contains the document text in ANSI characters, followed by a format section, which contains formatting information about the text.',NULL,NULL)
,('0d203925-50c1-4fd8-8adb-239d0c7086ba','2019-10-01 18:08:47.267','2019-10-01 18:08:47.267',NULL,'64f30b52-2809-472b-aeb8-8dd84dd6b078','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.

Within the ''WordDocument'' stream, the byte at position 0x0B deals with encryption/obfuscation, as per the MS FibBase description page - https://msdn.microsoft.com/en-us/library/dd944620(v=office.12).aspx. The first bit (Least Significant Bit (LSB) ordering) specifies whether the file is encrypted, meaning that if the byte at 0x0B is an ''odd'' byte (e.g. 01, 03, 05, 07, 09, 0B, 0D, 0F, 11, 13 etc.) then this indicates obfuscation/encryption is present.',NULL,NULL)
,('6d3dd0e4-043b-4f4c-bfd3-8cb0d4e7e232','2019-10-01 18:08:47.675','2019-10-01 18:08:47.675',NULL,'d812b137-e509-4295-aec6-00f9be3b9f59','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('2fdf78e8-09ad-4c30-b237-9cb7aca56322','2019-10-01 18:08:48.116','2019-10-01 18:08:48.116',NULL,'a2a38e28-4aa4-4d4b-8969-9d55e6710f21','',NULL,NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003.

Within the ''WordDocument'' stream, the byte at position 0x0B deals with encryption/obfuscation, as per the MS FibBase description page - https://msdn.microsoft.com/en-us/library/dd944620(v=office.12).aspx. The first bit (Least Significant Bit (LSB) ordering) specifies whether the file is encrypted, meaning that if the byte at 0x0B is an ''odd'' byte (e.g. 01, 03, 05, 07, 09, 0B, 0D, 0F, 11, 13 etc.) then this indicates obfuscation/encryption is present.',NULL,NULL)
,('81d59637-b4de-4c26-9813-67219619a61e','2019-10-01 18:08:48.494','2019-10-01 18:08:48.494',NULL,'1a21b315-65ea-4a67-ad95-6e1ce167b627','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Microsoft Word for Macintosh Document is a Graphical User Interface word processor designed to be used Mac operating systems.','1985-01-01 00:00:00.000',NULL)
;
