,('84b39c27-83c6-4461-a748-ae416483c37b','2019-10-01 18:08:52.563','2019-10-01 18:08:52.563',NULL,'36b56362-17e5-4915-9e63-02f281790fc9','',NULL,NULL,NULL,NULL,1,false,true,false,'5.5','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('e5cd7e8a-c720-46c5-8e8e-ae8156081f9c','2019-10-01 18:08:53.116','2019-10-01 18:08:53.116',NULL,'8aa5b635-2e2a-4afe-beb5-601f38603b18','',NULL,NULL,NULL,NULL,1,false,true,false,'2007 onwards','From Microsoft Office 2007 onwards, the core output format of MS Word has been based on the Office Open XML (OOXML) file format. The ISO standard for OOXML is ISO/IEC DIS 29500. An OOXML file format consists of a compressed zip archive that is designated according to which file type it is. Further detail on OOXML can be found within fmt/189 - Microsoft Office Open XML. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.',NULL,NULL)
;
