,('1414e690-90fe-4a37-b49f-5591e57e5e59','2019-10-01 18:09:26.823','2019-10-01 18:09:26.823',NULL,'1f006183-74dd-4608-a677-a82248d43a1e','',NULL,NULL,NULL,NULL,1,false,true,false,'','XMF is a family of specifications created and administered by the MIDI Manufacturer''s Association. An XMF file contains one or more existing files such as Standard MIDI Files, Downloadable Sound (DLS) instrument files, WAV files, or other digital audio files to create a collection of all the resources needed to present a musical piece. Mobile XMF was developed specifically for mobile phones, and supports SP-MIDI format SMF files as well as Mobile DLS content.',NULL,NULL)
