,('0dec2777-10db-47b6-b531-d2183998f72e','2019-10-01 18:09:30.348','2019-10-01 18:09:30.348',NULL,'9615f5b4-731f-4972-b94a-852d6a8ccffa','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('891f9bb2-cade-4787-aa99-992a6ade1ecd','2019-10-01 18:09:30.765','2019-10-01 18:09:30.765',NULL,'987f43c2-98c2-450a-aaad-f4c8a4ab5af1','',NULL,NULL,NULL,NULL,1,false,true,false,'','MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 ‘Elementary’ stream (ES) file (*.m1v) contains either a single video or audio stream (e.g. *.mp3). ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or ‘muxed’) with a video stream to produce an output file containing both audio and video for synchronised playback.',NULL,NULL)
,('ac2c3073-1d93-4b7a-8189-a98bdd9d1667','2019-10-01 18:09:31.163','2019-10-01 18:09:31.163',NULL,'15899135-3a69-450e-8929-971e21a92017','',NULL,NULL,NULL,NULL,1,false,true,false,'','MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 ‘Program’ stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).',NULL,NULL)
,('2c85e1be-2b8a-47bd-868d-dba545e85d0b','2019-10-01 18:09:31.585','2019-10-01 18:09:31.585',NULL,'b6c9266a-5dc6-448a-8082-b5911d847f82','',NULL,NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG2 ‘Elementary’ stream (ES) file (*.m2v) contains either a single video or audio stream. ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or ‘muxed’) with a video stream to produce an output file containing both audio and video for synchronised playback.',NULL,NULL)
,('66bbc4e9-4cf6-415c-91a2-8a54db812efc','2019-10-01 18:09:32.031','2019-10-01 18:09:32.031',NULL,'46f5e424-145e-440f-b1f5-e2bf4da76405','',NULL,NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG-2 ‘Program’ stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).

Some camcorders store their MPEG-2 Program Stream video data as files with the .mod extension, usually alongside other files containing metadata and management information for the video.',NULL,NULL)
;
