('64875808-f6c3-4566-a5a1-975a29c99b19','2019-10-01 18:09:32.574','2019-10-01 18:09:32.574',NULL,'0670f033-9849-4a61-b9f7-0da2effcb797','',NULL,NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPEG-2 ''Transport'' stream file (TS) file (*.ts, *.m2ts) is designed for low-latency, real-time transmission and is used in broadcasting. It can contain multiple programmes, not necessarily intended for synchronised playback. TS incorporates features that can allow flexible access to and playback of stream content.',NULL,NULL)
,('68158e93-e4db-4e37-b634-0644608d1985','2019-10-01 18:09:33.004','2019-10-01 18:09:33.004',NULL,'d06af326-cc6d-4db0-b8e6-2abe7c21b386','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('77b68b17-7a41-4587-917f-9bdc21433d29','2019-10-01 18:09:33.445','2019-10-01 18:09:33.445',NULL,'44d9f605-ae64-4171-bc6a-7ece1d297d7c','',NULL,NULL,NULL,NULL,1,false,true,false,'','MrSID is an acronym that stands for Multiresolution Seamless Image Database. It is a wavelet-based file format developed and patented by LizardTech designed to enable portability of massive bit-mapped (raster) images, such as orthophotos. MrSID was originally developed for Geographic Information Systems (GIS). With this format, large raster image files such as aerial photographs or satellite imagery are compressed and can be quickly viewed without having to decompress the entire file. There is no open source implementation of the MrSID format. Some open source GIS systems can read MrSID files, including MapWindow GIS and those based on GDAL. The Decode Software Development Kit (SDK) is made available as a free download from developer.lizardtech.com. This enables the capability to implement MrSID reading capability in any application.',NULL,NULL)
