,('ad04c507-cd28-4243-953b-ac0398a4920e','2019-10-01 18:09:37.428','2019-10-01 18:09:37.428',NULL,'111c1dc4-a6bd-4589-a5bd-e516999fc028','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Music Encoding Initiative (MEI) is an open-source effort to define a system for encoding musical documents in a machine-readable structure. MEI is formalised in the MEI schema, a core set of rules for recording physical and intellectual characteristics of music notation documents expressed as an eXtensible Markup Language (XML) schema.

