,('3c5cbb4c-fdb0-4247-aadf-7d1334211ed4','2019-10-01 18:09:38.364','2019-10-01 18:09:38.364',NULL,'ec52e6c8-fad9-4114-a632-673f02081ede','',NULL,NULL,NULL,NULL,1,false,true,false,'','MyISAM was the default storage engine for the MySQL relational database management system versions prior to 5.5. The MYI file stores the table''s indexes for a MyISAM table.',NULL,NULL)
,('c7d5a3d4-aa44-4cba-8f39-e2a4e45d5025','2019-10-01 18:09:38.758','2019-10-01 18:09:38.758',NULL,'f3448222-5ee3-40a5-9cef-f607e5bc6218','',NULL,NULL,NULL,NULL,1,false,true,false,'','Every MySQL table is represented on disk by a .frm file that describes the table''s format (that is, the table definition). The file bears the same name as the table, with an .frm extension.',NULL,NULL)
