('46077271-960d-4bb6-ace9-613ef07cd834','2019-10-01 18:09:46.829','2019-10-01 18:09:46.829',NULL,'9a81cfbb-cc64-4433-a98a-91b0241b11f3','',NULL,NULL,NULL,NULL,1,false,true,false,'','The NIB file format is used by Interface Builder, a software development application for Apple''s Mac OS X operating system. The NIB objects are stored as an XML property list, they are unpackaged upon running an application.',NULL,NULL)
,('8d4bfdd7-e1ea-4d5d-a3f0-eb24615d5505','2019-10-01 18:09:47.267','2019-10-01 18:09:47.267',NULL,'7eab4ea7-27dd-443e-9569-ea4aae7249e5','',NULL,NULL,NULL,NULL,1,false,true,false,'','Nikon Digital SLR RAW Image files are produced by the Nikon DSLR family of digital cameras.',NULL,NULL)
,('715dbac8-efa2-4ccf-bb03-e7c0e2a2e7a9','2019-10-01 18:09:47.682','2019-10-01 18:09:47.682',NULL,'df1c061c-c113-42f3-ac0f-2aea4c6d3b30','',NULL,NULL,NULL,NULL,1,false,true,false,'','Niton Data Transfer is a data format used in the field of X-Ray Flourescence (XRF) analysis. It is the native format produced by Niton XRF devices.',NULL,NULL)
,('b0d6ab33-6b12-4f79-9f0c-e81c4e472357','2019-10-01 18:09:48.126','2019-10-01 18:09:48.126',NULL,'166920da-c47c-4190-a6e2-bcba8c76c784','',NULL,NULL,NULL,NULL,1,false,true,false,'','NMRPipe is a suite of tools for Nuclear Magnetic Resonance (NMR) spectral reconstruction.',NULL,NULL)
,('8a300ff8-d244-4ee0-9104-77e952f53427','2019-10-01 18:09:48.595','2019-10-01 18:09:48.595',NULL,'4bb7233c-47a1-4e1f-9ad2-f24d1020c592','',NULL,NULL,NULL,NULL,1,false,true,false,'','NMRView is a graphical Nuclear Magnetic Resonance (NMR) assignment and integration program for proteins, nucleic acids, and other polymers.',NULL,NULL)
