,('168168d8-945b-47f8-993d-46837d294085','2019-10-01 18:09:49.943','2019-10-01 18:09:49.943',NULL,'0252f71c-8815-4fc5-a081-b55a96e2d899','',NULL,NULL,NULL,NULL,1,false,true,false,'','Notation3, or N3, is a shorthand non-XML serialization of Resource Description Framework models.',NULL,NULL)
,('82092222-f307-4ee0-a3e4-67023bfd7846','2019-10-01 18:09:50.360','2019-10-01 18:09:50.360',NULL,'cc8a3e41-fcdc-4c81-9e1a-8cf7584e2f08','',NULL,NULL,NULL,NULL,1,false,true,false,'','NuFX is an archive package format originally developed for the Apple II by Andrew Nicholas. Details of the format can be found here: http://nulib.com/library/FTN.e08002.htm while a library for handling the format can be found here: http://nulib.com/',NULL,NULL)
,('6a73529f-0446-4c51-980f-c0a992af09ab','2019-10-01 18:09:50.779','2019-10-01 18:09:50.779',NULL,'f9ce76e1-603f-40a1-9259-c2b2838ecf0b','',NULL,NULL,NULL,NULL,1,false,true,false,'','NSIS (Nullsoft Scriptable Install System) is an open source system to create Windows installers. NSIS is script-based and although it has regular and well defined syntax, there are no magic numbers or header sequences. As such, there is no current means to identify a file as NSIS by binary sequence alone, so identification of this format is by extension only.',NULL,NULL)
;
