('e3b02c78-b257-4030-8ce0-7d2fc01bb9a5','2019-10-01 18:09:51.215','2019-10-01 18:09:51.215',NULL,'a00f5cc2-f7a7-41f1-9f32-270316a14bd3','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Nullsoft Streaming Video (NSV) format is a multimedia container format designed to enable streaming of video and audio.',NULL,NULL)
,('22518c99-5a9b-4245-a4be-7afb90a8a925','2019-10-01 18:09:51.702','2019-10-01 18:09:51.702',NULL,'ff45744f-1392-45e9-b889-f1e1caa3dbac','',NULL,NULL,NULL,NULL,1,false,true,false,'','NUT is a container format for the storage of audio, video, subtitles and other related user defined streams. It provides an exact timestamp for synchronization and seeking.',NULL,NULL)
,('e808e731-2636-4807-b877-4b9eb56b4a14','2019-10-01 18:09:59.892','2019-10-01 18:09:59.892',NULL,'2c0cff27-e496-472f-b566-1a4573a45f0f','',NULL,NULL,NULL,NULL,1,false,true,false,'1.03','Open Financial Exchange is a unified specification for the electronic exchange of financial data between financial institutions, businesses and consumers via the Internet. The first verison was released in 1997, and was a result of colloborative work between CheckFree Corp., Intuit Inc., and Microsoft.','2006-05-01 00:00:00.000',NULL)
,('db7e2959-2944-4daa-8019-0ccdd6b3f58e','2019-10-01 18:09:52.098','2019-10-01 18:09:52.098',NULL,'c070b7cc-e9b2-4d16-856d-10b28cb3ef5c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('1efb3d42-4543-4bc9-b4ee-5b4ef51932f4','2019-10-01 18:09:52.561','2019-10-01 18:09:52.561',NULL,'5e8aaa1d-c6b5-4787-8871-4815f7d32aa6','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. FLAC (Free Lossless Audio Codec) handles archival and high fidelity audio data.',NULL,NULL)
,('aa198dfe-2da7-4b97-8e25-18440b2b24ce','2019-10-01 18:09:52.989','2019-10-01 18:09:52.989',NULL,'70bba028-1dcb-4036-9e89-d9061098f00c','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.

In the Ogg multimedia framework, Theora provides a lossy video layer. The audio layer is commonly provided by the music-oriented Vorbis format. Other audio coding format options include the Opus compression format, the lossless audio compression format FLAC, Speex for low bitrate voice data, and OggPCM for uncompressed PCM audio.

This generic entry applies where available PRONOM signatures for Ogg do not yet apply to the file in question. In this instance you may wish to contact pronom@nationalarchives.gov.uk to help improve PRONOM''s signatures.',NULL,NULL)
,('895bafe5-dc95-4405-903e-fa12cd1756cd','2019-10-01 18:09:53.451','2019-10-01 18:09:53.451',NULL,'b5cf55ac-6ab5-48ed-9617-b9850ffa5065','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation, while Opus is a lossy audio coding format developed by Xiph and intended to replace the Vorbis codec.',NULL,NULL)
,('d683bd66-7333-4d77-bdbd-f2033ba8b25a','2019-10-01 18:09:53.900','2019-10-01 18:09:53.900',NULL,'df1825b2-0fb5-4617-b797-d76d196a81c3','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. The Speex codec is a lossy codec aimed at handling low bitrate audio, particularly speech.',NULL,NULL)
,('de15e509-c8e5-47ee-9ace-dc7f1cf68f0d','2019-10-01 18:09:54.309','2019-10-01 18:09:54.309',NULL,'39132e26-f87a-4767-ad4c-19deaa360265','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.

Theora is a free, lossy video compression format also developed by the Xiph.Org Foundation.',NULL,NULL)
,('5054ba3e-4cc1-46a7-b1b3-9f29ac715096','2019-10-01 18:09:54.730','2019-10-01 18:09:54.730',NULL,'18b39d55-62db-4fe1-b052-d58df507b48b','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. Vorbis is a free and open-source software project headed by the Xiph.Org Foundation and produces an audio coding format and software reference encoder/decoder (codec) for lossy audio compression.',NULL,NULL)
;
