('c9c9159e-5b3a-4f9c-b10e-609a63d0e542','2019-10-01 18:09:55.208','2019-10-01 18:09:55.208',NULL,'31d90121-2c74-4f13-aa36-66dbe52197eb','',NULL,NULL,NULL,NULL,1,false,true,false,'','The GFS file is used by the OGR Geography Markup Language reader to predefine dataset level information in the absense of an XML Schema definition for the feature classes within the GML file. Its purpose and syntax is described here: http://www.gdal.org/drv_gml.html',NULL,NULL)
,('51e255fc-9e3d-48ef-bd27-1bed34741fa2','2019-10-01 18:09:55.693','2019-10-01 18:09:55.693',NULL,'05d84be1-d92d-4a91-9ded-ecd477a75783','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogre Mesh is a binary format for representing 3D models for use within the Ogre 3D rendering engine. PRONOM currently does not distinguish between minor versions of the format. Please contact the PRONOM team if this is desirable.',NULL,NULL)
,('73db82b9-72ec-4fd5-ad0b-64f6cab786ac','2019-10-01 18:09:56.124','2019-10-01 18:09:56.124',NULL,'08e112d0-b2e1-4ae1-b094-644926409179','',NULL,NULL,NULL,NULL,1,false,true,false,'','Ogre Mesh XML is an XML-based format for representing 3D models for use within the Ogre 3D rendering engine.',NULL,NULL)
,('bc6375d0-5701-426b-88b5-76bcd6ced950','2019-10-01 18:09:56.530','2019-10-01 18:09:56.530',NULL,'e0b5a566-6f22-42c7-a6bc-e9fc6815e1fb','',NULL,NULL,NULL,NULL,1,false,true,false,'','Oktalyzer is an audio sequencer developed by Armin Sander for the Amiga in 1989. Note, this is an Amiga filetype, where the ''extension'' is a prefix rather than suffix, hence most Oktalyzer files will follow the okt.filename convention.',NULL,NULL)
,('643708b9-c0b5-40bb-a3d1-84e57464df2e','2019-10-01 18:09:57.106','2019-10-01 18:09:57.106',NULL,'aa5376e3-854b-41b2-8bf0-131425dc1d24','',NULL,NULL,NULL,NULL,1,false,true,false,'','The OLE2 Compound Document Format is a generic document format developed by Microsoft as the underlying native binary format for many of its Office applications. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Compound Document acts as a file system in which independent data streams are organised within a hierarchy of containers, called storages. All storages and streams are contained within a parent Root Storage. A Directory Stream indexes every stream and storage in the file. A Compound Document begins with the Compound Document Header, including pointers to the location of the Directory Stream and Master Sector Allocation Table. The remainder of the file is organised into Sectors, the positions of which are defined in the Sector Allocation Table and Master Sector Allocation Table.',NULL,NULL)
,('f2ed63eb-ca76-41c2-a9d1-b94ad32577fc','2019-10-01 18:09:57.552','2019-10-01 18:09:57.552',NULL,'c0bd5013-2eeb-4763-8849-d56f02d706aa','',NULL,NULL,NULL,NULL,1,false,true,false,'','Olympus raw format (.orf) is a raw image format used by models of Olympus digital cameras.',NULL,NULL)
,('c78a4827-c8b7-4329-b55d-3f3a80635079','2019-10-01 18:09:58.010','2019-10-01 18:09:58.010',NULL,'d8e72a72-3b3c-4758-8435-033b9ad01e4f','',NULL,NULL,NULL,NULL,1,false,true,false,'','OMNIC Spectral Data files are spectroscopy data files produced by Thermo Scientific OMNIC software.',NULL,NULL)
,('793b0c7e-8a77-4095-b339-7f1a319225a8','2019-10-01 18:09:58.420','2019-10-01 18:09:58.420',NULL,'6cf73697-2c67-472e-bb3d-06623d9f0dce','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('a7d1d7c6-abcb-4bae-a3ac-c596b0cc19e5','2019-10-01 18:09:58.960','2019-10-01 18:09:58.960',NULL,'d7b95e86-3f33-4c16-8fe2-0aeb2e75e39c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('83880e1a-1077-4a69-8125-697de6395643','2019-10-01 18:09:59.446','2019-10-01 18:09:59.446',NULL,'b2d43115-843b-45c5-a2ae-fa2d95218c92','',NULL,NULL,NULL,NULL,1,false,true,false,'1.02','Open Financial Exchange is a unified specification for the electronic exchange of financial data between financial institutions, businesses and consumers via the Internet. The first verison was released in 1997, and was a result of colloborative work between CheckFree Corp., Intuit Inc., and Microsoft. Version 1.02 is a SGML version of the format.','1997-05-30 00:00:00.000',NULL)
