,('60976440-a81d-4805-9239-688e7dfdd88f','2019-10-01 18:10:01.284','2019-10-01 18:10:01.284',NULL,'a8ac559e-1d07-4798-bf62-62d86710bc55','',NULL,NULL,NULL,NULL,1,false,true,false,'2.1.1','Open Financial Exchange is a unified specification for the electronic exchange of financial data between financial institutions, businesses and consumers via the Internet. The first verison was released in 1997, and was a result of colloborative work between CheckFree Corp., Intuit Inc., and Microsoft. Version 2.1.1 is a XML version of the format.','2006-05-01 00:00:00.000',NULL)
