,('ff8c71f8-84d7-4a63-8209-b7a188bb0c7c','2019-10-01 18:10:02.924','2019-10-01 18:10:02.924',NULL,'5b8bb4c1-86c3-4324-9de2-fb81b500780c','',NULL,NULL,NULL,NULL,1,false,true,false,'','The .pod format was originally used by the OpenProj project management suite. Development on OpenProj has discontinued and has been superceded by ProjectLibre.',NULL,NULL)
,('79d5d93f-cb4d-4869-964d-57ca9cc3e619','2019-10-01 18:10:03.339','2019-10-01 18:10:03.339',NULL,'3ddedd41-7f3c-4681-b9fb-e38dc87cf753','',NULL,NULL,NULL,NULL,1,false,true,false,'','Open XML Paper Specification (also referred to as OpenXPS) is an open specification for a page description
