,('93396b47-21b2-487d-a144-94d5ce82614f','2019-10-01 18:10:03.790','2019-10-01 18:10:03.790',NULL,'aad07d17-41c7-4476-b077-41e30638a554','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','OpenDocument (ODF) format is a generic format for office documents, such as text, spreadsheets, presentations, drawings, and databases. It was developed by OASIS, based on the original OpenOffice document format. The format is an open standard, and is supported by a variety of office software packages. ODF is an XML format, which may comprise a single XML document, or a collection of subdocuments within a package. The package format is the commonly used form, and comprises a standard ZIP package containing the XML content and any associated binary data, together with a manifest which lists the package content. An ODF database document contains a relational database. The content is contained in a ''content'' xml subdocument. Additional subdocuments contain style information, document metadata, and application-specific settings.','2005-05-01 00:00:00.000',NULL)
