,('c05dd07a-7a1c-4515-bb34-690afa323845','2019-10-01 18:10:10.864','2019-10-01 18:10:10.864',NULL,'7f0e22b9-be8e-4c7b-8a5f-b9132bea1e1e','',NULL,NULL,NULL,NULL,1,false,true,false,'2','OpenEXR is a raster image file format developed by Industrial Light and Magic for use in computer imaging applications. The published specification for OpenEXR describes version 2 of the file format. Version 1 was used internally by Industrial Light and Magic before OpenEXR was released as open source.',NULL,NULL)
,('4e026410-9e34-4b91-a2a2-0dc57941d78b','2019-10-01 18:10:11.243','2019-10-01 18:10:11.243',NULL,'25210b16-70c2-42af-9a68-f3fb5fd003ac','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','All OpenOffice v1.0 documents (Calc, Draw, Impress, Writer) use the extensible Markup Language (XML) for representing the elements and attributes of each structural component of the document. As XML has no native support for binary objects, OpenOffice.org files use a standard Zip file to store the XML content together with its associated binary data. Information about the files contained in the Zip file is stored in an XML file called the manifest file. The manifest file is always stored at the pathname META-INF/manifest.xml. The manifest file contains a list of all the files in the Zip file, the media type of each file, and the information necessary to decrypt any encrypted files included in the Zip file.',NULL,NULL)
