('11f6ebbb-2688-4159-9f3a-27c4082f994d','2019-10-01 18:10:13.970','2019-10-01 18:10:13.970',NULL,'60a6fc3a-1476-449e-ac6c-83ff004300b9','',NULL,NULL,NULL,NULL,1,false,true,false,'','Dalvik is the process virtual machine in Google''s Android operating system, which executes applications written for Android. Programs are commonly written in Java and compiled to bytecode for the Java virtual machine, which is then translated to Dalvik bytecode and stored in .dex (Dalvik EXecutable) and .odex (Optimized Dalvik EXecutable) files.',NULL,NULL)
,('22a3eb7b-adbe-45d4-a4b8-acb4bed72015','2019-10-01 18:10:14.437','2019-10-01 18:10:14.437',NULL,'b18d20cc-5ea3-4e8a-9373-dc29f571d916','',NULL,NULL,NULL,NULL,1,false,true,false,'Non-Unicode','Origin is an advanced plotting, graphing and data-analysis application by OriginLab. An .opj file is a full Origin project file in the OPJ format. An .ogg file contains only a graph. An ogw file contains only a workbook. An ogm file contains only a matrixbook Please contact the PRONOM team if you can provide a more detailed description of this format.',NULL,NULL)
,('6b5536b4-177a-4861-a558-4f3901ce5621','2019-10-01 18:10:14.868','2019-10-01 18:10:14.868',NULL,'e656c2fa-778f-4b12-9340-1717005e3a8a','',NULL,NULL,NULL,NULL,1,false,true,false,'Unicode','Origin is an advanced plotting, graphing and data-analysis application by OriginLab. An .opju file is a full Origin project file in the OPJ format. An .oggu file contains only a graph. An ogwu file contains only a workbook. An ogmu file contains only a matrixbook Please contact the PRONOM team if you can provide a more detailed description of this format.',NULL,NULL)
,('6eb687b1-da40-4757-827b-aa90ef08ab5c','2019-10-01 18:10:15.310','2019-10-01 18:10:15.310',NULL,'99f6d6b6-53e9-491f-b406-84a40f3705d2','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','PUID deprecated.                                                                                                                                         Please see fmt/115 for information on OS/2 Bitmap 1.0 and Windows Bitmap 2.0.
The only difference between Windows bitmap 2.0 and OS/2 bitmap 1.0 is the data type of the width and height fields of the bitmap header – for Windows 2.0 bitmaps they are signed short integers, for OS/2 1.0 bitmaps they are unsigned shorts. For positive numbers the representation is the same. Consequently, the file formats cannot be distinguished with a file signature test. The PUID for OS/2 Bitmap 1.0 has therefore been deprecated.',NULL,NULL)
,('4d7b8e74-56cf-4e7a-9062-dc6e3d6e840f','2019-10-01 18:10:15.741','2019-10-01 18:10:15.741',NULL,'5358f2f6-b5b9-4223-bcb0-060a37686502','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
