,('1188be39-fb68-4877-afe7-c4b3fa31f7ac','2019-10-01 18:10:17.439','2019-10-01 18:10:17.439',NULL,'38837166-9a42-4bf3-9aec-fa0a2a547f7a','',NULL,NULL,NULL,NULL,1,false,true,false,'','P00 is a Commodore 64 emulation format created for use with the PC64 emulator. The extension is normally ''Pxx'', where the xx represents a two digit number corresponding to an incremented extension (beginning with P00) where more than one otherwise identically named P00 file exists in a single directory. For example, five files each called ''file'' in a single dircetory would have the extensions p00, p01, p02, p03 and p04.',NULL,NULL)
