,('30449561-07ff-4fa4-a7ed-bbbd0e39b059','2019-10-01 18:10:21.907','2019-10-01 18:10:21.907',NULL,'e2b2877c-6895-4883-9e84-18dca3419bce','',NULL,NULL,NULL,NULL,1,false,true,false,'3.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer grouping information, a sample thumbnail, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing an image document in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24 bit colour (16.7 million colours), 8 bit colour (256 colour), 8 bit greyscale (256 greys), 4 bit colour (16 colours) and 1 bit colour (2 colours).',NULL,NULL)
,('ac1e951e-31bf-47b6-836b-f362e2fef695','2019-10-01 18:10:22.328','2019-10-01 18:10:22.328',NULL,'99631fa2-5c6e-4847-8a64-c5baaa06af9b','',NULL,NULL,NULL,NULL,1,false,true,false,'4.00','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL)
;
