('523484ca-d9b8-4731-b78b-7bd1c6380bf2','2019-10-01 18:10:22.751','2019-10-01 18:10:22.751',NULL,'f8ee0dae-742b-4104-9b9d-b426337885ba','',NULL,NULL,NULL,NULL,1,false,true,false,'5.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL)
,('6142dbae-4b3d-491a-8fb1-31ab4fdd4e98','2019-10-01 18:10:23.177','2019-10-01 18:10:23.177',NULL,'e35a3f97-6dea-4178-98ef-3ca2b9687be9','',NULL,NULL,NULL,NULL,1,false,true,false,'6.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, EXIF information, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL)
