,('126e6a59-b163-47c9-b3b8-d09eaf20e31a','2019-10-01 18:10:32.868','2019-10-01 18:10:32.868',NULL,'74a3b712-29cf-4c9c-9ec6-5df4f8f79688','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','Portable Document Format is a platform-independent format for representing formatted documents, originally developed by Adobe Systems Incorporated. PDF 2.0 is standardised by ISO 32000-2. A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section. PDF files can contain a wide variety of content, including text, images, video and audio.',NULL,NULL)
