,('ac2c0d4f-3e88-40d0-8e33-1d544731fd7a','2019-10-01 18:10:35.987','2019-10-01 18:10:35.987',NULL,'364428aa-4192-400a-9629-39f4e6d18fe7','',NULL,NULL,NULL,NULL,1,false,true,false,'','Phase One is a camera manufacturer and Capture One is the accompanying software. This format contains the raw image data captured by the camera''s image sensor. IIQ stands for Intelligent Image Quality, a compressed version of the raw image data captured by Phase One camera equipment. IIQ has a choice of a ''Large'' (lossless) or ''Small'' (lossy) options. With further research it may be possible to distinguish between these outputs.',NULL,NULL)
