,('ebaac0d1-be73-411c-8608-254f0f78e182','2019-10-01 18:10:42.535','2019-10-01 18:10:42.535',NULL,'6650b021-e606-437d-9868-1912aa2e6d8d','',NULL,NULL,NULL,NULL,1,false,true,false,'','Developed by Hewlett Packard, Polynomial texture maps (PTMs) are an extension to conventional texture maps that allow enhanced image quality. As opposed to storing a color per pixel, these PTM’s store second-order bi-quadratic polynomial coefficients per pixel. These polynomials model the changes that appear to a pixel color based on either light source position or viewing direction.',NULL,NULL)
