,('ea84fac1-af8f-4b91-a008-efd677222668','2019-10-01 18:10:46.880','2019-10-01 18:10:46.880',NULL,'a4524e0d-c9fb-4a9e-a0e1-84cd9130b6c8','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Portable Network Graphics (PNG) was designed for the lossless, portable, compressed storage of raster images.  PNG provides a patent-free replacement for GIF and can also replace many common uses of TIFF. Indexed-color, grayscale, and truecolor images are supported, plus an optional alpha channel. Sample depths range from 1 to 16 bits. PNG is designed to work in online viewing applications, so it is fully streamable.  It can store gamma and chromaticity.  PNG also detects file corruption.',NULL,NULL)
,('be26b841-b24a-4978-b1d9-57b12d88730c','2019-10-01 18:10:47.303','2019-10-01 18:10:47.303',NULL,'004afdca-25d8-40b4-a2e9-ddde8ec6379e','',NULL,NULL,NULL,NULL,1,false,true,false,'1.1','Portable Network Graphics (PNG) was designed for the lossless, portable, compressed storage of raster images.  PNG provides a patent-free replacement for GIF and can also replace many common uses of TIFF. Indexed-color, grayscale, and truecolor images are supported, plus an optional alpha channel. Sample depths range from 1 to 16 bits. PNG is designed to work in online viewing applications, so it is fully streamable.  It can store gamma and chromaticity.  PNG also detects file corruption.',NULL,NULL)
,('a4890a14-54b7-4804-9346-dec420a3b2ac','2019-10-01 18:10:56.609','2019-10-01 18:10:56.609',NULL,'a6077608-09d3-41bf-92df-eb32b1b80b05','',NULL,NULL,NULL,NULL,1,false,true,false,'','Praat is a computer software package for the scientific analysis of speech in phonetics, developed by Paul Boersma and David Weenink of the University of Amsterdam.

The Praat Picture File is a diagram produced from speech analyses within Praat. The picture file contains the whole drawing board and can be used for interchange between different systems running the Praat software.',NULL,NULL)
,('89297b8b-4815-483a-b8a4-8070b06aabf1','2019-10-01 18:10:47.878','2019-10-01 18:10:47.878',NULL,'d641b7f5-4ffd-4c87-a3d6-0c68eef6f257','',NULL,NULL,NULL,NULL,1,false,true,false,'1.2','Portable Network Graphics (PNG) was designed for the lossless, portable, compressed storage of raster images.  PNG provides a patent-free replacement for GIF and can also replace many common uses of TIFF. Indexed-color, grayscale, and truecolor images are supported, plus an optional alpha channel. Sample depths range from 1 to 16 bits. PNG is designed to work in online viewing applications, so it is fully streamable.  It can store gamma and chromaticity.  PNG also detects file corruption.',NULL,NULL)
;
