,('3dfee9a0-03cb-48ac-9191-8904a8316c6e','2019-10-01 18:11:09.081','2019-10-01 18:11:09.081',NULL,'ff3e8a88-b667-4ae2-b99a-7b9c01ab01c8','',NULL,NULL,NULL,NULL,1,false,true,false,'','Q&A was a database and word processing software program for IBM PC-compatible computers published by Symantec and partners from 1985 to 1998. Due to their age, Q&A files may lack an extension.',NULL,NULL)
,('d0dee052-633d-4d9f-b37e-ce957147ae60','2019-10-01 18:11:09.488','2019-10-01 18:11:09.488',NULL,'067c58fe-1ea2-417f-a799-08978e72b9c4','',NULL,NULL,NULL,NULL,1,false,true,false,'','QCP is a storage format for exchanging Qualcomm Code Excited Linear Prediction (QCELP 13k) encoded audio data, as well as Enhanced Variable Rate Codec (EVRC) and Selectable Mode Vocoders (SMV) data.',NULL,NULL)
,('7d9417e7-b99c-4724-a5c3-f9b84299f8f9','2019-10-01 18:11:09.877','2019-10-01 18:11:09.877',NULL,'15ceef10-6397-418b-8769-0577079d457a','',NULL,NULL,NULL,NULL,1,false,true,false,'','QSplat is a program for displaying large geometric models in real time, developed by Stanford University as part of their Digital Michaelangelo Project.',NULL,NULL)
