,('b5746cf8-ee1e-4277-ac8e-2c78d6dc263d','2019-10-01 18:11:10.675','2019-10-01 18:11:10.675',NULL,'3f4ff101-0307-45f3-8455-c0dc6943ca23','',NULL,NULL,NULL,NULL,1,false,true,false,'','QuarkXPress is destop publishing software for creating and editing page layouts that can be run on Mac and Windows operating systems. It can be used to creating a variety of layouts, from single-page flyers to multi-media projects required for magazines, newspapers and catalogues.',NULL,NULL)
,('a85593c9-2ce1-406d-babb-f77bdf83b0c8','2019-10-01 18:11:11.060','2019-10-01 18:11:11.060',NULL,'c61735ec-a499-47e2-9c35-0506825de181','',NULL,NULL,NULL,NULL,1,false,true,false,'10','QuarkXPress is desktop publishing software for creating and editing page layouts that can be run on Mac and Windows operating systems.',NULL,NULL)
,('475f63fa-a4ea-4dd4-badf-ab1efac4509f','2019-10-01 18:11:11.469','2019-10-01 18:11:11.469',NULL,'14592315-6de9-451d-adc2-b4d74bb7e7ca','',NULL,NULL,NULL,NULL,1,false,true,false,'6','QuarkXPress is destop publishing software for creating and editing page layouts that can be run on Mac and Windows operating systems. Version 6 can be opened in subsequent QuarkXpress versions up to Version 9.',NULL,NULL)
,('b3ed5503-81cf-4467-8b0e-7764cf950717','2019-10-01 18:11:11.960','2019-10-01 18:11:11.960',NULL,'2bc409fa-bf3b-41d6-a6fb-fc53b1584356','',NULL,NULL,NULL,NULL,1,false,true,false,'9','QuarkXPress is desktop publishing software for creating and editing page layouts that can be run on Mac and Windows operating systems.',NULL,NULL)
