,('3da4b876-2773-42af-a085-620ecae8db5f','2019-10-01 18:11:18.109','2019-10-01 18:11:18.109',NULL,'06945a84-f63b-40cf-ab39-6199d352662b','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Quicken Interchange Format (QIF) is a specially formatted ASCII file used in financial transactions. This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('89268228-c614-4446-b005-1a4468528552','2019-10-01 18:11:18.534','2019-10-01 18:11:18.534',NULL,'e0429023-52b8-47b0-b26d-9ac175da8ac7','',NULL,NULL,NULL,NULL,1,false,true,false,'','The QuickTime file format is a format for storing multimedia content, principally video, developed by Apple. The basic data unit in a QuickTime file is the atom. Each atom contains size and type information along with its data. The size field indicates the number of bytes in the atom, including the size and type fields. The type field specifies the type of data stored in the atom and, by implication, the format of that data. Atoms are hierarchical in nature. That is, one atom can contain one or more other atoms of varying types. For example, a movie atom contains one track atom for each track in the movie. The track atoms, in turn, contain one or more media atoms each, along with other atoms that define other track and movie characteristics. This hierarchical structure of atoms is referred to as a containment hierarchy. A QuickTime file is simply a collection of atoms. QuickTime does not impose any rules about the order of these atoms.',NULL,NULL)
,('915b1a39-bfd4-4f9e-860a-045b65428baf','2019-10-01 18:11:18.929','2019-10-01 18:11:18.929',NULL,'ec7ab261-3eba-4899-a3c4-87640e70be16','',NULL,NULL,NULL,NULL,1,false,true,false,'','Radiance defined an image format for storing HDR images, now described as RGBE image format. RGBE stores pixels as one byte each for RGB (red, green, and blue) values with a one byte shared exponent. Thus it stores four bytes per pixel.',NULL,NULL)
