,('e7f7980c-0e87-4e29-9f2b-332d229f0055','2019-10-01 18:11:26.760','2019-10-01 18:11:26.760',NULL,'12e6f6e1-bb5d-4c10-ba7a-381f2d1c137e','',NULL,NULL,NULL,NULL,1,false,true,false,'1','REDCODE RAW (R3D) is a proprietary multimedia audio/video file format owned by the Red Digital Cinema Camera Company and featuring lossy compression for video contents and lossless for audio contents. It is used as native recording format of Red digital cameras and recorded on proprietary Hard Disk Drives, CompactFlash cards or SSD drives, but can be extracted from there and be trivially handled in any file-based audio/video, IT or home environments.',NULL,NULL)
