,('20dc33e9-3913-4d8f-a869-a3a04c6c7a02','2019-10-01 18:11:27.707','2019-10-01 18:11:27.707',NULL,'8c3e1895-eb19-4f08-9a58-b9d8a1a5eea8','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Document Content Architecture, (DCA for short) is a standard developed by IBM for text documents in the early 1980s. DCA was used on mainframe and iSeries systems, and formed the basis of DisplayWrite''s file format. DCA was later extended as MO:DCA (Mixed Object Document Content Architecture), which added embedded data files, like graphics.',NULL,NULL)
