('c45d4544-dfa4-487f-9532-f70178f1d3be','2019-10-01 18:11:29.675','2019-10-01 18:11:29.675',NULL,'89ed1b36-70a3-4584-9257-4542835bd67c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('c9c9b6d6-3418-4e7a-b0f9-b162ba56c8de','2019-10-01 18:11:30.069','2019-10-01 18:11:30.069',NULL,'cb85cf18-4d02-4cd7-9243-2b3f5b0b8fa2','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('c8eb7f1d-ad6d-4d91-8af9-621ec7867a4d','2019-10-01 18:11:30.475','2019-10-01 18:11:30.475',NULL,'4fb32efb-944b-4417-90aa-72a4d483fde7','',NULL,NULL,NULL,NULL,1,false,true,false,'','RF64 is a Broadcast Wave compatible multichannel file format enabling file sizes to exceed 4 GB. The file format is based on the Microsoft RIFF/WAVE format and Wave Format Extensible for multichannel parameters. Additions are made to the basic specification to allow for more than 4 GB file sizes when needed (the new maximum filesize is now approximately 16 exabytes).',NULL,NULL)
,('e81e4e2d-ee9b-4bcd-857e-6467abd560ae','2019-10-01 18:11:30.895','2019-10-01 18:11:30.895',NULL,'9359c885-5de3-4366-a72a-3c635da1b200','',NULL,NULL,NULL,NULL,1,false,true,false,'','RF64 is a Broadcast Wave compatible multichannel file format enabling file sizes to exceed 4 GB. The file format is based on the Microsoft RIFF/WAVE format and Wave Format Extensible for multichannel parameters. Additions are made to the basic specification to allow for more than 4 GB file sizes when needed (the new maximum filesize is now approximately 16 exabytes).

An RF64 file containing the bext chunk becomes a Multichannel Broadcast Wave format. Further research is required to better understand this format. Users with samples are encouraged to contact the PRONOM team.',NULL,NULL)
,('c418f293-00d1-490b-a45d-f934307d7b50','2019-10-01 18:11:31.334','2019-10-01 18:11:31.334',NULL,'ccd4d930-0b89-4a29-a2a5-f4286c990846','',NULL,NULL,NULL,NULL,1,false,true,false,'0','Rich Text Format (RTF) is a format developed by Microsoft to encode formatted text and graphics for use within applications or for data and formatting transfer between applications. It is closely associated with Microsoft Word, and new versions are developed with each release of Word. RTF files are encoded in plain text, typically ASCII, and consists of a series of control words, control symbols and groups. An RTF file comprises a Header section, containing various header tables, followed by a Document section, containing the document content and formatting.

RTF0 may predate version 1.0 of the RTF specification which is known to date from at least 1992. Please contact the PRONOM team if you are aware of or have access to a formal specification for RTF0.',NULL,NULL)
