,('ef9932aa-56e1-4a50-8f87-66c75feedf51','2019-10-01 18:11:37.106','2019-10-01 18:11:37.106',NULL,'bdbdc836-9421-47f5-9c73-ba2804fd2083','',NULL,NULL,NULL,NULL,1,false,true,false,'1','RPM Package Manager file (RPM) was previously known as a Red Hat Package Manager File. It is a file used by RPM Package Manager which is a package management system. RPM files currently appear in two defined types, the first is binary package files containing the compiled version of certain software. The second is source package files containing the source code used to produce a package. These have an appropriate tag in the file header that distinguishes them from Binary RPMs, causing them to be extracted to /usr/src on installation. Source package files customarily carry the file extension “.src.rpm".',NULL,NULL)
;
