,('b7f5fc61-d7d5-44ae-9276-938338568ab4','2019-10-01 18:11:40.612','2019-10-01 18:11:40.612',NULL,'3da944bb-568c-4779-b9f8-8512b38c3a27','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','SVG is a language for describing two-dimensional graphics in XML. SVG allows for three types of graphic objects: vector graphic shapes (e.g., paths consisting of straight lines and curves), images and text. Graphical objects can be grouped, styled, transformed and composited into previously rendered objects. The feature set includes nested transformations, clipping paths, alpha masks, filter effects and template objects. SVG drawings can be interactive and dynamic. Animations can be defined and triggered either declaratively (i.e., by embedding SVG animation elements in SVG content) or via scripting.',NULL,NULL)
