('80d04c72-d850-4850-95d3-cb7a2c9c59d3','2019-10-01 18:11:54.476','2019-10-01 18:11:54.476',NULL,'7199bbb8-4645-4f5f-9281-7041550ae18e','',NULL,NULL,NULL,NULL,1,false,true,false,'Home Office','Serif PagePlus is a desktop publishing application. This format is based on the OLE2 Compound Document Format and can be identified in DROID 6 and later via a container signature. At this time the signature identification is baed upon the version number of the generating software as shown in the ''SummaryInformation'' file within the OLE2 compound container. This may be improved with a better understanding of the format.',NULL,NULL)
,('bb45d64d-9ae9-46db-8525-ce3e963f58b5','2019-10-01 18:11:54.923','2019-10-01 18:11:54.923',NULL,'1c337d1c-4870-4998-b87e-746c0015822e','',NULL,NULL,NULL,NULL,1,false,true,false,'','SHA-1 (Secure Hash Algorithm 1) is a cryptographic hash function designed by the United States National Security Agency and is a U.S. Federal Information Processing Standard published by the United States NIST. SHA-1 produces a 160-bit (20-byte) hash value. It can be used as a checksum to verify data integrity. The SHA1 file is a text document which contains single or multiple SHA1 values.',NULL,NULL)
,('bee87410-cde2-4685-b153-1ff49e2eeaa3','2019-10-01 18:11:55.405','2019-10-01 18:11:55.405',NULL,'c1be7e16-2e94-494b-9b4d-3ce344d9490a','',NULL,NULL,NULL,NULL,1,false,true,false,'','SHA256 is part of the family of SHA-2 (Secure Hash Algorithm 2) hash functions which are designed by the United States National Security Agency. SHA256 prodcues a 256-but (32-byte) hash value. It can be used as a checksum to verify data integrity. The SHA256 file is a text document which contains single or multiple SHA1 values.',NULL,NULL)
,('59de0cb5-9c48-4d6f-9552-c487f0fe813b','2019-10-01 18:11:55.899','2019-10-01 18:11:55.899',NULL,'12ed5354-db81-4748-bc74-37650e96adc4','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('97eaefb7-6022-46e1-9db6-c344ac82ef5f','2019-10-01 18:11:56.253','2019-10-01 18:11:56.253',NULL,'8a0f55be-6add-4113-b6de-f682916bf3ab','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure (database metadata) as well as a collection of XML files describing the table content (database primary data) as well as - optionally - some text files and some binary files representing database large objects (BLOBs and CLOBs). SIARD format is used for archiving databases adhering to the SQL (ideally SQL:1999 core) standard.',NULL,NULL)
,('a6618f61-780c-4b4d-b20b-ffe0f05247c6','2019-10-01 18:11:56.658','2019-10-01 18:11:56.658',NULL,'663df8c4-f01d-4b6a-b7a7-d5faac329f28','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).',NULL,NULL)
,('508aeae7-e2a3-4799-9d8b-63b2bd45a68c','2019-10-01 18:11:57.128','2019-10-01 18:11:57.128',NULL,'bd724e7d-7bcb-45c4-bdec-cc2a27b60d8f','',NULL,NULL,NULL,NULL,1,false,true,false,'2.1','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).',NULL,NULL)
,('77b109aa-11b8-41d8-89ca-c43daa805ec9','2019-10-01 18:11:57.617','2019-10-01 18:11:57.617',NULL,'1fd8543c-77de-4f3a-baaa-a788c1fab408','',NULL,NULL,NULL,NULL,1,false,true,false,'','Sibelius is a WYSIWYG scorewriter program, created by Sibelius Software (now part of Avid Technology) for Microsoft Windows, Mac OS X, and historically RISC OS. It is used by composers, arrangers, performers, music publishers, teachers and students, particularly for writing classical, jazz, band, vocal, film and television music.',NULL,NULL)
,('51985476-1255-4143-a4d0-2846de76fdfc','2019-10-01 18:11:58.047','2019-10-01 18:11:58.047',NULL,'b43835bc-4909-4bf8-afbb-36b3a204063c','',NULL,NULL,NULL,NULL,1,false,true,false,'','A text-based file used by Sibelius music composition software to list the file system locations of sound files in use within a composition.',NULL,NULL)
,('8ca8aa81-6bc8-43ea-b940-fae0f445791c','2019-10-01 18:11:58.471','2019-10-01 18:11:58.471',NULL,'54505882-3c45-433a-8944-36e81cef1fbb','',NULL,NULL,NULL,NULL,1,false,true,false,'','WinAVA is architectual and engineering CAD software developed by Austrian company, Sidoun.',NULL,NULL)
;
