('bb478e8b-0f7c-4714-8e3e-b33a3a545200','2019-10-01 18:11:58.935','2019-10-01 18:11:58.935',NULL,'a17646ad-cfdd-4c10-b8d4-6d8ee051ff1d','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Siegfried signature file is used by Siegfried, a file format identification tool created by Richard Lehane that uses PRONOM, and freedesktop.org''s MIME-info file format signatures.',NULL,NULL)
,('a212ac5c-8a87-44f5-85dd-ef56ffd46384','2019-10-01 18:12:02.811','2019-10-01 18:12:02.811',NULL,'f2830767-618b-4ca8-9187-52a1af29baee','',NULL,NULL,NULL,NULL,1,false,true,false,'','SketchUp is a 3D content creation tool. PRONOM currently does not distinguish between different versions of SketchUp documents but the ability to distinguish between different file format versions may be desirable and possible with a better understanding of the format.',NULL,NULL)
,('91bf6d0e-9e11-4464-8b53-6c8f737783b5','2019-10-01 18:12:03.179','2019-10-01 18:12:03.179',NULL,'bd122137-3441-4f58-ae2f-ef069f51b559','',NULL,NULL,NULL,NULL,1,false,true,false,'','PUID deprecated. Please see x-fmt/451: SketchUp Document',NULL,NULL)
,('b0099fe8-6623-4bbd-998d-f6b5d8ba518e','2019-10-01 18:12:03.585','2019-10-01 18:12:03.585',NULL,'1a977ed0-a226-4f74-a726-b716dabd14ee','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','DigiDoc is a digital signature format specific to Estonia. The format is based on the ETSI TS 101 903 Standard ‘XML Advanced Electronic Signatures (XAdES)’. DigiDoc corresponds to the XAdES profile ‘XAdES-X-L’. A DigiDoc container includes source files (the files that were signed) as well as signatures that are related to the signed file(s). Also every signature contains the certificate, validity confirmation and the validity confirmation service certificate. https://www.id.ee/?id=35780',NULL,NULL)
,('d0123344-221d-48fe-bc41-3161ac9a7480','2019-10-01 18:12:04.000','2019-10-01 18:12:04.000',NULL,'9d3c150b-a01b-4b66-b8b8-136e29af8c10','',NULL,NULL,NULL,NULL,1,false,true,false,'','SmartDraw is a visual processor used to create flowcharts, organisation charts, mind maps, project charts, and other visuals.',NULL,NULL)
,('4993aa09-198e-42d6-9cf1-ab1248f29fdb','2019-10-01 18:12:04.448','2019-10-01 18:12:04.448',NULL,'6ae132aa-e74b-425c-bb2c-7f2bafe55114','',NULL,NULL,NULL,NULL,1,false,true,false,'','Snap Survey provides a selection of software which allows users to design surveys. The SNAP Survey archive file is an compressed version of the SNAP Meta Data and if one is present a SNAP Raw Data file. If it is a survey with email invitations, and responses, it also compresses system files about the current state of the mailing.',NULL,NULL)
,('3549e0f6-0cc8-4d3b-9fee-acf60ad2feb7','2019-10-01 18:12:04.888','2019-10-01 18:12:04.888',NULL,'b9fb6bae-880c-454d-be2d-a92df39bef42','',NULL,NULL,NULL,NULL,1,false,true,false,'','Snap Survey provides a selection of software which allows users to design surveys. The SNAP Meta Data file is generated and is used to build and manage the survey.',NULL,NULL)
,('33fdceaa-21e7-4daa-a3bd-026b14569bfd','2019-10-01 18:12:05.294','2019-10-01 18:12:05.294',NULL,'4bc795bf-d4f0-47c8-b503-2e409b131091','',NULL,NULL,NULL,NULL,1,false,true,false,'','Snap Survey provides a selection of software which allows users to design surveys.',NULL,NULL)
,('44857da7-da24-4832-a647-9cf253ba463f','2019-10-01 18:12:05.694','2019-10-01 18:12:05.694',NULL,'9857cc31-0639-48d9-971d-15378982dc2e','',NULL,NULL,NULL,NULL,1,false,true,false,'','Snoop is a packet capture file format originally developed by Sun.',NULL,NULL)
,('5eda62b4-10e1-456f-9f5c-2556ca633e21','2019-10-01 18:12:06.200','2019-10-01 18:12:06.200',NULL,'9a47af92-9554-4bf9-86d8-908e068ccf80','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Softimage 3D Picture format is a native raster image format of Autodesk''s Softimage 3D computer graphics application. A full technical description of the format can be found in the Internet Archive: https://web.archive.org/web/20160802085201/http://softimage.wiki.softimage.com/index.php/?title=PIC_file_format',NULL,NULL)
