,('ac58fadb-77d5-46e6-9a4c-4e8a4a90e2b4','2019-10-01 18:12:11.321','2019-10-01 18:12:11.321',NULL,'c920628b-4b90-4ee3-8544-8a18c6f7f80f','',NULL,NULL,NULL,NULL,1,false,true,false,'','SPSS (Statistical Package for the Social Sciences) is a software package used for statistical analysis in the social sciences. The first version of SPSS was developed by SPSS Inc. in 1968 and has since had eighteen stable version releases.  In 2009 SPSS Inc. was acquired by IBM.  As of version 17.0.1 SPSS software has been known as Predictive Analytics Software. SPSS is used widely by both academics and other social researchers.
SPSS creates an SPSS Output File which represents data in a two dimensional format where the rows are used to represent case values such as a place or personal name and the columns are used to represent measurements such as age or GDP. SPSS Output File is a proprietary file format. From SPSS version 16 and onwards the SPSS Output File has an .spv suffix. There is no backward compatibility for files generated by previous versions of SPSS.',NULL,NULL)
