,('acd2832e-605b-4055-84e4-f095d3d3fa31','2019-10-01 18:12:38.193','2019-10-01 18:12:38.193',NULL,'b8645e54-fef4-40c4-bd7c-e8a03840a99e','',NULL,NULL,NULL,NULL,1,false,true,false,'','STL is a 3D modelling file format created by 3D Systems. An STL file is a triangular representation of a 3-dimensional surface geometry. The surface is tessellated or broken down logically into a series of small triangles (facets). Each facet is described by a perpendicular direction and three points representing the vertices (corners) of the triangle. These data are used by a slicing algorithm to determine the cross sections of the 3-dimensional shape to be built by the fabricator.',NULL,NULL)
,('675d35b6-df78-4089-803b-92424c481f18','2019-10-01 18:12:38.621','2019-10-01 18:12:38.621',NULL,'07957f44-ebe4-4d0a-be95-c3525b37db7a','',NULL,NULL,NULL,NULL,1,false,true,false,'','STL is a 3D modelling file format created by 3D Systems. An STL file is a triangular representation of a 3-dimensional surface geometry. The surface is tessellated or broken down logically into a series of small triangles (facets). Each facet is described by a perpendicular direction and three points representing the vertices (corners) of the triangle. These data are used by a slicing algorithm to determine the cross sections of the 3-dimensional shape to be built by the fabricator.

The structure of STL Binary, though well defined, makes it impossible to create an identification signature under the current PRONOM signature model.

The format consists of an 80 byte ASCII header with no formalized structure, followed by a four byte integer value representing the number of facets within the file, followed by 48 bytes of floating point values representing the ''normal'' and ''vertex'' coordinates within 3 dimensional space for each triangle, followed by a two byte, typically (but not exclusively) unused ''attribute byte count''.

A technical specification may be found here: http://www.fabbers.com/tech/STL_Format',NULL,NULL)
,('262635d3-4089-4b83-bef3-52c92abf0a63','2019-10-01 18:12:39.018','2019-10-01 18:12:39.018',NULL,'edc668c9-53fd-4949-b1be-fd7b356ca3db','',NULL,NULL,NULL,NULL,1,false,true,false,'','Strata StudioPro was a 3D modeling application developed by Strata3D for the Macintosh operating system. The vis format contains models and textures of a 3D scene. Formats of this type may lack an extension.',NULL,NULL)
