INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('04b5cdf1-811b-4002-b853-dd08ae57eec0','2019-10-01 18:12:45.408','2019-10-01 18:12:45.408',NULL,'096222a2-fd2b-4ec8-9502-53185164b281','',NULL,NULL,NULL,NULL,1,false,true,false,'','A tab-separated values file is a simple text format for storing data in a tabular structure (e.g. database or spreadsheet data). Each record in the table is one line of the text file. Each field value of a record is separated from the next by a tab stop character – it is a form of the more general delimiter-separated values format.',NULL,NULL)
,('029bc6d5-65b1-42d1-9f21-0429b48206d8','2019-10-01 18:12:45.979','2019-10-01 18:12:45.979',NULL,'1c1207fb-0068-49eb-905e-f0842592d224','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Tagged Image File Format (TIFF) is a raster image format originally developed by the Aldus Corporation, primarily for use in scanning and desktop publishing. When Adobe Systems Incorporated purchased Aldus in 1994, they acquired the rights to the TIFF format and have maintained it since then. TIFF files comprise three sections: an Image File Header (IFH), an Image File Directory (IFD), and the image data. TIFF files can contain multiple images (multi-page TIFF), and each image has a separate IFD. The IFH always appears at the beginning of the file, and is immediately followed by a pointer to the first IFD. The IFD contains metadata which describes the associated image, stored as a series of tags. The IFD also contains a pointer to the actual image data. TIFF supports colour depths from 1 bit to 24 bit (e.g. monochrome to true colour), and a wide range of compression types (RLE, LZW, CCITT Group 3 and Group 4, and JPEG), as well as uncompressed data.','1986-08-01 00:00:00.000',NULL)
,('ac3e3568-175f-4d38-b366-60b509da562b','2019-10-01 18:12:46.519','2019-10-01 18:12:46.519',NULL,'987c85da-0a31-4135-aa73-4f1d8851f32a','',NULL,NULL,NULL,NULL,1,false,true,false,'3','PUID deprecated. Please see fmt/353 for information on Tagged Image File Format.',NULL,NULL)
,('cbe6aab3-b448-4c62-9af0-f75ace863a4a','2019-10-01 18:12:46.934','2019-10-01 18:12:46.934',NULL,'4a0e6ab5-24f0-428f-8dc5-e11ae9f7a77a','',NULL,NULL,NULL,NULL,1,false,true,false,'4','PUID deprecated. Please see fmt/353 for information on Tagged Image File Format.',NULL,NULL)
