,('b07af0ee-8322-48ae-9fba-d0604353768d','2019-10-01 18:12:51.783','2019-10-01 18:12:51.783',NULL,'584a70f1-4b2b-4d16-9561-2356911b409e','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('507c15c6-5a98-445d-8968-8869c7a3316d','2019-10-01 18:12:52.193','2019-10-01 18:12:52.193',NULL,'a898ce32-b7ee-40d7-89a8-fe11412907c9','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Device Independent File Format (DVI) is the output file format of the TeX typesetting program. DVI files comprise binary data describing the visual layout of a document in a device-independent manner. A DVI file consists of a preamble, a sequence of commands defining one or more pages of text, and a postamble. Each command comprises an eight-bit opcode, followed by zero or more bytes of parameters. DVI driver software is required to render or print DVI files, or to convert them to other formats, such as PostScript or PDF.','1979-01-01 00:00:00.000',NULL)
,('b9e871a3-bcce-4861-8da4-8944bb5a14a2','2019-10-01 18:12:52.653','2019-10-01 18:12:52.653',NULL,'f1e9324d-1a64-4c69-b06a-5ffbbeb13c3b','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('466430c4-1151-4b54-892d-baf565201fc2','2019-10-01 18:12:52.993','2019-10-01 18:12:52.993',NULL,'4e646d6a-43da-465c-ab85-840f27559252','',NULL,NULL,NULL,NULL,1,false,true,false,'1','A Neuroimaging format used in medical industry for the analysis of scans of x-rays.',NULL,NULL)
,('77d59d1b-fefa-47a6-be6a-56075e39ab1d','2019-10-01 18:12:53.418','2019-10-01 18:12:53.418',NULL,'5dba8231-3481-4da5-9227-ee77109697b1','',NULL,NULL,NULL,NULL,1,false,true,false,'2','A Neuroimaging format used in medical industry for the analysis of scans of x-rays. Version 2 is an extended version of NIfTI allowing 64 bit storage and addressing.',NULL,NULL)
,('05924e5b-650d-46ef-bfae-a85f56d91ddd','2019-10-01 18:12:53.931','2019-10-01 18:12:53.931',NULL,'8b6b343d-d5fb-4622-8a2d-68ed79abc07b','',NULL,NULL,NULL,NULL,1,false,true,false,'XP','A thumbs.db file is generated automatically within Microsoft Windows environments (although the automatic creation behaviour can be turned off). It is generally a hidden system file and its purpose is to hold thumbnail images of any images stored within a given folder. This format is based on the OLE2 Compound Document Format and can be identified in DROID 6 and later via a container signature. Structurally it holds a Catalog file that indexes the thumbnails, and a file per image that contains the image data in a JPEG format with additional data preceeding the image data. At this time the signature is the result of reverse engineering work conducted by Ross Spencer, Richard Lehane and others. The Catalog file consists of a 4 byte opening sequence that appears to act as an identifier and database version number, followed by two bytes indicating the number of images within the thumbs.db file, followed by information relating to the resolution of the images. This signature is likely to be improved with further research and a better understanding of the format structure. This particular format is known to be produced in Windows XP environments, but may also apply to other Windows operating systems. Later thumbs.db files hold a different structure which cannot yet be suitably represented within a DROID container signature.',NULL,NULL)
,('f870f629-e958-4ae4-852b-29780e8184ea','2019-10-01 18:12:54.366','2019-10-01 18:12:54.366',NULL,'cc5aec8f-ac11-4068-afc6-2a114674698d','',NULL,NULL,NULL,NULL,1,false,true,false,'','TransXChange is a UK national data standard for the exchange of bus route and timetable information. The standard is sponsored by the UK Department for Transport and is mandated by the Vehicle Operating Services Agency (VOSA) for the electronic registration of UK bus services with Traffic Area Offices (TAO) and Local Authorities. It is a subset of XML.',NULL,NULL)
,('0fb75ec8-acce-4c22-a936-0082f45d2d58','2019-10-01 18:12:54.769','2019-10-01 18:12:54.769',NULL,'0d802b0f-df02-4a42-aef2-f89b0435dda6','',NULL,NULL,NULL,NULL,1,false,true,false,'','TRIM is an electronic document and records management system developed by Hewlett Packard. The TRIM Context Reference file contains metadata relating to a digital object and acts as a link to that object.',NULL,NULL)
;
