('d2265f45-bc29-41d3-9a3d-592023fe5586','2019-10-01 18:12:55.189','2019-10-01 18:12:55.189',NULL,'c30f7e04-7089-4eb3-9a82-7bc269938123','',NULL,NULL,NULL,NULL,1,false,true,false,'1','True Audio is a lossless audio compression format for multichannel 8, 16 and 24 bits audio data.',NULL,NULL)
,('29ea9625-50ef-4cbc-b6f2-46ebe4b9e1dd','2019-10-01 18:12:55.598','2019-10-01 18:12:55.598',NULL,'a86ea0ba-dbd1-474f-a40c-57257af223e4','',NULL,NULL,NULL,NULL,1,false,true,false,'2','True Audio is a lossless audio compression format for multichannel 8, 16 and 24 bits audio data.',NULL,NULL)
,('f7ecc5a0-2792-43ab-90d6-d958b4bff0ec','2019-10-01 18:12:56.102','2019-10-01 18:12:56.102',NULL,'bb03b33c-6899-4a29-bc6b-ee70a29f186e','',NULL,NULL,NULL,NULL,1,false,true,false,'','Created by Apple, TrueType Font files are a sequence of concatenated tables (a table is a sequence of words; each table must be long aligned and padded with zeroes if necessary). The first of the tables is the font directory, a special table that facilitates access to the other tables in the font. The directory is followed by a sequence of tables containing the font data. These tables can appear in any order. Certain tables are required for all fonts. Others are optional depending upon the functionality expected of a particular font. The tables have names known as tags. Tags have the type uint32. Currently defined tag names consist of four characters. Tag names with less than four characters have trailing spaces. When tag names are shown in text they are enclosed in straight quotes. Tables that are required must appear in any valid TrueType font file. Also notable is that Apple makes a distinction between a "TrueType font" (which refers to a particular font outline definition technology) and an "sfnt-housed font," which refers to any font which uses the same packaging format as a TrueType font: that is, it uses the same directory structure and the same table format and meaning for any tables present.','2003-12-18 00:00:00.000',NULL)
,('16b9e7a5-fab9-431d-bf90-331dc357a855','2019-10-01 18:12:56.618','2019-10-01 18:12:56.618',NULL,'6cb2c482-2de2-4d5d-bf1d-4373b90e7837','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('3d94e5ba-88e1-490c-a86f-990c7357ed44','2019-10-01 18:12:57.100','2019-10-01 18:12:57.100',NULL,'b6c0ee80-1ea9-4dcf-bd47-3ec24421699f','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','The Truevision TGA File Format comprises 5 areas, each of which contains one or more fields of fixed or variable length. The 5 file areas are: (1) TGA File Header, (2) Image/Color Map Data, (3) Developer Area, (4) Extension Area and (5) TGA File Footer.
The last 3 areas, the Developer Area, the Extension Area and the TGA File Footer are new to the file specification as of September, 1989. For this reason, images created with software written before September, 1989 will probably not contain these three fields.',NULL,NULL)
