,('888e375d-d0b0-4675-b194-1a9a81b57774','2019-10-01 18:12:58.701','2019-10-01 18:12:58.701',NULL,'14818d54-2e2c-4874-bf45-d1c56a9ce10f','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('1c05c7d8-f4a6-4f5e-9cfa-a847e45823c5','2019-10-01 18:12:59.113','2019-10-01 18:12:59.113',NULL,'7e43e96b-e382-49d9-b7fd-8d7ac87d264a','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Unified Emulator Format (UEF) was developed by Thomas Harte and is a format that is used to store audio tapes, ROMs, floppy discs and machine state snapshots for the 8-bit range of computers manufactured by Acorn Computers. UEF files can be created using an application called MakeUEF which converts audio samples into UEF files, MakeUEF claims to be the sole creator of UEF files available on websites prior to November 2004. From version 1.0 of MakeUEF the fidelity of the software was improved and an additional extension of .hq.uef (meaning high quality) was adopted for these files.',NULL,NULL)
;
