('ad6ea529-e013-4cb7-ae90-0b27fd7a781f','2019-10-01 18:13:08.170','2019-10-01 18:13:08.170',NULL,'a68270f5-61c0-418a-8a36-1a844fddcaa7','',NULL,NULL,NULL,NULL,1,false,true,false,'','Vectorworks is a proprietary Computer Aided Design and Building Information Modelling software program for both Mac and Windows operating systems. This software was previously called MiniCAD from 1985 - 1998 and  Vectorworks from 1999.',NULL,NULL)
