,('3adb2981-1f65-4b51-8879-e283db63eb2b','2019-10-01 18:13:09.414','2019-10-01 18:13:09.414',NULL,'6e1a52cb-dbc4-484f-a96a-e0a36cb671c6','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Document Dataset Descriptor Style Set file contains definitions for all internal fields included in the default schema for the collection’s document table.',NULL,NULL)
,('3365b79f-c796-4650-9e7b-832355d52e7b','2019-10-01 18:13:09.804','2019-10-01 18:13:09.804',NULL,'3858ac01-e582-4a2c-8117-9f8ab1405c74','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files.',NULL,NULL)
,('ff68b907-2b4d-467e-88fe-1176d97cd4a4','2019-10-01 18:13:10.181','2019-10-01 18:13:10.181',NULL,'604d22fd-b364-41f1-a5d2-03c42cdaf7a5','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. Verity Collection Index About files give general collection information and assist in optimising searches.',NULL,NULL)
,('eee98288-97f4-4858-8057-cb382a181ef9','2019-10-01 18:13:10.580','2019-10-01 18:13:10.580',NULL,'83908a18-f75c-4d35-a2a9-0b603790dc06','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files.',NULL,NULL)
,('cbf1df39-4fe3-419d-b8e0-f5ffa11b7a2e','2019-10-01 18:13:10.994','2019-10-01 18:13:10.994',NULL,'9874b21d-7f30-4e06-8afe-746f44c233fd','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Index Pending Transaction Files store information on pending indexing transactions.',NULL,NULL)
,('21fc6247-dd0b-4ca4-8c89-c90d8fe67ad7','2019-10-01 18:13:11.400','2019-10-01 18:13:11.400',NULL,'c24b5576-82fd-479d-9d8f-339d1cc268af','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Index Style Policy specifies the indexing mode to be used for a collection.',NULL,NULL)
,('f237f189-37b6-4777-8902-9a72e6c160ba','2019-10-01 18:13:11.863','2019-10-01 18:13:11.863',NULL,'b5bf0da3-96a9-4326-b2e0-db078a0fdf09','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Partition Definition Descriptor Style Set contains parameters for configuring and managing the collection’s partitions.',NULL,NULL)
;
INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('3a60b927-3a5c-407e-abcc-b176b78b3cf9','2019-10-01 18:13:12.216','2019-10-01 18:13:12.216',NULL,'daf9f092-e03a-4015-a6b4-bf08a4691762','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Stop List file contains a list of words that are to be excluded from a collection’s full-word index.',NULL,NULL)
,('50a11fcd-32d2-43cd-9c91-02425fcbff82','2019-10-01 18:13:12.650','2019-10-01 18:13:12.650',NULL,'7699a68f-3662-45fb-a7a6-0cf1aab8bd24','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Verity collection is the fundamental structure underlying the search capabilities of Verity applications. A collection consists of information about a particular set of documents that are available for searching and viewing. The specific information stored for a collection includes a word index and various other indexes, plus a document table containing document field information and logical pointers to the document files. The Verity Collection Document Index Descriptor Style Set configures a word index that includes
all partitions of the collection. The spanning word list is an optional index that aids fast searching.',NULL,NULL)
,('56bd00a8-03ae-452d-8060-256ea3ac781d','2019-10-01 18:13:13.106','2019-10-01 18:13:13.106',NULL,'7eb6b25d-9a96-4987-8758-7989245e0798','',NULL,NULL,NULL,NULL,1,false,true,false,'','The VICAR  image file format is used primarily for storing planetary image data collected by both interplanetary spacecraft and Earth-based stations. Many astronomical and astrophysical organizations use and support the VICAR format.
Full specifications available at http://www-mipl.jpl.nasa.gov/external/VICAR_file_fmt.pdf',NULL,NULL)
,('8a90b0d2-f32e-4a4e-aa84-41f5ff3087c6','2019-10-01 18:13:13.536','2019-10-01 18:13:13.536',NULL,'fbd6d249-a911-4610-9eba-84d8c954ee34','',NULL,NULL,NULL,NULL,1,false,true,false,'','A Video Object File (or VOB) is a strict subset of the MPEG-2 Program Stream, primarily used within DVD video. A VOB will contain an extended private stream containing both ''Packet Control Information'', and ''Data Search Information''.',NULL,NULL)
,('ebdc09c1-7c2c-479e-9467-f19d705b77ff','2019-10-01 18:13:14.012','2019-10-01 18:13:14.012',NULL,'cf054459-d057-4db9-8e61-23bf17a8cf0f','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is a group of formats created by the Virtools software application. Originally released in 1993, Virtools offered a development environment to create interactive 3D applications.

Virtools includes four format types, Composition files, Object files, Player files and Scripts files.

Virtools Composition files have an extension of .cmo, these contain an arrangement of one or more elements or associated behaviours which are assembled within Virtools.
Virtools Object files have an extension of .nmo and contain one or more elements or scripts.
Virtools Player files have an extension of .vmo and contain a composition that has been exported from Virtools and are read only files.
Virtools Script files have an extension of .nms and contain a script or a behaviour graph.

Currently PRONOM is unable to distinguish between these four different formats, if you are able to provide any information around this format please contact pronom@nationalarchives.gov.uk.',NULL,NULL)
,('ddfb6398-0151-40ed-942b-cc1db636918e','2019-10-01 18:13:14.429','2019-10-01 18:13:14.429',NULL,'d88cf1c6-6000-4753-b80b-a96c0acc7763','',NULL,NULL,NULL,NULL,1,false,true,false,'','VDI (Virtual Disk Image) is the native format used for storage by VirtualBox virtual machines.',NULL,NULL)
,('5608e075-2ca2-4da1-b480-3cb59726fb17','2019-10-01 18:13:14.850','2019-10-01 18:13:14.850',NULL,'5f7de1f4-869d-445d-8ee8-2cfedfbe31ee','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','The Virtual Reality Modeling Language (VRML) is a language for describing multi-participant interactive simulations - virtual worlds networked via the global Internet and hyper-linked with the World Wide Web. All aspects of virtual world display, interaction and internetworking can be specified using VRML. It was created with the goal of becoming the standard language for interactive simulation within the World Wide Web. The first version of VRML allows for the creation of virtual worlds with limited interactive behaviour. These worlds can contain objects which have hyper-links to other worlds, HTML documents or other valid MIME types. Nodes are arranged in hierarchical structures called scene graphs, which also define an ordering of the nodes.',NULL,NULL)
,('2f55ca9d-df52-42b2-a0f0-5cabb6f2ee1d','2019-10-01 18:13:15.253','2019-10-01 18:13:15.253',NULL,'8fb275b2-7e4a-479b-a3cd-a11c3b265a4b','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','The Virtual Reality Modeling Language (VRML) is a file format for describing 3D interactive worlds and objects. It may be used in conjunction with the World Wide Web. It may be used to create three-dimensional representations of complex scenes such as illustrations, product definition and virtual reality presentations.  VRML is capable of representing static and animated objects and it can have hyperlinks to other media such as sound, movies, and image. Interpreters (browsers) for VRML are widely available for many different platforms as well as authoring tools for the creation VRML files. VRML supports an extensibility model that allows new objects to be defined and a registration process to allow application communities to develop interoperable extensions to the base standard. There is a mapping between VRML elements and commonly used 3D application programmer interface (API) features.',NULL,NULL)
,('a575f952-6d0f-40a9-aadf-02820c226a24','2019-10-01 18:13:15.798','2019-10-01 18:13:15.798',NULL,'53b12619-605e-4a60-89f4-583d5f830b0c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('2b5b8ed8-284b-4a89-a646-446b9cf31965','2019-10-01 18:13:16.314','2019-10-01 18:13:16.314',NULL,'2f38ab57-a0a5-4a39-a37e-8d5609e2956c','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
