('4560e4fd-4cf1-46bf-ab77-8d68f2979fad','2019-10-01 18:13:16.696','2019-10-01 18:13:16.696',NULL,'2ee366bc-0b18-40d6-931d-5d3080553869','',NULL,NULL,NULL,NULL,1,false,true,false,'','A .vb file is typically a source file written in the Visual Basic programming Language. It contains Visual Basic code but doesn''t have a header or mandatory elements that can be used by PRONOM for identification purposes.',NULL,NULL)
,('9c69047b-5f6d-4c52-b774-72140f91554a','2019-10-01 18:13:17.097','2019-10-01 18:13:17.097',NULL,'ab87d357-9cfe-41cc-933b-d3d5dff3e88f','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('89bb5f02-259e-4bc3-8bfd-999a4b558d8f','2019-10-01 18:13:17.530','2019-10-01 18:13:17.530',NULL,'2e7e3233-04a0-4ab3-9e35-c1c317e54675','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('a6c15daf-11fc-434a-bffe-5eed50f03d6e','2019-10-01 18:13:17.931','2019-10-01 18:13:17.931',NULL,'b3653b0e-b28e-4c4c-8f3c-139223a6c852','',NULL,NULL,NULL,NULL,1,false,true,false,'','VivoActive is an audio/video format created by Vivo Software, acquired by RealNetworks in 1997. It uses H.263 video and G.723 ADPCM audio. VivoActive uses inter-frame coding, but does not insert any key frames, except at the beginning of the clip, which effectively disables the possibility of seeking to specific locations in the stream. The VivoActive technology was integrated to the RealMedia, the .viv format was replaced by .rm (RealMedia).',NULL,NULL)
,('3187d808-0d06-4844-8345-5df38da341d8','2019-10-01 18:13:18.342','2019-10-01 18:13:18.342',NULL,'1a7ec93e-4e6a-4110-90f1-0e0c7e23ad3c','',NULL,NULL,NULL,NULL,1,false,true,false,'','VLW is a font file created by the Processing Development Environment. At this stage no identification signature exists, but this may be possible with further research.',NULL,NULL)
,('96f26cb9-aaac-4cfe-9fd8-6f457eba5646','2019-10-01 18:13:18.727','2019-10-01 18:13:18.727',NULL,'43cde904-26a2-466c-bc56-09ce08f51ee9','',NULL,NULL,NULL,NULL,1,false,true,false,'','The WARC (Web ARChive) file format offers a convention for concatenating multiple resource records (data objects), each consisting of a set of simple text headers and an arbitrary data block into one long file. The WARC format is an extension of the ARC file format (ARC) that has traditionally been used to store "web crawls" as sequences of content blocks harvested from the World Wide Web (…)
Besides the primary content recorded in ARCs, the extended WARC format accommodates related secondary content, such as assigned metadata, abbreviated duplicate detection events, later-date transformations, and segmentation of large resources”.
WARC format has been written by the members of the IIPC (http://www.netpreserve.org/) grouped within the ISO/TC46/SC4/WG12.','2009-05-15 00:00:00.000',NULL)
,('908a2174-fe7b-49e5-9827-a9cfb9c994e1','2019-10-01 18:13:19.291','2019-10-01 18:13:19.291',NULL,'be0d526e-9c99-4537-901a-b6ee9b59723c','',NULL,NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVE) is a chunk-based audio format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a WAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It  comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed audio encodings.',NULL,NULL)
,('311271ac-05b1-4aaf-964b-76b7c96a49d1','2019-10-01 18:13:19.837','2019-10-01 18:13:19.837',NULL,'d4df9a8d-0a76-4cbc-b0db-f5bf75367975','',NULL,NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (PCMWAVEFORMAT) is the standard Waveform Audio file format, developed by Microsoft. It has now been superseded by Waveform Audio (WAVEFORMATEX), an extended version.',NULL,NULL)
,('5d07234c-41f4-4dfc-8cf6-a56ac271970d','2019-10-01 18:13:20.333','2019-10-01 18:13:20.333',NULL,'00687062-13d1-4de0-8d91-a28024c26b7b','',NULL,NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVEFORMATEX) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It has superseded the Waveform Audio (PCMWAVEFORMAT).',NULL,NULL)
,('e5e8be4a-41c2-4e8e-973e-6cc56d060893','2019-10-01 18:13:20.747','2019-10-01 18:13:20.747',NULL,'2accbe12-30d7-42dc-b241-dd4a484b8fd4','',NULL,NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVEFORMATEXTENSION) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It is related to the Waveform Audio (WAVEFORMATEX) format, but is an even more extended version.',NULL,NULL)
;
INSERT INTO public.arclib_format_definition (id,created,updated,deleted,format_id,format_note,national_format_guarantor,preservation_plan_description,preservation_plan_file_id,previous_internal_definition_id,internal_version_number,local_definition,preferred,internal_information_filled,format_version,format_description,release_date,withdrawn_date) VALUES
('8b26d280-331c-4431-bc80-51e22159e157','2019-10-01 18:13:21.244','2019-10-01 18:13:21.244',NULL,'3de13764-09cf-4da0-8903-c8222fb5b5b1','',NULL,NULL,NULL,NULL,1,false,true,false,'','MTL is a companion file for the Wavefront OBJ file. The MTL file describes surface shading properties for use by one or more OBJ.',NULL,NULL)
,('a59761f1-504c-4364-96fd-39378be10f17','2019-10-01 18:13:21.765','2019-10-01 18:13:21.765',NULL,'26ac7ef1-fcda-45be-9ce3-b4d2896f0a21','',NULL,NULL,NULL,NULL,1,false,true,false,'','OBJ is an ASCII format for representing 3D geometry. The OBJ format supports both polygonal objects and free-form objects. Polygonal geometry uses points, lines, and faces to define objects while free-form geometry uses curves and surfaces.',NULL,NULL)
,('65216f81-fdda-4705-99ae-14ace52a3a6c','2019-10-01 18:13:22.410','2019-10-01 18:13:22.410',NULL,'0f37c52b-1a7e-49a2-a16d-89cd0d083e99','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats.',NULL,NULL)
,('f01f43d1-0ca6-48f1-bf88-19ef43e03bc5','2019-10-01 18:13:23.009','2019-10-01 18:13:23.009',NULL,'fd9f8b05-3005-4e0f-8b03-66d9d0cf8a70','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats. WOFF 2 was developed to provide improved compression over WOFF 1.',NULL,NULL)
,('f30d7836-4598-48e5-89f8-551158acf123','2019-10-01 18:13:23.534','2019-10-01 18:13:23.534',NULL,'6f4a893c-6a09-471d-bb07-2adc74670f1a','',NULL,NULL,NULL,NULL,1,false,true,false,'','WebM is a media file format, developed by Google based on the Extensible Binary Meta Language.',NULL,NULL)
,('4c6af7a3-bc9f-486c-9b49-cb4bc6b7d588','2019-10-01 18:13:23.949','2019-10-01 18:13:23.949',NULL,'85f06f29-c39c-49dc-8ae0-f60b03840339','',NULL,NULL,NULL,NULL,1,false,true,false,'Extended','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. The extended version of the format allows for alternative colour profiles and animation.',NULL,NULL)
,('fe861633-1738-4b35-aaae-b1a75c05b41e','2019-10-01 18:13:24.403','2019-10-01 18:13:24.403',NULL,'ca83fb97-8669-433e-af58-57485ff88b98','',NULL,NULL,NULL,NULL,1,false,true,false,'Lossless','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebP’s lossless compression uses advanced techniques such as dedicated entropy codes for different color channels, exploiting 2D locality of backward reference distances and a color cache of recently used colors. This complements basic techniques such as dictionary coding, Huffman coding and color indexing transform.',NULL,NULL)
,('d44f4de8-7423-45db-8c2f-9f35f3534278','2019-10-01 18:13:24.835','2019-10-01 18:13:24.835',NULL,'6ae5f37c-0e27-449b-bc97-67fb42929854','',NULL,NULL,NULL,NULL,1,false,true,false,'Lossy','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebP''s lossy compression algorithm is based on the intra-frame coding of the VP8 video format.',NULL,NULL)
,('d68ac67e-3824-4222-9b9d-1674a8d3aba7','2019-10-01 18:13:25.259','2019-10-01 18:13:25.259',NULL,'e5b09c12-176b-4432-b765-6b55e02814b6','',NULL,NULL,NULL,NULL,1,false,true,false,'1.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('24050500-da55-4983-8960-fc65290203ba','2019-10-01 18:13:25.692','2019-10-01 18:13:25.692',NULL,'93c9d734-ea86-425c-818d-881d5c706794','',NULL,NULL,NULL,NULL,1,false,true,false,'2.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.
Windows bitmap 2.0 and OS/2 bitmap 1.0 are effectively the same format - the only difference is the data type of the width and height fields of the bitmap header – for Windows 2.0 bitmaps they are signed short integers, for OS/2 1.0 bitmaps they are unsigned shorts. For positive numbers the representation is the same. Consequently, the file formats cannot be distinguished with a file signature test. The PUID for OS/2 Bitmap 1.0 (x-fmt/25) has therefore been deprecated.',NULL,NULL)
;
