,('17c2a0f8-e22f-4b25-a43a-8ae3dcd3ae45','2019-10-01 18:13:28.218','2019-10-01 18:13:28.218',NULL,'5bbf57c9-2b57-426d-9e38-94867b7190d0','',NULL,NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('55cede29-1706-453d-9a41-e698f31dd8bb','2019-10-01 18:13:28.656','2019-10-01 18:13:28.656',NULL,'b434732a-4274-4da6-a6b8-25eb51968369','',NULL,NULL,NULL,NULL,1,false,true,false,'','The Windows Imaging Format (WIM) is a file-based disk image format developed by Microsoft.',NULL,NULL)
,('ae6bcc04-2bd3-46d0-ab6b-e9fa234a413a','2019-10-01 18:13:29.050','2019-10-01 18:13:29.050',NULL,'d4e95994-398c-4c93-a8fc-b5bf00e109f4','',NULL,NULL,NULL,NULL,1,false,true,false,'','JNT is the native format of Windows Journal, a notetaking application created by Microsoft for Windows operating systems starting with Windows XP. Due to security concerns Microsoft advise against using the format and have supplied a patch for removal of the application (https://support.microsoft.com/en-gb/help/3161102/update-for-windows-journal-component-removal). Microsoft also provide an update that re-installs a version of Windows Journal that highlights the security concerns (https://support.microsoft.com/en-us/help/3162655/windows-journal-application-for-windows). A JTP is a Windows Journal Template file, however this appears to be structurally identical to a JNT file.',NULL,NULL)
,('8db2b294-8f80-488f-b586-0f1834e40aa3','2019-10-01 18:13:29.468','2019-10-01 18:13:29.468',NULL,'6f2ec8a3-a76e-4138-94c5-4bef90f1c710','',NULL,NULL,NULL,NULL,1,false,true,false,'','Windows Media Audio Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing audio data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Audio data is stored using the Windows Media Audio codec, and the format supports streaming across networks.','2004-12-01 00:00:00.000',NULL)
,('b3054663-e8eb-4d00-ba73-42a43047e208','2019-10-01 18:13:29.951','2019-10-01 18:13:29.951',NULL,'06e41920-eb97-4db6-a248-5f28a93a6f46','',NULL,NULL,NULL,NULL,1,false,true,false,'','A media metafile is a file that contains information about other files. A metafile can be used to list a group of media content files that are to be played in order. The .wax metafile references Windows Media files with .asf, .wma, or .wax file name extensions. The .wvx metafile references Windows Media files with .wma, .wmv, .wvx, or .wax file name extensions. The asx metafile references Windows Media files with .wma, .wax, .wmv, .wvx, .asf, or .asx file name extensions.',NULL,NULL)
;
