,('b883dcca-eb13-47aa-b484-1b0e5304b63f','2019-10-01 18:13:30.810','2019-10-01 18:13:30.810',NULL,'2f674cf8-be79-4732-bc44-1e3d8a674657','',NULL,NULL,NULL,NULL,1,false,true,false,'','Windows Media Video Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing video data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Video data is stored using the Windows Media Video codec, and the format supports streaming across networks.','2004-12-01 00:00:00.000',NULL)
