,('f5c4db8d-4226-4cbb-a262-2fa13760cc77','2019-10-01 18:13:35.940','2019-10-01 18:13:35.940',NULL,'71c92b3b-3677-479a-b99d-ed3d032fcecd','',NULL,NULL,NULL,NULL,1,false,true,false,'3.x','WordPerfect is a word processor application currently owned by Corel. Applications implementing the libwpd library should be able to render older WordPerfect documents. WordPerfect documents created within a Macintosh environment are likely to lack a format extension.',NULL,NULL)
