,('3f12dbc0-3c1e-41a9-997e-0d39e0a6f6d0','2019-10-01 18:13:39.750','2019-10-01 18:13:39.750',NULL,'76df8719-f924-4ad5-ada6-61eb5d918d09','',NULL,NULL,NULL,NULL,1,false,true,false,'1','Wordstar 2000 is a version of the Wordstar word proccessor application that was popular in the early to mid 1980s and was created by MicroPro. Wordstar 2000 files are likely to lack a file extension.',NULL,NULL)
,('6479bb9d-e4a3-4943-84b9-9ef2e84e87ca','2019-10-01 18:13:40.179','2019-10-01 18:13:40.179',NULL,'838c5e43-9067-41b8-93ac-c6d4b94fff1b','',NULL,NULL,NULL,NULL,1,false,true,false,'3.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.',NULL,NULL)
,('44ffb078-7aa8-4a93-9ff1-23a6e11badff','2019-10-01 18:13:40.603','2019-10-01 18:13:40.603',NULL,'ddc84025-7743-4e5a-93c8-964b96df9b04','',NULL,NULL,NULL,NULL,1,false,true,false,'4.0','WordStar is a Word Processor application originally published by MicroPro. WS4 files currently cannot by identified though a PRONOM identification signature.

On the surface it''s a plain text file, however the format ''shifts'' the last byte of each word. Effectively it is ''flipping'' the first bit of the ASCII character from 0 to 1. so a lower case ''r'' (hex value 0x72) becomes ''ò'' (hex value 0xF2); lower case ''d'' (hex 0x64) becomes ''ä'' (hex 0xE4) and so on.

It should be possible to write a simple decoder application for WS4 files, however note that the conjecture above is based on observation of a limited pool of files, and there may be additional subtleties yet to be encountered and understood. Please contact the PRONOM team if you have any further information about this format.',NULL,NULL)
