,('6d616ed4-0a2e-4410-afd5-123fcd6c8968','2019-10-01 18:13:45.532','2019-10-01 18:13:45.532',NULL,'ada49253-2c6c-44f6-beba-e53c4951f139','',NULL,NULL,NULL,NULL,1,false,true,false,'3.1','X3D is an integrated 3D graphics and multimedia framework in the ISO process for Information technology — Computer graphics, image processing and environmental representation. The standards pass through a number of member only and then public review processes, until they reach full ISO approval as international standards.',NULL,NULL)
